      "ProgramSummary": "The latest instalment of ITV’s landmark documentary series returns to visit the people whose lives have been followed since they were just seven-years-old.\r\nThe original '7 Up' was broadcast in 1964 as a one-off World in Action Special featuring children chosen from different backgrounds to talk about their hopes and dreams for the future. The series was inspired by World in Action founder editor Tim Hewat’s interest in both the saying: \"Give me the child until he is seven and I will show you the man,\" and the rigid class system of 1960s Britain\r\n7 Up set out to discover whether or not the children’s lives were pre-determined by their background.\r\nDirector Michael Apted, who has since moved to Hollywood to direct films including 'The World Is Not Enough', 'The Chronicles of Narnia' and 'Gorillas in the Mist', has returned every seven years to chart the children’s progress through life. Over the past six decades, the series has documented the group as they have become adults and entered middle-age, dealing with everything life has thrown at them in between. \r\nNow, called '56 Up', the series is back to discover what has happened to the group over the last seven years. ",
      "ProgramTitle": "",
