      "ProgramSummary": "Seven siblings whom nobody expected – but the classical music world desperately needed. The story of the Kanneh-Mason Family reads like a fairytale. They have dealt with prejudice, they have been overlooked, they have been made to feel out of place. But they have picked themselves up and they have proven themselves time and time again. The Kanneh-Masons light up every room they enter and they have found this to ensure the support of people like Prince Harry and Meghan Markle, who invited Sheku to play at their wedding, and Elton John, who supported Isata with a scholarship. This film accompanies this family on their path and join them on and behind the stages of the world as they conquer it together, as they grow into their own as a family of talented musicians. ",
