      "ProgramSummary": "Hosted by Henry Louis Gates Jr., this program features the personal stories of the 2023 recipients of the only national juried prize for literature that confronts racism and explores diversity.  Viewers will travel to Iowa, Massachusetts, Ohio and New Hampshire to hear the inspiring and revealing stories of this yearÃ¢â‚¬â„¢s honorees which include:\r\nGeraldine Brooks, Horse, Fiction \r\nLan Samantha Chang, The Family Chao, Fiction \r\nMatthew F. Delmont, Half American: The Epic Story of African Americans Fighting World War II at Home and \r\n        Abroad, Nonfiction \r\nCharlayne Hunter-Gault, Lifetime Achievement\r\nSaeed Jones, Alive at the End of the World, Poetry \r\n\r\nMembers of the Anisfield-Wolf jury are: chair Henry Louis Gates Jr., poet Rita Dove, novelist Joyce Carol Oates and psychologist Steven Pinker. \r\n",
