      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "Ideastream Public Media is once again honored to present winners of The Anisfield-Wolf Book Awards in a half-hour special available for broadcast beginning January 2025.  This award is the only national juried prize for literature that confronts racism and explores diversity.  \r\n\r\nThe 89th Annual Anisfield-Wolf Book Awards will feature:  Monica Youn for her book of poetry, \"From\"; Ned Blackhawk, for his non-fiction book, \"The Rediscovery of America\" and;  Maxine Hong Kingston, recipient of this year's lifetime  achievement award.  The program is hosted by jury chair Natasha Trethewey, poet, memoirist and Board of Trustees Professor of English at Northwestern University who received a Pulitzer Prize in poetry in 2007 and served as the nation's 19th poet laureate from 2012-2014.  She is also a past recipient of an Anisfield-Wolf Book Award.\r\n\r\nIn announcing the 2024 honorees, Ms. Trethewey said, \"It is a great pleasure to recognize this year's winners, who have used their unique voices and experiences to spark critical conversations. This class joins past recipients, who include literary luminaries and contemporary thought leaders, in leveraging the power of words to explore and confront some of the most challenging topics facing us today.\"\r\n\r\nMembers of the Anisfield-Wolf jury are: chair Natasha Trethewey, poet Rita Dove, novelist Peter Ho Davies, historian Tiya Miles and psychologist Steven Pinker. \r\n\r\n\r\n\r\n\r\n",
