      "ProgramStatus": "Contract",
      "ProgramSummary": "In August, 1881 Lieutenant Adolphus W. Greely and a team of 25 determined men set out as part of the First International Polar Year to build a research station on Ellesmere Island, 450 miles from the North Pole. The Lady Franklin Bay Expedition began as the most ambitious arctic expedition in United States history, but was destined to descend into a three year journey through a frozen hell- a voyage of forced retreat, starvation, brewing mutiny and cannibalism. Against all odds, six men survived and returned to Portsmouth, NH as American heroes.\r\n\r\nGeoffrey Clark became fascinated with the Greely story after an adventure tour he took with his family in 1988 to Ellesmere Island. After 3 preparatory trips to the High Arctic, he organized an expedition in 2004 to retrace the Greely story by kayak, with a crew of scientists, field guides and Greely's great, great grandson, producing the documentary film Abandoned in the Arctic.  The data collected and research done by Greely's Lady Franklin Bay expedition is still relevant today, in light of growing concerns by scientists about climate change and global warming.",
