      "ProgramSummary": "A journey along Ireland's glorious coastline with Adrian Dunbar. \r\nAward-winning actor Adrian Dunbar is reconnecting with his roots as he travels the wild and rugged coast of Ireland. \r\nIn Season 1, Adrian visits breath-taking locations, drives beautiful coastal roads, sees fantastic feats of engineering and tastes Ireland’s amazing cuisine. His travels see him meet friends new and old, and he shares some of his favourite places that fulfil lifetime ambitions, as he makes it to locations he has always wanted to see. \r\n**In Season 2, we get personal with a rare glimpse into Adrian’s childhood as he shares some of his favourite locations in The Emerald Isle – his home. He takes to the waterways and reconnects with Enniskillen, the place where he grew up, and stargazes, just as he did as a young lad. We also join him as he meets old pals in his local pub to share a song...or two! \r\nThe series is filled with fascinating history, food, unrivalled beauty and astonishing landscapes and traditions, showing the Irish Coast really is like nowhere else in the world. \r\nSeason 1 originally aired on Channel 5 in the UK as Adrian Dunbar's Coastal Ireland. ",
