      "ProgramSummary": "AfroPop: The Ultimate Cultural Exchange is a dynamic anthology series that presents fresh perspectives on complex social and political realities in countries throughout the African Diaspora. \r\nThe episodes in Season14 feature eye-opening and inspiring films about individuals who challenge systems of oppression and inequality, and those who create new avenues of expression through the arts. \r\n\r\nEpisodes this season include:\r\n\r\nEVERYTHING: THE REAL THING STORY : A celebration of four lads from Liverpool, dubbed \"the black Beatles\" by the British tabloids, who recount their incredible story from the tough streets of Toxteth- an inner-city area of Liverpool- to the bright lights of New York City.\r\n\r\nREVOLUTION FROM AFAR:  Chronicles Sudanese-American poets, rappers and musicians who engage in performances and conversation around their third culture identity. They were born in the USA, raised connected to their Sudanese roots, yet they are  physically cut off from the political revolution happening in Sudan.\r\n\r\nSHE HAD A DREAM: Raja Amari Ghofrane is a young Black Tunisian woman and committed activist who speaks her mind. Balancing her decision to run for office with her commitment to friends and family, her story embodies Tunisia's current political upheaval and cultural awakening.\r\n\r\nDOWNSTREAM TO KINSHASA: A harrowing documentary about the victims of the Six-Day War in the Democratic Republic of Congo. The program follows a group that has been fighting for twenty years for recognition of this bloody conflict and are demanding compensation for the victims.\r\n\r\nRESTITUTION? AFRICA'S FIGHT FOR IT ART: An in depth overview of the troubling story of the African artwork that fills European museums, and whose return is now being demanded by their countries of origin.",
