      "ProgramSummary": "In AfroPop: The Ultimate Cultural Exchange kicks off its landmark Season 15 on the WORLD Channel, Mon., May 1, 2022 and online at WORLD and PBS. This year's thematic anthology focuses exclusively on the arts. We showcase five feature length films about individuals, well-known and hidden, who have forged new avenues of expression through their creativity. The series opens with Can You Bring It: Bill T. Jones and D-Man in the Waters, a Rosalynde LeBlanc documentary that reimagines and traces the history of one of the most important works of art to come out of the age of AIDS - Bill T. Jones' tour de force ballet \"D-Man in the Waters.Ã¢â‚¬Â In episode two, Claire Duguet's documentary Queen Kidjo, explores the epic career and international impact of Benin singer Angelique Kidjo. Episode three features Jeffrey Wolf's Bill Traylor: Chasing Ghosts, which explores the life of a unique American artist, who in his late 80s, became homeless and started to draw and paint, both his memories from plantation days and scenes of a radically changing urban culture. Episode four showcases Sara de GouveiaÃ¢â‚¬â„¢s Sound of Masks about a dancer who performs Mapiko, a traditional masked dance done exclusively by the male members of the Makonde community living in northern Mozambique. During the Mozambican War of Independence in the 1960s, this dance became a tool to challenge colonization. The season wraps with Alain GomisÃ¢â‚¬â„¢ Rewind & Play which brings to light the lack of respect with which the legendary jazz musician Thelonious Monk was treated in Autumn, 1969, when at the end of his European tour, he appeared on an interview show in Paris for French state television.\r\n",
