      "ProgramSummary": "Scotland’s Most Luxurious Railways with Alan Cumming – 4 x 1 hour\r\nDelivers January 2024\r\nhttps://vimeo.com/flamemedia/smlr?share=copy\r\nPassword: SMLR_promo\r\n \r\nScotland’s Most Luxurious Railway is the new series with exclusive, behind-the-scenes access to the Royal Scotsman – an iconic, opulent train – as it embarks on one of the world’s great rail journeys, racing through spectacular settings, and showcasing the finest heritage, nature and romance Scotland has to offer.\r\nTony, Olivier and Golden Globe winning actor Alan Cumming (The Good Wife) will experience what it is like to be a passenger on this epic adventure, cruising through the Highlands and indulged like royalty. This is a decadent railway trip of a lifetime and the international travelers on board certainly have plenty of character…",
