      "ProgramSummary": "Vanity Fair described Alan Partridge (Steve Coogan) as \"a national treasure ... a part of British comedy heritage as John Cleese's Basil Fawlty and Rowan Atkinson's Mr. Bean.\"[34] According to Variety, in Britain \"Alan Partridge is a full-on phenomenon, a multiplatform fictional celebrity whose catchphrases, mangled metaphors and social ineptitude are the stuff of legend and good ratings. The character is less well known outside the UK, but according to Anchorman director Adam McKay, \"every American comic knows who Steve is, whether it's Stiller or Ferrell or Jack Black or me ... and everyone watching those [Partridge] DVDs had the same reaction. How did I not know about this guy?\" Indiewire wrote that \"few Americans may know, but Partridge is a something of a comic icon across the pond ... Before there was Ron Burgundy for the Yanks, there was Alan Partridge for the Brits.\r\n\r\nThis one off special follows Alan as he attempts to make amends for a controversial on-air incident as he heads to the north on a \"deeply personal journey of redemption\".  He takes it upon himself to investigate if a 'schasm' - a schism or chasm - has formed between the north and south, \"the have and have-nots\". \r\nOne-off, spoof documentary in which Steve Coogan's perennially over-reaching broadcaster heads to the nebulous `north' to see how the other half live. Seeking to make amends for a controversial on-air gaffe, in which Alan apparently managed to offend anyone who considers themselves a `northerner', Norwich's finest sets out to immerse himself in the lives of the very people he slighted, as he investigates what he refers to as the `schasm' between the UK's haves and the have-nots, perhaps even transforming himself into a sought-after TV star in the process. \r\n\r\n",
