      "ProgramSummary": "Aldwyth is an artist who defies categorization: she is a painter, a sculptor, a box constructionist, and, for the past twenty years, an intricate collagist. Oriane Stender describes her as \"a voracious collector, scrupulous cataloguer, encyclopedic archivist, sly social commentator and corrective art-historian.\" Aldwyth's work, according to Stender, \"reflects influences from folk art and craft; obsessive outsider art; modernism, Dada and Surrealism; gender politics; and everything else going on in the world.\"\r\n\r\nAnd like her artwork the trajectory of Aldwyth's artistic life has been anything but simple. This film, Aldwyth: Fully Assembled, follows Aldwyth's remarkable creative journey; documenting her challenges and obstacles; and telling the story of her life's inspiring \"second act\" and how she became the singular artist she is today.\r\n\r\nBased in South Carolina, much of Aldwyth's creative life was influenced by her surroundings in and around Hilton Head. Aldwyth would often stop by now-celebrated outsider artist Sam Doyle's home, finding his paintings laid out on his front lawn. Aldwyth's conversations with Sam kindled an artistic spark in her, but it would be decades - until she was 40 years old - before she could act upon it. \r\n\r\nFor much of her early life, Aldwyth was married to a man who prevented her from making art.  As she says, \"art was competition\" for her attention and her husband demanded her full attention. To sate her thwarted artistic impulses, she created clothes for her three sons and painted for their school auctions. After two decades of marriage, she divorced and immediately carved out a new life for herself pursuing painting in every spare moment and working as a housecleaner to make ends meet. \r\n\r\nIt was during this time, Aldwyth says, that her \"real\" art education began.  Between 1980-1995, she was a member of the historic Red Piano Round Table on Hilton Head. Composed mostly of retired New York City illustrators (the real life \"Mad Men\"), including Joe Bowler and Coby Whitmore, this group met every Thursday to discuss all things art related. This education was vital to Aldwyth's creative growth. Importantly, The Red Piano Gallery gave Aldwyth her first solo show in 1987.  \r\n\r\nAnother turning point came in 1989, after Hurricane Hugo hit South Carolina, when Aldwyth began collecting bits of shutters blown off houses and other wreckage on the beach from the storm. She transformed this collected debris into three dimensional artworks. In 1996, Aldwyth settled on an art form that she continues working on to this day: collage.  Her highly original, monumental collages are now owned by the South Carolina State Museum, The Ackland Museum in NC, and the Jepson Tellfair Museum in GA, among others. Throughout the years, she has been awarded many residencies and grants, and, in 2009, a major exhibit of her work was shown at the Halsey Art Institute in Charleston, SC. This was her first retrospective, at age 73.\r\n",
