      "ProgramSummary": "PROGRAMS 501-504\r\n \r\n501\tCelebrating Unity Around the World\r\nThe universal language of music brings together rodeos of Argentinian cowboys in Estancia by Alberto Ginestera, the mythical worlds of Greek and German legends in Richard Wagnerâ€™s TannhÃ¤user, and the African celebration of Umoja (â€œAn Anthem of Unityâ€) by American composer Valerie Coleman.\r\n \r\n502\tThe Pines of Rome, and the Restless Sea\r\nOttorino Respighiâ€™s great orchestral showpiece â€œThe Pines of Romeâ€ unites nature with the history of Rome, â€œthe Eternal City,â€ in thrilling tone-pictures. Claude Debussyâ€™s impressionist masterpiece La Mer (â€œThe Seaâ€) portrays the ever-changing sea in its many moods and colors.\r\n \r\n503\tVienna Dreams and Barcelona Visions\r\nAn unforgettable love-story set in a Vienna of long ago comes alive in Richard Straussâ€™ opera Der Rosenkavalier (The Cavalier of the Rose), arranged as a symphonic suite by Gerard Schwarz. The spiritual beauty of Barcelonaâ€™s towering cathedral, La Sagrada Familia, is evoked by Adolphus Hailstorkâ€™s musical meditation Sagrada.\r\n \r\n504\tâ€œFree but Happyâ€ â€“ Brahmsâ€™ 3rd Symphony\r\nJohannes Brahms expressed his own enigmatic motto, â€œfree but happy,â€ in musical symbols that weave throughout this beautiful, deeply personal symphony â€“ one of the greatest works of German romanticism. The program opens with Hector Berliozâ€™ witty Shakespearean overture to Beatrice and Benedict.\r\n",
