      "ProgramSummary": "This film explores the work of photographer Titus Brooks HeaginsÃ¢â‚¬â„¢ and the challenging questions his photos pose about the systemic and casual exclusions and neglect of societyÃ¢â‚¬â„¢s most vulnerable communities of color.\r\n\r\nHumanizing, reverent, and confrontational, TitusÃ¢â‚¬â„¢ photographs document the overlooked: people who, usually through some intersection of poverty, race or gender/sexual identity, exist as outsiders. He describes his work as Ã¢â‚¬Å“confront[ing] viewers in their personal spaces to move the position of Ã¢â‚¬Å“othernessÃ¢â‚¬Â closer to a normative construction of self.Ã¢â‚¬Â\r\n\r\nA large body of TitusÃ¢â‚¬â„¢ work focuses on trans people, whom he has photographed in the US and in Cuba since 2016. As a cisgendered African American man in his 70s, TitusÃ¢â‚¬â„¢s relationship to these communities is complex and controversial, a topic the film examines as he draws connection to his experiences of being bullied, and othered, as a child.\r\n\r\nTitusÃ¢â‚¬â„¢ photos are in the permanent collections of the Smithsonian, Duke UniversityÃ¢â‚¬â„¢s Nasher Museum, and the North Carolina Museum of Art. Yet today he still seeks to be known in broader circles and, at 72, struggles to get his artwork into public spaces.\r\n\r\nThrough verite footage following Titus into the field, plus interviews with family, colleagues and mentees, this film examines a complex, talented, passionate and compassionate figure, illuminating the fortitude it takes to be an outsider documenting outsiders. As is necessary in this moment, this film also probes the question of Ã¢â‚¬Å“who can tell whose story?Ã¢â‚¬Â while a spotlight on an overlooked, but richly deserving, artist.",
