      "ProgramSummary": "Explore the rich traditions, historical significance, and meaning of Black church music in a new concert film, Amen! Music of the Black Church. Recorded before a live audience at the Second Baptist Church in Bloomington, Indiana, Dr. Raymond Wise leads the Indiana University African American Choral Ensemble in a performance of sacred music spanning from African traditions to contemporary praise and worship music.\r\n\r\nMuch of the Black experience has been defined and uplifted by the Black church, with gospel and religious music as a form of self-expression. Amen! Music of the Black Church speaks to the optimism and triumph embodied in this musical genre. Vignettes woven throughout the performance featuring narrative interviews with historic highlights and stylized visuals that give context to the music featured in the program.\r\n",
