      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "In season 18 of AMERICA'S TEST KITCHEN FROM COOK'S ILLUSTRATED, hosts Bridget Lancaster and Julia Collin Davison head into the test kitchen to bring viewers equipment reviews, taste tests, and recipes for the home cook.\r\n\r\nThe skilled duo lead a team of test cooks that viewers have come to love and trust including Dan Souza, Becky Hays, Erin McMurrer, Elle Simone, Keith Dresser, and Tim Chin as they deconstruct recipes and reveal the test kitchen  secrets to foolproof cooking at home. \r\n\r\nThis season, the ATK cast grills chicken drumsticks and swordfish skewers, harnesses the power of science to make stovetop macaroni and cheese and roasted beef tenderloin, and shares the secrets behind several dishes, including authentic pad thai, the easiest ever broiled chicken, and perfect chocolate sheet cake. They also demonstrate how to perfect classic dishes of the Mediterranean diet and master vegan food that even non-vegans will love.\r\n\r\nThe series also features the popular segments viewers know and love. In \"The Tasting Lab,\" returning expert Jack Bishop challenges Bridget and Julia to taste-test supermarket staples before revealing the series' top food recommendations for high-end olive oil, white wine vinegar, gruyere cheese, and more. Then, equipment tester Adam Ried takes the hosts through an exhaustive and unbiased search for the best blenders, espresso makers, large saucepans and silicone spatulas in \"Equipment Corner.\" \r\n\r\nMeanwhile, in \"Gadgets Galore,\" Lisa McManus reviews her favorite gadgets including tea kettles, fire extinguishers, and spiralizers to reveal which ones are worth the cost or not. And, Dan Souza explores the science behind radiant heat, takes viewers inside a stovetop pressure cooker, explains why it's impossible to overcook mushrooms, and discusses other mysteries of food.",
