      "ProgramStatus": "Contract",
      "ProgramSummary": "In season 19 of AMERICA'S TEST KITCHEN FROM COOK'S ILLUSTRATED, hosts Bridget Lancaster and Julia Collin Davison head into the test kitchen to bring more foolproof recipes to the home cook. \r\n\r\nThe skilled duo lead a team of veteran test cooks that viewers have come to love and trust including Dan Souza, Becky Hays, Erin McMurrer, Keith Dresser, Elle Simone and Tim Chin, plus new test cook Lan Lam as they deconstruct recipes, share the results of their exhaustive equipment reviews and taste tests, and reveal the test kitchens secrets to foolproof cooking at home. \r\n\r\nOn the menu this season is how to grill chicken thighs and Vietnamese pork meatballs, plus Bridget and Julia harness the power of science to make foolproof all butter pie dough and pizza in just an hour. They also share the secrets behind Chinese pork dumplings, pan Francese, and the best lemon bars you've ever had. In addition, Bridget and Julia demonstrate how to master skills such as braising and sous vide, a cooking technique that utilizes precise temperature control to deliver consistent, restaurant-quality results.\r\n\r\nJack Bishop continues to head up the Tasting Lab and challenges Bridget and Julia to taste-test supermarket staples. Based on the tastings completed in the test kitchen, he reveals the top recommendations for crunchy peanut butter, canned chickpeas, pecorino romano and more.\r\n\r\nAdam Ried, the test kitchens equipment expert, takes the two hosts through his top equipment recommendations for the home cook. From air fryers and boning knives, to Dutch ovens and parchment paper, Adam provides unbiased results from Americas Test Kitchens exhaustive testing.\r\n\r\nMeanwhile, in \"Gadgets Galore,\" Lisa McManus reviews her favorite gadgets including knives designed for kids, ginger graters, and popsicle molds to reveal which ones are worth the cost or not. And, Dan Souza explores the science behind non-Newtonian liquids, the impact of fat on temperature perception, the magic of emulsions, and other mysteries of food.\r\n\r\nIn the new short segment \"Kitchen Smarts,\" Bridget and Julia bring you tips to boost your cooking IQ, including definitive, researched, kitchen-tested answers to questions large and small, common and bizarre. In \"Kitchen Hacks,\" an array of test kitchen test cooks present ingenious kitchen hacks for the home cook. From food prep, cleaning and organizing, to transporting food, entertaining and last-minute substitutions, these are clever tips pulled from the test kitchen archives. ",
