      "ProgramSummary": "Season 21\r\n \r\nAMERICAÃ¢â‚¬â„¢S TEST KITCHEN AT HOME!\r\n\r\nAmericaÃ¢â‚¬â„¢s Test Kitchen is the most-watched cooking show on public televisionÃ¢â‚¬â€over 2 million viewers tune in each weekÃ¢â‚¬â€and in January 2021, AmericaÃ¢â‚¬â„¢s Test Kitchen will launch its 21st season with Hosts Bridget Lancaster and Julia Collin Davison. And this season, weÃ¢â‚¬â„¢re taking home cooking quite literally Ã¢â‚¬â€œ and presenting all 26 episodes from our cast membersÃ¢â‚¬â„¢ home kitchens.\r\n \r\nOur time at home during quarantine inspired us to take a new approach to how the test kitchen team develops and presents recipes to our viewers.  This season we are taking the strengths of what we have learned in the state-of-the art, fully-staffed test kitchen and putting it to work in our own home kitchens. \r\n \r\nBridget and Julia along with veteran test cooks Dan Souza, Becky Hays, Elle Simone Scott, Lan Lam, Erin McMurrer and Keith Dresser will deconstruct foolproof recipes for Cochinita Pibil and Scallops with Fennel and Orange Salad, harness the power of science to make the best Chewy Peanut Butter Cookies and Buttermilk Panna Cotta, and share the secrets to perfect Pan-Seared Strip Steaks, Yeasted Waffles, and the best Classic Guacamole youÃ¢â‚¬â„¢ve ever had. We also show you how to expand your sous vide skills and change the way you approach cooking basics.\r\n \r\nReturning favorite segments:  Equipment Reviews with Adam Reid and Gadgets with Lisa McManus.\r\n \r\nNew segments:  \r\n\r\nIngredient Deep Dives with Jack Bishop where he'll share his deep ingredient knowledge with viewers, including which seafood you can buy frozen, how to buy and store summer produce, and a quick primer on canned tomato products.  \r\n  \r\nAt Home Cast Extras with the entire cast sharing their personal favorite tips for cleaning and organizing, ingredient hacks, unexpected uses for kitchen equipment, last minute substitutions, most influential cookbooks, and much more! ",
