      "ProgramSummary": "AMERICA'S TEST KITCHEN is back with mouth-watering recipes and culinary techniques to help viewers enhance their home-cooked meals. \r\n\r\nAMERICA’S TEST KITCHEN IS BACK WITH SEASON 24!\r\nAmerica’s Test Kitchen is the most-watched cooking show on public television—averaging 2.5M weekly viewers —and in January 2024, the show will launch its 24th season. Hosts Bridget Lancaster and Julia Collin Davison, along with our entire team of test cooks, bring viewers more foolproof recipes as well as the results of our exhaustive equipment reviews and taste tests.\r\n\r\nOUR TEST COOKS MAKE AMERICA’S FAVORITE DISHES\r\nBridget and Julia lead our team of test cooks as they deconstruct recipes and reveal the test\r\nkitchen’s secrets to foolproof cooking at home. The 24th season features veteran test cooks\r\nDan Souza, Becky Hays, Elle Simone Scott, Lan Lam, Erin McMurrer, and Keith Dresser, and introduces new test cooks Sam Block, Joe Gitter, Antoinette Johnson, and Erica Turner. This season, we grill up Pollo a la Brasa; share the secrets to a show stopping Chocolate-Raspberry Trifle; stir-fry some Jamaican Pepper Steak, and assemble the ultimate Breakfast Taco Board. We also show you how to expand your frying skills and change the way you approach cooking basics.\r\n\r\nINGREDIENTS WITH JACK BISHOP\r\nJack Bishop continues to head up the Tasting Lab. Based on decades of test kitchen research, Jack shares his deep knowledge with viewers, including a deep dive into vinegars and the differences between jam, jelly, and preserves. This season, Jack also challenges hosts Bridget and Julia to head-to-head tastings of products like chocolate cake mixes and veggie burgers. \r\n\r\nEQUIPMENT WITH ADAM RIED\r\nAdam Ried, the test kitchen’s equipment expert, delivers the unbiased results of the test\r\nkitchen’s extensive testing process. From smart ovens to ladles, Adam helps home cooks stock their kitchens for success.\r\n\r\nGEAR HEADS WITH LISA McMANUS and HANNAH CROWLEY\r\nNew this season, equipment experts Lisa McManus and Hannah Crowley bring their hit YouTube show to television. They’ll tell you what equipment you should buy and how to care for it. They break down what makes the perfect microwave and how to get the most of it, and duke it out to tell you which is better: an Air Fryer or an Air Fryer Toaster Oven.\r\n\r\nFOOD SCIENCE WITH DAN SOUZA \r\nDan Souza explores the science of aluminum cans, reveals what really happens inside a pressure cooker, enlists some special guests to explain how brussels sprouts and kale are related, and other food mysteries.\r\n\r\nTECHNIQUELY with LAN LAM\r\nNew this season, Lan Lam brings her James Beard-nominated YouTube series to television. She’ll break down techniques you need to know to be successful in the kitchen, like why a sharp knife is safer than a dull one, and how water can actually help you brown your food.\r\n",
