      "ProgramSummary": "In the U.S. where more women die in childbirth than any other wealthy nationÃ¢â‚¬â€the joys of pregnancy and motherhood are often overshadowed by fear. Amid a growing maternal health crisis, especially for women of color, American Delivery is a documentary that tells the story of the glimmers of hope: women finding their voice and autonomy; nurses listening to women and offering birth choices; and hospital leaders welcoming the community as the patient. The film interweaves the stories of women and their families across the U.S. as they navigate the challenges of pregnancy, mental health, childbirth, and the postpartum period. It paints a joyous portrait of the moment babies come into the world, and the heroic efforts of families and communities to catch new mothers before they fall through the broken health safety net.",
