      "ProgramSummary": "Celebrate the feel-good songs of the  60s and 70s with a dazzling cavalcade of stars including Glen Campbell, The Osmond Brothers, Lesley Gore, Bill Medley, Crystal Gayle, Paul Revere and the Raiders,Tony Orlando, and more music icons performing their signature hits in contemporary concert performances. Hosted by Micky Dolenz (The Monkees).\r\n\r\nFrom “I'm A Believer” to “Rhinestone Cowboy,” “One Fine Day” to ” and “This Diamond Ring” to “You Light Up My Life\" these cherished songs have formed the treasured soundtrack of multiple generations. Join Host Micky Dolenz (The Monkees)as he salutes the groundbreaking musicians, teen idols, TV stars and vocal greats from rock, pop and country whose hits made us sing along, tap our feet, shed a tear, fall in love and remember the great memory-filled times of our lives.\r\n\r\nAmerican Pop Flashback! Great Hits of the 60’s & 70’s is a joyful, nostalgic musical celebration. This dynamic special presents an all-star line-up of Baby-Boomer and Generation X favorites from some of the most beloved stars in music history. ",
