      "ProgramSummary": "The Ohio Valley Symphony presents American Rhapsody a program of music from the Roarinâ€™ 20â€™s recorded live at the historic Ariel Opera House in downtown Gallipolis, Ohio. The show features the music of George Gershwin, Duke Ellington, Irvin Berlin and Will Marion Cook celebrating the 100th anniversary of the premiere of Rhapsody in Blue, in 1924.  Guest artists include jazz vocalist Mandy Gaines, pianist Michael Chertock and conductor/arranger Tim Berens. Mandy Gaines entertains and delights audiences throughout the world with refreshing jazz, pop, R&B and soul classics. Michael Chertock has dazzled audiences all over the planet with his performances of Rhapsody in Blue. Tim Berensâ€™ arrangements have been performed by major orchestras thoughout the United States and on five continents. American Rhapsody contains all new arrangements and orchestrations written by Tim Berens for this concert. The Ohio Valley Symphony, led by Founder and Executive Director Lora Lynn Snow,  performs at the acoustically superb Ariel Opera House, a restored 1895 Appalachian opera house on the Ohio River.",
