      "ProgramSummary": "Mary Bruno spent her childhood along a toxic stretch of one of the most neglected waterways in America.  Decades later, she returns to kayak the river of her youth and tell its story.\r\n\r\nAMERICAN RIVER is a new 86-minute documentary that follows Ms. Bruno and guide Carl Alderson on a 4-day, 80-mile adventure down New Jersey's Passaic River, from its pristine source in a wildlife refuge to its toxic mouth in Newark Bay. With breathtaking cinematography, the river's extraordinary history, geology and ecology are revealed as the kayakers navigate challenges, travel through urban landscapes and head towards the industrial disaster that poisoned the Passaic for the past 60 years. \r\n\r\nAlong the way, the filmmakers engage residents, historians and advocates in candid conversations that bring insight, urgency and a sense of wonder to the story. How did the Passaic become one of the most contaminated rivers in America?  Can it be saved? The Passaic is an archetype for thousands of rivers across America facing similar reckonings.\r\n\r\nThree years in the making, AMERICAN RIVER was directed by seasoned filmmaker Scott Morris and based on Mary Bruno's 2012 book, \"An American River: From Paradise to Superfund.\" Like the book, the film is a unique blend of personal memoir, adventure, history and science. The entire journey was captured in grand and intimate scale from the water, land and air by an experienced crew with ten 4K cameras. An original score, high-end graphics and rare archival images enhance the story.\r\n",
      "ProgramTitle": "AMERICAN RIVER",
