      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "One September evening at the Birchmere Music Hall in 2015, thirty of DC's finest musicians gathered to celebrate their heroes and display the virtuosic, genre-blending music they proudly call their own. In the center of the stage stood a Fender Telecaster, which was the late Danny Gatton's signature instrument. As the undisputed master of this music, Gatton would blend jazz, blues, country, swing, rock, and bluegrass - sometimes in the same solo. He grew up in the DC neighborhood of Anacostia, and gave it's name to this musical culture unique to DC - \"The Anacostia Delta.\"\r\n\r\nProduced by the film-making team of director Bryan Reichhardt, producer Suzanne Brindamour Tolford and cinematographer Mathieu Mazza, \"Anacostia Delta: The Legacy of DC's TeleMasters\" explores the universe of live music that permeated the culture of Washington, D.C. in the post-WWII era.  \"Every kind of music found a home here,\" says concert music director John Previti, who was born and raised in the area and was Gatton's bassist for 19 years. \"The Route 301 corridor had clubs, Georgetown had clubs, downtown DC had clubs. They were everywhere, and you could hear every kind of music played by the very best.\"\r\n\r\nThe concert program traces the development of the Anacostia Delta scene and celebrates the grand guitar masters Gatton and Roy Buchanan, as well as unsung heroes, like Chick Hall, the influential owner of Bladensburg, Maryland's Surf Club. The concert features stalwarts and leading lights of DC's music scene, including Dave Chappell, Anthony Pirog, Billy Hancock, Steve Wolf, and Tom Principato, among many others, and celebrates the musicians who are carrying the Anacostia Delta tradition forward.  In between acts, the film presents interviews with the performers and gives viewers a look at their rehearsals leading up to the concert.   \r\n\r\nIn addition, viewers are taken back in time with archival footage and interviews with family, friends, bandmates, and celebrities who understand DC's influential yet not-widely-known musicians. Nashville superstar Vince Gill states it simply: \"I think a lot of people would perceive this to not be a hotbed of a music community like Nashville or Austin or L.A. or New York, but it was. It was every bit as good as anywhere else in the country you could ever go. Tons of great musicians from around here and all the musicians knew it - maybe the rest of the world didn't but we all did.\"   In addition to Gill, the film also features interviews with internationally recognized guitarists and fans of Gatton and Buchanan, including Nils Lofgren, Albert Lee and Mike Stern. Lofgren grew up in suburban DC and was mentored by Buchanan. The longtime lead guitarist in Bruce Springsteen's E Street band, Lofgren says, \"Looking back, and having traveled extensively, I still feel like Washington had one of the better music scenes in the country and I think still does.\" \r\n\r\n\"We're celebrating a genre that doesn't get much attention in the world,\" says director Reichhardt.  \"And we want to bring attention to it. It deserves that attention.\"\r\n",
      "ProgramTitle": "ANACOSTIA DELTA: THE LEGACY OF DC'S TELEMASTERS",
      "SeriesIDNumber": "",
      "SeriesTitle": "",
      "Title": "ANACOSTIA DELTA: THE LEGACY OF DC'S TELEMASTERS",
