      "ProgramSummary": "This documentary is the story of an Afghan refugee, Anahita, who is resettling in Minneapolis. Anahita was a police officer in Kabul. She was evacuated in August 2021 with her five children, after being tipped off that the Taliban was looking for her. Her husband did not make it out of Afghanistan. Anahita tells the harrowing story of getting into the airport, climbing over barbed wire, almost being shot by the Taliban, and the challenge of keeping her children safely by her side throughout the ordeal. She arrived at Fort Dix in New Jersey, where immigration officials began the process of resettling her. It was there that she met Amy, who would eventually become her sponsor. Shortly after arriving at Fort Dix, Anahita discovered she was pregnant. Amy, a mother of two, invited Anahita to come home with her to Minneapolis. Anahita's sixth child was born in May in Minneapolis. Now, with Amy's help, Anahita is working to raise her children, learning English, and trying to build a future for herself and her children in the United States.",
