      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "The compelling six-hour series ANCIENT ROADS FROM CHRIST TO CONSTANTINE charts Christianity's evolution from a small movement to the largest religion in the world, with more than two billion followers. Host Jonathan Phillips, an author and distinguished history professor at Royal Holloway, University of London, journeys into the fascinating world of the early Christians to explore the faith's long struggle and triumph against the odds. He recounts some of Christianity's pivotal moments at the actual locations where they unfolded, including Bethlehem (site of Jesus' birth), Judea (where Jesus preached) and Rome (where Emperor Constantine the Great embraced the faith as his own), among others. Phillips' entertaining and enlightening 12,000-mile odyssey through seven countries in Europe, Northern Africa and the Middle East brings the rich history of Christianity to life. Along the way, he meets experts who have devoted their lives to the study of this important historical period. \r\n \r\nJonathan Phillips is a frequent consultant and on-air presence for BBC radio, BBC television and the History Channel. He has authored numerous books on the Crusades, including the recently published Holy Warriors: A Modern History of the Crusades.\r\n\r\nEpisodes:\r\n\"Birth of a Faith\"\r\nWith the Gospels as his guide, Phillips traces Jesus' journey from birth to resurrection.\r\n\r\n\"The Great Missionary\"\r\nPhillips recounts the Apostle Paul's bold quest to bring the Christian message to Asia and Europe, a journey during which he was imprisoned, beaten and nearly killed.\r\n\r\n\"Age of the Apostles\"\r\nIn the third episode, Phillips retraces Paul's third and final missionary journey. The Apostolic Age ends with Paul and Peter both meeting their fate at the hands of one of the cruelest tyrants in history.\r\n\r\n\"From Apocalypse to Heresies\"\r\nEpisode four opens in a Jerusalem rocked by war. Phillips travels to Patmos Island ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â€šÂ¬Ã‚Â the site of John's exile ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â€šÂ¬Ã‚Â and visits the cave where the apostle wrote the most enigmatic book of the New Testament, Revelation. He also visits the site where powerful heretics claiming special knowledge of Jesus threatened to distort, divide and even destroy the Christian faith.\r\n\r\n\"Pagans and the Cult of Martyrs\"\r\nIn North Africa, Phillips tells the story of a young Christian martyr named Perpetua. He also visits places where Christians faced violent persecution because of their beliefs and other sites where the Roman Empire threatened Christianity's core values. \r\n\r\n\"Constantine\"\r\nIn the final installment, Rome exerts its fullest effort to eradicate Christianity ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â€šÂ¬Ã‚Â and fails. The conversion of Constantine the Great would fully transform the fortunes of the Christian faith,  making it the official religion of the Roman Empire.",
