      "ProgramSummary": "Ann Wilson announced her 2017 20-date solo tour. \r\n\r\nThe Ann Wilson Of Heart dates follow the release of Heart’s critically acclaimed 2016 Beautiful Broken album and summer headlining tour with Joan Jett & the Blackhearts and Cheap Trick, along with Heart solo shows before and after. \r\n\r\nAnn Wilson of Heart is the next step of Ann’s journey. The step that puts it all together. The present meets the past and joins the timeless. All of the songs that make up the essence of Ann Wilson will be on display; Heart songs, songs from Ann’s solo projects, and songs that have influenced and inspired Ann throughout her life. Musicians on board for the Ann Wilson Of Heart tour include Craig Bartock on guitar (Heart member fora dozen years, who also performed in the Ann Wilson Thing for two years) from San Francisco; Andy Stoller on bass (the Ann Wilson Thing member for two years) from Seattle; Denny Fongheiser on drums and percussion (Heart member in the 1990’s for two years)from Los Angeles.\r\n\r\nWhat will fans experience at these shows? “People can expect the unexpected in 2017,” Ann says. “A beautiful, classy set with an elegant, artistic production…The music will be a mix of songs that have powered my life; iconic soul stirring covers, songs from my years of solo work and the unforgettable songs of Heart.” The name for the upcoming tour, explains Ann, “is to give people a point of recognition; to help people understand who I am and where I came from.”\r\n\r\nRecorded in St. Charles IL at the Arcada Theater.",
