      "ProgramSummary": "Of both Inupiaq and Norwegian descent, Apayauq grew up between Norway and the far reaches of northern Alaska in Kaktovik, learning from a young age to dogsled with her father. In 2019 she completed her first Iditarod registered as a man and won Rookie of the Year at the 1,000-mile Yukon Quest Race, experiencing varying degrees of gender dysphoria throughout both races. On March 8th, 2021, Apayauq officially came out as trans, posting on Instagram â€œIâ€™m a trans woman, I use she/her pronouns. I'm much happier in everyday life now that I'm living true to myself. I've been sure of this for a long time, and I've been wearing skirts and makeup and only using my Inupiaq name for many months since I was named after my great grandma. Happy International Women's Day.â€ In 2022 she returned to the Iditarod, this time competing as a woman. Filmmaker Zeppelin Zeerip followed along for the journey, snowmobiling alongside her for over 1,000 miles, documenting Apayauqâ€™s experience and her coming to terms with her gender.\r\n\r\n",
