      "ProgramSummary": "THE ARCHIBALD is a stunningly visual prime-time series for Foxtel Arts, following a select cast of eight artists and their sitters as they bid to win the 2017 Archibald, the most coveted and controversial portraiture prize in Australia. This four-part series, narrated by Rachel Griffiths (Six Feet Under; Indian Summers) , gives viewers an all-access pass to the artists, their studios and the blood, sweat and tears that go into completing an Archibald portrait from blank canvas to multi-coloured masterpiece. Critically, it also lifts the lid for the very first time on the judging process by the 11 trustees of the Art Gallery of New South Wales who must sift through more than 800 portraits to select one winner. Shot over one year and across four continents Australia, America, Europe and Asia The Archibald reveals the huge emotional and financial investments that go into a work of art for the nations pre-eminent portraiture prize.",
