      "ProgramSummary": "93-year-old John Miley of Evansville, Ind., has compiled the largest collection of sports broadcasts in the country. He began making recordings in 1947, while he was a high school student. Nearly eight decades later, his collection now includes more than 44,000 recordings of radio and TV sports broadcasts.\r\n\r\nâ€œI had no idea what I was doing, really,â€ Miley said. â€œWhat I was trying to do was I knew that when I retired I would want something to do, and whatâ€™s better to do than listen to old sporting events.â€\r\n\r\nArchiving Airwaves: The Miley Collection explores Mileyâ€™s extensive collection, which includes every Super Bowl, a half-century of the Kentucky Derby and Indianapolis 500 races, the World Series games from 1954 to the present, and more. Other historical highlights of his collection feature the Brooklyn Dodgersâ€™ final game; the heavyweight title fights between Joe Louis and Billy Conn; Roger Marisâ€™s 61st home run in 1961; and the fourth quarter of Wilt Chamberlainâ€™s 100-point performance in 1962. Miley also has the play-by-plays of famous sportscasters, such as Mel Allen, Red Barber, Ted Husing, Harry Caray, Ernie Harwell, Vin Scully, and Bill Stern.\r\n\r\nArchiving Airwaves reveals how Miley came to the decision to donate his entire archive to the National Sports Journalism Center at the Indiana University Media School. The program looks at the Media Schoolâ€™s plans for digitization to make the collection available as a resource for students and the public. â€œThis is a history of sports broadcasting in the United States over the last century,â€ said Galen Clavio, the director of IUâ€™s National Sports Journalism Center.",
