      "ProgramSummary": "Armed with Language tells the story of a little-known military intelligence school in Minnesota that trained over 6,000 Japanese Americans, or Nisei, be to translators, interrogators and Japanese military specialists during WWII. Primarily recruited from internment camps, also now referred to as concentration camps, on the West Coast, these men and women, served while many of their families remained imprisoned. For their efforts it is said that they \"shortened the Pacific War by two years and saved possibly a million American lives.\" After decades of being classified, the story of their courage, sacrifice and valor is finally being told. ",
