      "ProgramStatus": "Contract",
      "ProgramSummary": "There is no doubt that art can make us feel better. Listening to a beautiful sonnet, experiencing the lilting melodies of an orchestra, or feeling inspiration from viewing a boldly colored painting, even witnessing the beauty in nature, can make the us feel profoundly different in a positive manner. That is because it is scientifically proven that the arts are essential to our well-being. \r\n\r\nThe neuro-arts is the scientific study of how the arts measurably transforms the brain and the body through artistic and aesthetic expressions and experiences. Whether it be learning to use singing for stress relief, incorporating colors to create mood, or dancing to help stave off depression, Susan Magsamen, co-author of the New York Times best seller, \" Your Brain on Art,\" explains how the arts are healthy for body, brain and bliss. \r\n\r\nSusan, who also is the Founder and Executive Dir., Intl. Arts   Mind Lab, Center for Applied Neuroaesthetics at Johns Hopkins University School of Medicine, joins experts in their perspective fields of arts and psychology for this innovative and thought-provoking series of interstitials, entitled, \"The Art of Well-being.\" The interstitials explore the ways the brain interacts with art, helping viewers understand how aesthetic experiences can be applied toward enhancing our mental health, whether it be through dance lessons, a museum visit, or simply taking a walk through a beautiful forest. \r\n\r\nAs Susan Magsamen states, \"Curiosity, surprise and wonder are all important for human development.\" And that is what this series of interstitials attempts to prove, that through science, art is more than a nice visual hanging on a wall. It can be one of the most important keys to our well-being.\r\n\r\nEpisode Descriptions:\r\n\r\nEpisode 101: Spaces TRT 2:53\r\nArchitectural spaces using available light, curves and natural aesthetics are proving curative to mind and body when it come to mood, blood pressure and heart rate.  A quick delve into how creative and natural interior and exterior design elements help us feel safe, comfortable and all around happy. \r\n\r\nEpisode 102: Sound Therapy TRT 2:33\r\nVibrations create energy. Today therapists are tapping into those vibrations to cure specific mental health challenges and trauma. A look into how different sounds and instruments are being used to heal. \r\n\r\nEpisode 103: Nature Healing TRT 2:22\r\nFor years our ancestors for years have taken long nature walks to relieve stress and open their creative energies. This short segment examines how nature soothes and counterbalances anxiety. \r\n\r\nEpisode 104: The Art of Coloring TRT 2:33\r\nColoring has been studied in recent years to find out why this simple form of creativity can alleviate stress, make one feel calmer and more content. Studies have shown that coloring has a similar psychological response to our brains as the act of meditation because it reduces outside noise and allows focus.  This segment also delves into the types of colors and patterns that produce the most calming effects and why. \r\n\r\nEpisode 105: Poetic Medicine TRT 2:51\r\nHow does the oldest form of written literature effect our minds in such a profound manner? New research suggests that poetry, demonstrates the complexities with which our brain constructs the world in and around us, because it unifies thought , language, music, and imagery in a clear manageable way, more often with play, pleasure, and emotion. \r\n\r\nEpisode 106: Making and Keeping Memories Through Music TRT 2:48\r\nResearch shows that when music is incorporated into a lesson, children are more apt to retain the information. At the same time, for the older generation, therapists are using music to help bring back memories for those with dementia. \r\n\r\nEpisode 107: Dancing The Blues Away TRT 2:53\r\nDance has been shown to improve mood and help stave off depression by releasing serotonin. Movement increases neural activity between brain hemispheres and helps to develop new neural connections. \r\n\r\nEpisode 108: Social Prescribing TRT2:06\r\nExposing children to the arts offers their young minds more than an appreciation to the creative world. Social prescribing is when a therapist prescribes a form of immersive arts to a child such as singing classes for stress, museum visits for anxiety and nature walks for burnout. Immersing in the arts are proving to be a focused and curative method to cultivate well-being. Studies show that the kids engaged in the arts have fewer problems with their peers, teachers, and adults, and they are less likely to develop depression. \r\n\r\nEpisode 109: Make To Know TRT2:32\r\nMaking something with our hands has a profound effect on our ability to learn. It's a connection between the brain and the hand that supports an embodied cognition. Handicrafts for instance are now being used to develop focus, patience, dexterity, confidence, not to mention creativity. \r\n\r\nEpisode 110: Soothing Through Singing TRT 2:42\r\nFeeling low? Sing. Belting out a tune or joining a chorus reduces the stress hormone called cortisol. Singing is particularly healing for mothers suffering from post-partum depression. Singing also helps lull the fidgety baby to sleep which will help a nervous mom settle down making for a happy mom and happy baby. \r\n\r\nEpisode 111: Color Me Happy TRT 2:53\r\nColors are mood creators. In fact many interior designers have known for years that yellow agitates, blue soothes and pink can make you hungry. This segment looks at how colors influence our moods and how hospitals, schools and home designers are using this knowledge to create enriching environments.\r\n\r\nEpisode 112: Awestruck TRT 2:22\r\nAwe is embedded into our DNA. Think of the power of awe when we view a magnificent sunset or a shooting star. Many times, awe is manifested physically by shivering and an elevated pulse. This elation or euphoria often leads to heightened curiosity and creativity. It encourages us to move forward with new ideas. This Awestruck segment would explore how an incredible experience with art  can create awe that is measurable and constructive. \r\n\r\nEpisode 113: What are Neuro-Arts?  TRT 2:54\r\nThe neuro-arts is the scientific study of how the arts measurably transforms the brain and the body through artistic and aesthetic expressions and experiences. Whether it be learning to use singing for stress relief, incorporating colors to create mood or dancing to help stave off depression, Susan Magsamen, co-author of the New York Times best seller, \" Your Brain on Art,\" explains how the arts are healthy for body, brain, and bliss. ",
