      "ProgramService": "Syndication",
      "ProgramStatus": "Pulled back by supplier",
      "ProgramSummary": "This film tells the first female megastar’s unstoppable rise. It examines Streisand’s rise to fame and how she shaped and influenced her entire artistic lineage, while embodying the cause of women and gay people.\r\nToday's powerful pop divas - Madonna, Rihanna, Mariah Carey, Lady Gaga, and Beyoncé and so on - trace their descent back to the mother of all Queen Bees: Barbra Streisand.\r\nStreisand's achievements rank her among the Hollywood greats. Her acting, singing and dancing talents have won her numerous awards including two Oscars, nine Golden Globes, ten Grammys and five Emmys. The kooky, odd-looking mezzo-soprano redefined people's notions of beauty and showed that a female star could be a strong, liberated, unconventional woman, paving the way for the \"girl power\" generation of female vocalists.\r\nFrom \"funny girl\" to first female mega-star, discover her life-story from her birth in 1942 to 1983, when her fame was at its peak, and see how she became an icon who shaped and influenced generations of female performers while embodying the causes of women and gays.",
      "ProgramTitle": "BARBRA STREISAND BECOMING AN ICON",
