      "ProgramSummary": "Brigitte Bardot, an emblem of female emancipation and sexual liberation, went from the status of innocent girl to that of femme fatale under the gaze of filmmakers and the media.\r\nBlending previously unseen family archives with passages from Bardot’s autobiography, and the photographs that shaped her image with the films in which she starred, this documentary provides a subjective and sensitive rereading of the Bardot myth.\r\n \r\nFor the first time, we see a darker side of Brigitte Bardot, alluded to in her own writings and in the movies that drained her. What lay behind her sunny, blond, natural, dream-girl image?",
