      "ProgramSummary": "Description for Offer Book\r\n\r\nBeauty on the Wing: Life Story of the Monarch Butterfly\r\n\r\nBeauty on the Wing: Life Story of the Monarch Butterfly is a 56-minute narrated documentary that takes place along the shores of Cape Ann, Massachusetts and in the heart of Mexico’s forested volcanic mountains. Every stage of the monarch’s life cycle is experienced in vibrant close-up, from egg to caterpillar to adult, and set to the background of sea and forest, sun and wind. By the millions and millions, the intrepid monarchs journey thousands of miles -- something no other butterflies in the world do over such a vast area. Amazingly, this migration happens in our midst, unfolding in backyards, farms, meadows, and along the shoreline, wherever milkweed and wildflowers grow.\r\nThe Monarchs are in great peril. Although the butterfly’s spectacular migration evolved over millennia, the last decades of human activity have put this phenomenon in grave danger. Beauty on the Wing is a film for all ages, and was created for all to gain a deeper understanding of the symbiotic relationship between habitats, wildflowers, and pollinators, and the vital role they play in our interconnected ecosystems. Filmed in Gloucester, Massachusetts and the Monarch Butterfly Biosphere Reserves at Estado de México and Michoacán, the film illuminates how two regions, separated by 3,000 miles, are ecologically interconnected.",
