      "ProgramStatus": "Contract",
      "ProgramSummary": "\"Becoming Trauma Responsive\", explores the effects of trauma on learning, behavior, and developing relationships. Throughout the course of the COVID-19 pandemic, schools across the United States were strained to meet the social and emotional needs of students. Most school districts reported large increases in depression and general anxiety from students and educators. Unfortunately for individuals already affected by trauma, the elevated stress and uncertainty caused by the pandemic were felt even stronger. Our film documents the experiences of three different schools in Kansas and Missouri to see how each has adapted and changed to meet the social and emotional needs of their students and staff. We also interviewed trauma experts who have spent decades in the field of brain science, therapy, and counseling to learn how to teach kids resiliency despite hardships and traumatic events in their lives. Finally, we hear the story of Nathan Ross, a victim of one of one of the most high-profile cases of child abuse in Kansas City, MO and how he was able to channel his experiences to help others in foster care and adoption. His message to educators provides a unique look at what we can all do help kids especially when we don't know their background. ",
