      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "Narrated by Tamlyn Tomita, Betrayed: Surviving An American Concentration Camp tells the story of a group of Japanese Americans and their incarceration by the U.S. government purely on the basis of race. In the compelling voices of survivors of Minidoka, a concentration camp in the Idaho desert, the film explores the unconstitutional suspension of the civil rights of these Americans during WWII and the long-lasting impact of the incarceration on their community. Betrayed examines the incarceration of Japanese Americans in the Pacific Northwest in order to tell a universal story about unjust incarceration and the loss of civil rights.\r\n\r\nThe film also explores the long-term effects of the incarceration over decades, and the phenomenon of intergenerational trauma as it affects this group of Americans. Over 40 camp survivors and descendants bring an unparalleled immediacy and urgency to the story. Our interviewees include Satsuki Ina, a trauma therapist who was herself born in a concentration camp. Other key interviewees include the late Kay Sakai Nakao, one of the first Japanese Americans to be taken (at the age of 22), the poet Larry Matsuda, Paul Tomita, whose father went directly from camp to join the OSS, and many others. \r\n\r\nLastly, Betrayed looks at the rise of Japanese American activism in defense of the rights of others, and the relevance of this story today, both in the targeting of groups based on their religion or ethnicity and the actions of the U.S. government at our southern border.\r\n\r\nIn conjunction with the one-hour film, this project also includes an educational program crafted by expert curriculum writers. This will provide educators the resources necessary to bring the incarceration story into the classroom, with four engaging short films and insightful lesson plans, study guides, and activities. The aim is to give educators the tools to engage 6th-12th grade students in focused conversations about exclusion, identity, and equal justice. By providing these engaging resources to educators online, free of charge, we will remove many of the roadblocks that have prevented the incarceration story from being taught in schools and will enable a new generation to move forward with a greater understanding of the civil rights tragedies of our past. ",
      "ProgramTitle": "BETRAYED: SURVIVING AN AMERICAN CONCENTRATION CAMP",
