      "ProgramService": "Syndication",
      "ProgramStatus": "Contract",
      "ProgramSummary": "\r\nBeyoncé and Solange Knowles are the most successful pair of sisters in pop history – and they couldn't be more different…It takes a long time for Solange to step out of her sister's shadow musically. A double portrait of two unequal exceptional artists. Beyoncé and Solange Knowles couldn't be more different: One is arguably the biggest pop star of our time, the other puts her complex artistic aspirations above commercial success. While Beyoncé is systematically built up by her parents to become a megastar, her sister Solange has to fight with all her might for promotion and recognition from her family. It was not until late that she succeeded in stepping out of her sister's shadow as an independent artist and emancipating herself musically. The film goes on a search for traces in Houston, the hometown of the sisters. Together with companions and friends it sheds light on the lives and careers. As the frontwoman of Destiny's Child, a band managed by her father, Beyoncé began her stellar career in the late 1990s. After the group breaks up in 2006, Beyoncé launches her solo career with seven studio albums and 32 Grammys to date. Solange, on the other hand, begins her first steps into the limelight in the second row: first as a background dancer for Destiny's Child, later as a songwriter for her big sister. But she wants more. Her third solo album \"A Seat at the Table\" brings the longed-for liberation. The album is celebrated by critics, Solange wins her first Grammy. After 30 years in the shadow of her sister, she has won her place at the table.\r\nAdditional Info",
