      "ProgramSummary": "In the mid-1950s, a little boy in Norfolk Virginia took a bus with his classmates to hear the Norfolk Symphony Orchestra. Born to a single mother on welfare, living in a housing project, Thomas Wilkins emerged from that concert hall changed forever. \"I had heard the Star Spangled Banner before,\" he says. \"But never in the voice of this thing called the orchestra.\" He went home that day and took out his little toy soldiers, but this time he set them up in the shape of an orchestra and he played the conductor. Wilkins grew up to become one of the few African-American conductors leading a major orchestra--the celebrated Omaha Symphony. He's also the principal guest conductor of the Hollywood Bowl Orchestra, and the Boston Symphony Orchestra's youth and family concerts conductor--the first African-American in the BSO's 131-year history to hold a conducting position with the symphony. As Wilkins prepared for his last season in Omaha, COVID-19 silenced the orchestra and social unrest sparked important conversations about diversity, equity, and inclusion in the classical music world. When it appeared that the worst was over, Wilkins returned to the Omaha stage to a grateful audience underscoring Wilkins' belief that \"in the midst of this mess, music still flourishes and beauty gets to have the last word.\"",
