      "ProgramStatus": "Contract",
      "ProgramSummary": "Although Umatilla has challenges, it has something other communities do not. It has Heidi Sipe. Heidi Sipe became superintendent of the Umatilla School District in 2007. She inherited a district with staggeringly low graduation rates and students marked by poverty, but to Heidi, being poor doesn't mean you aren't capable or can't learn. The students just needed opportunities to grow and stretch, so Heidi started a robotics team.  \r\n\r\nWith the help of her husband, Kyle, a middle school math teacher who had zero experience building robots, Heidi created the STEM Academy of Umatilla, a K-12 afterschool program, and a robotics team to participate in the FIRST Robotics Competition, an intensive, six-week, international competition in which each high school team designs, funds, and builds an industrial-size robot to compete against other teams. In 2016 more than 3,000 teams competed. During that six weeks, each team member lives and breathes robotics. Hours not spent sleeping or in school are spent with the team. Heidi and Kyle co-coached the robotics team, spending countless hours recruiting students and mentoring them, designing and building robots, and traveling to tournaments, including the ultimate -- the international robotics championship.  \r\n\r\nThough the robotics team was an important catalyst for change, this story is not about robots. It's about\r\ninspiration and reality. In 2013, the first year Umatilla's Team Confidential competed, the team's robot caught on fire. They learned that other teams had professional mentors, corporate sponsorships, and hands-on help from local machine shops and businesses. Team Confidential, meanwhile, didn't have these advantages. The students had to be resourceful. They did it all themselves, even \r\nlearning to weld by watching YouTube videos. They embraced the chance to excel and were active participants in their learning. And they realized that while their chances of winning were slim, they could definitely compete, and they deserved to be there. This story, which follows the team through the 2016 robotics season, is about refusing to see barriers and instead, seeing possibility.",
