      "ProgramSummary": "\"Headed to Canton\" is often used synonymously when referring to an NFL player who will one day be enshrined into the Pro Football Hall of Fame, located in Canton, Ohio. The museum celebrates the greatest players, coaches and contributors to the professional game.\r\n\r\nNow, more than 50 year later, heading to Canton has expanded to include collegiate football. In 2019, the Black College Football Hall of Fame was officially welcomed to the campus of the Pro Football Hall of Fame. Along with it came a game and celebration of the historically Black college and university brand of football.\r\n\r\nPBS Western Reserve commissioned this new documentary to Waters Media and its producing partner, Fog City Media. It tells the story of the formation of Black college football, the contributions that players from historically Black colleges and universities have made to the NFL, the founding of its hall of fame and why the hall is in the unexpected location of Canton.",
      "ProgramTitle": "BLACK COLLEGE FOOTBALL HALL OF FAME: JOURNEY TO CANTON",
