      "ProgramSummary": "Set against the breathtaking backdrop of the Himalayas, BLINDSIGHT follws the gripping true-life adventure of six blind Tibetan teenagers on a climbing expedition up the formidable 23,000 foot Lhakpa Ri, at the doorstep of Mt. Everest. Believed to be possesses by deomons because of their blindness, the children are feared by their parents, scorned by their villages and rejected by society. Rescued by a blind educator and adventuress, the students invite a famous blind mountain climber to visit their school and let him lead them higher than they have ever been before. The result is nothing anyone could have predicted.\r\nThe idea for the expedition came about after blind educator Sabriye Tenberken, who founded Braille Without Borders, the first and only school for the blind in Tibet, who wrote a letter to the world renowned blind mountaineer Erik Weihenmayer, upon hearing the news that he had summitted Mt. Everest in 2001. Sabriye had read Erik’s book TOUCH THE TOP OF THE WORLD to the students in the school, and was inspired to get in touch following the incredible news of his summit. ",
