      "ProgramSummary": "Through the 1960's, 70's and 80's, Albert Productions created a house of hits in Australia that literally changed the sound of Australian popular music. Under the guidance of Ted Albert and songwriters/producer Harry Vanda and George Young, Alberts became a family of artists such as Billy Thorpe, The Easybeats, Stevie Wright, AC/DC, Rose Tattoo, The Angels, John Paul Young, TMG and others, who conquered the charts and achieved international acclaim. The sound they made wasn't always 'nice'. The Alberts guitar sound was like a throbbing V8 motor, the sound of the tough migrant suburbs that it emanated from. It was anti-authority, hard-living suburban young Australia at its most confident and exciting. The sound of working class good times. ",
