      "ProgramSummary": "A man of his surroundings and culture, a man of his times, a vigorously collected and admired figure, the \"Blue Dog\" painter has a legacy that endures. \r\n\r\nGeorge Rodrigue, his story, his artistic contribution, his entire life, are a vivid part of the Louisiana landscape, and continue to be an important part of the art world in America and beyond. \r\n\r\nFrom his important cultural works, literally putting the Cajuns on the map, to his world-renowned Blue Dog catalogue, Rodrigue's work is full of life, a deep ethos, color, narrative, and joyous storytelling.  WLAE is on a new film journey telling this remarkable tale.\r\n\r\nHis life in the studio Ã¢â‚¬Å“down the bayou\", his study on the West Coast, his return home, and the explosion of fame across the globe, and parts in between, form an art journey for the ages. \r\n\r\nStruck with Polio as a young boy, inspired to paint, the canvas took George Rodrigue from New Iberia to Los Angeles, and from to Paris to Asia. He has been sought by major worldwide brands, politicians, and collectors too vast to count. Yet, he has ever-remained, Ã¢â‚¬Å“The Cajun Man\". As an astoundingly prolific artist, his connections to people, abiding friendships, are the fabric of his storied journey.\r\n\r\nAn ambitious project, a bold and beautiful film, we sincerely hope you will join us on this journey. \r\n",
