      "ProgramSummary": "Some of the most brutal, merciless, and chaotic fighting of World War II took part in the mountains of Italy. The battle for Italy lasted until the final days of World War II in Europe. \r\n\r\nEven as the Allies advanced right into the heart of Berlin in May of 1945, the savage fighting in the mountains of Italy continued. \r\n\r\nIt was a fight that began in 1943 with the invasion of Sicily and then the Italian mainland itself. The famed American 82nd Airborne Division was handed the early fighting in places along the Sicilian coast and later at the bloody beachhead known as Anzio, south of Rome. \r\n\r\nLater, the Allies' fight took them into the mountains of Italy, a defenderâ€™s dream. The Germans always used the high ground to their advantage, inflicting severe casualties on the Americans and British. \r\n\r\nThe fighting in the mountains was so severe that the famed American 10th Mountain Division, customarily found on skis, was called into the fight. \r\n\r\nOne of those soldiers in the 10th Mountain Division was Bob Dole, later a famed Senator from Kansas and Presidential candidate. Dole was severely wounded in the Italian mountains on Hill 913 outside of Castel dâ€™Aiano, and his scars from battle would shape the rest of his life in public service. \r\n\r\nMany soldiers were affected by their time fighting in Italy; the conditions and fighting there were that horrific. \r\n\r\nThis film is about those who were there and lived through one of World War IIâ€™s most desperate fights, including a young Lieutenant from Kansas who his unforgettable ordeal in Italy would shape. \r\n",
