      "ProgramSummary": "The soft-spoken, calming voice of Bob Ross still inspires audiences,\r\nshowing us that mistakes happen and are okay. His positivity and \"happy\r\nlittle accidents\" were the foundations of The Joy of Painting.\r\nFrom 1983 to 1988, Bob Ross filmed his iconic show, The Joy of Painting, in a makeshift studio in the L.L. Ball home near the campus of Ball State University. Now part of the Minnetrista campus, the former WIPB-TV studio space was recently refurbished, bringing together objects, paintings and other artifacts, to create a space for visitors to explore Bob's life and career, feel what it might have been like to be on set of his show, and try their hand at painting some happy little trees of their own. The restoration process began in 2019, and the exhibit opened to the public on October 29, 2020 - Bob's birthday. The Bob Ross Experience gives viewers a behind-the-scenes look at the research and creative work that went into bringing this experience to life, while also witnessing the impact that Bob continues to have on artists young and old.",
