      "ProgramSummary": "Controversial and illuminating, this documentary from Kenyan-born Peres Owino uses testimonials to expose the seldom-discussed ways that Africans and African Americans view each other, and looks at the cultures’ shared history to foster mutual understanding. \r\nThe results, now in the film alongside history lessons and performance art, are intense. Topics range from the fear some African immigrants have of African Americans based on media stereotypes, to misconceptions about contemporary life in Africa and discussions regarding a “black identity” that can include all Americans from the African diaspora. \r\nhttp://www.siff.net/festival-2014/bound-africans-versus-african-americans\r\nhttp://www.seattleglobalist.com/2014/06/06/africans-and-african-americans-struggle-to-relate-bound/26339",
