      "ProgramService": "Syndication",
      "ProgramStatus": "Contract",
      "ProgramSummary": "During the Vietnam War, American men had to carry their draft card at all times. When your time came to be called up, a refusal to participate would land you in prison. But a growing resistance begins when one man stands up and publicly burns his draft in protest against the war. By the war’s end, thousands will be imprisoned for refusing to fight. When the streets are flooded with protestors, and the courts are flooded with refusal cases, the draft is ended, paving the way to the end of a bloody, brutal war.\r\nThe Boys Who Said NO! features a roster of high-profile resisters, as well as the unsung heroes of the movement. We follow Martin Luther King Jr as he takes a dangerously unpopular stand against the Vietnam War, and watch him stand alongside Muhammad Ali after he refuses induction. Meanwhile, we follow the story of resistance founder David Harris, whose baby with folk diva and peace activist Joan Baez was born during his imprisonment - as well as hear from draft resistors whose names have been almost lost to history, but whose actions built a movement.\r\nThrough dynamic archival footage and compelling interviews, this film captures, for the first time, this youth-led movement of nonviolent civil disobedience which has inspired subsequent battles for justice. This is a story of young people choosing conscience over killing; made especially timely by contemporary nonviolent movements against the climate crisis, systemic racism, and contemporary conflicts.",
      "ProgramTitle": "BOYS WHO SAID NO!, THE",
