      "ProgramStatus": "Pulled back by supplier",
      "ProgramSummary": "Planned in secret for two years, this prison break was outrageously ingenious, involving psychological manipulation, cunning subterfuge and jungle-style survival.  Yet for 25 years it is a story that has remained largely untold.  Now the peace process and the intervening years have contributed to it being seen in some perspective.   The IRA's mass breakout from the Maze Prison in 1983 was the biggest escape in British penal history.  Even Sir James Hennessey, who conducted the British governments's inquiry into the event, likended it to Colditz, and said it was \"...a matter of some congratulation for the Republican movement (IRA).\"  It was also a slap in the face to Margaret Thatcher's Tory Government, which was engaged in an all out war with the IRA.",
