      "ProgramSummary": "A Bridge to Life is a moving portrait of an organization that for years has been working to change and save the lives of men dealing with life-threatening addiction issues. The men receive intensive job-training skills along with psychological and spiritual mentoring to give them a chance to return to society as successful community and family members. Interwoven throughout the film is the inspiring story of Pastor William Washington, the resilient founder and executive director of the Bridge Ministry, and his triumph over trauma, homelessness, and addiction.\r\n\r\nA former homeless teenager on the streets of Charlottesville, Virginia, dealing and using drugs, William WashingtonÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â‚¬Å¾Ã‚Â¢s life took a positive turn when a compassionate judge provided him with an opportunity for rehabilitation instead of a long-term prison sentence. Motivated by this life-altering experience, he committed himself to aiding others on the same path. The Bridge Ministry emerged as a beacon of hope, offering a more compassionate alternative to incarceration in addressing our nationÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â‚¬Å¾Ã‚Â¢s critical drug addiction crisis.",
