      "ProgramSummary": "Susan Polis Schutz's new documentary film focuses on six organizations who are bringing people together whose ideas and opinions differ, but who are united in their desire to find a common bond.  The film asks pertinent questions about diversity and community, and seeks answers on what it takes to bridge the issues and ideas that divide us all.\r\n\r\nBy appreciating their hearts and engaging in common interests, we examine how these polarized groups develop a greater understanding and respect for each other. What they look like, where they live, or what their beliefs are, no longer matter. They put aside their old grievances, find common ground and are enriched by the experience.\r\n\r\nSharing Heartbeats: A Bridge Across Our Divides uncovers ways that we all can learn to bridge our divides. ",
