      "ProgramSummary": "After World War II, humanity declared that genocide would never be allowed to happen\r\nagain. But â€œnever againâ€ has become â€œagain and again,â€ from Cambodia to Bosnia to Rwanda\r\nto China to Ukraine.Why? What makes people dehumanize one another? Why does it keep\r\nhappening? And what can we do to make â€œnever againâ€ a reality?\r\nThe Broken Promise, a feature-length documentary, explores the mechanics of genocide, the\r\nconditions that allow it to occur, and the ideas and institutions that stand against it. The\r\nfilm presents the raw, unflinching first-person stories told by the survivors of genocide and\r\nhow the trauma of genocide ripples through generations.\r\nWith insights from forward-thinking policymakers, scholars, and activists, it examines the\r\ncharacteristics of those who perpetrate itâ€”their self-serving goals, their destruction of\r\ndemocratic institutions, and their utter disregard for the slaughter that follows.\r\nThe challenge is clear - genocide is not a once-in-a-generation event humanity can witness,\r\nwring our collective hands over, and consign to the history books. It is a tool authoritarians\r\nwield all too easily - and big business is complicit in its use. The interplay of racism,\r\nauthoritarianism, and impunity is shown to be at the core of genocide.\r\nWhile The Broken Promise includes honest stories of human cruelty and suffering, they are\r\nalso stories of the human spiritâ€¦and inspiring stories of hope.",
