      "ProgramSummary": "Like giant exclamation marks, skyscrapers punctuate the story of our urban evolution. From their humble beginnings in the late 1880s to giants still under construction, they complement and define our contemporary lives. \r\nIn the documentary series Building To The Sky, discover the extraordinary stories behind the world’s biggest and best skyscrapers featuring towering structures from the past, the best tall modern buildings, and amazing high structures still being designed and built.\r\nThe skyscraper. From the Chrysler Building to Burj Khalifa, these monuments of the modern world are a triumph of human imagination, made real through the might of science and engineering. They are shining symbols of our desire for greatness, of our need to expand and improve, and to build bigger and smarter. Above all, these towers reflect the unquenchable desire to conquer new heights beyond our wildest dreams.\r\nFrom Chicago to London, from Tokyo to Dubai, Building To The Sky is the tale, told by the experts, of many great cities racing to build to the sky.",
      "ProgramTitle": "",
