      "ProgramSummary": "In the countryside of County Clare, Ireland is a place called The Burren; a mysterious place unlike anywhere else, with deep caves, a stony, rocky landscape and ancient dolmens, ring forts and castles. The two-part documentary series THE BURREN: HEART OF STONE narrated by Brendan Gleeson, unveils the secrets hidden in the stones of this dramatic wind swept countryside.\r\n\r\nEpisode One \"Symphony of Life\" moves through the natural cycles of the seasons, witnessing spectacular scenes from the natural world, discovering prehistoric Celtic rain-forests and exploring the formations of the rocks and underground caverns, the mysterious disappearing lakes and the wildlife that inhabits the wilds of the Burren. \r\n\r\nEpisode 2 \"Song of our Ancestors\" locates clues written in the stones, tombs, and underground caverns that populate the Burren, which help us to travel back in time to reveal fresh secrets of the human story. We discover what Ireland might have looked like when the first nomadic big-game hunters came here. We follow the three distinct populations that lived in Ireland in prehistoric times and unravel the secrets of this unique and mysterious landscape and those who lived on it. It asks if prehistoric farmers irreversibly altered this landscape and if modern Irish society is descended from those who first lived here over 10,000 years ago.\r\n",
      "ProgramTitle": "BURREN: HEART OF STONE, THE",
