      "ProgramSummary": "As a love letter to Southern stories and the authors and poets who write them, By The River explores the inspiration, passion, and writing that it takes to create a Southern story. Through interviews with Southern Authors, Holly Jackson explores books that encompass literature, historical fiction, memoir, nature, non-fiction, cooking, Southern culture, mysteries, children's books, and poetry.\r\n\r\nIn this 13-part series, authors and book settings span all fifty states with special focus on the states of Florida, Georgia, Kentucky, Louisiana, Mississippi, North Carolina, South Carolina, Tennessee, and Virginia. Each episode ends with a Poet's Corner that features Southern Poets reading their poetry set to illustrations by Southern Artists. Authors for season one includes Mary Whyte, Pullitzer Prize winning and 19th U.S. Poet Laureate Natasha Trethewey, Eric Crawford, Jo Hackl, John Cribb, Carrie Morey, Mary Alice %252526 Angela May, Tom Poland, Robert Clark, Kristin Harmel, Karen White, Patti Callahan Henry, Preslaysa Williams, Kristy Woodson Harvey, and Wanda Lloyd. All authors are either New York Times best sellers, or up and coming story tellers.  The series presents diverse stories and voices.",
