      "ProgramSummary": "As a love letter to Southern stories and the authors and poets who write them, â€œBy The Riverâ€ explores the inspiration, passion, and writing that it takes to create a Southern story.  \r\n\r\nThrough in-depth interviews with Southern Authors, from inside a coastal library on the banks of Beaufort River, Holly Jackson engages authors as they read from their books, tell humorous and heartwarming stories, share their love of reading, and elicit advice for aspiring writers. Join us as we explore Southern culture through the passion of a reader, and the process of a writer, all, as we sit â€œBy The Riverâ€. \r\n\r\nSeason 3 of â€œBy The Riverâ€ takes a deeper look into what it takes to write Southern stories and offers a more personal approach. In this 10-part series, authors and book settings span the states of the American South and encompass multiple book genres such as literature, historical fiction, nature, non-fiction, cooking, Southern culture, mysteries and thrillers. Produced by Dr. Caroline E. Sawyer, associate professor of communication studies at University of South Carolina Beaufort (USCB) and includes USCB students as the production crew. \r\n\r\n",
