      "ProgramSummary": "A fascinating insight into the work of royal cameraman Peter Wilkinson, who has been present at the Queen's public engagements for 18 years. \r\nThe program follows Royal cameraman Peter Wilkinson, who has been ever-present at the Queen’s public engagements for 18 years, to provide a close insight into his unique relationship with the monarch.  \r\nWith special access to key Royal engagements, this programme paints a fresh portrait of the Queen as Peter films her during a state visit by the Chinese president, at a Royal garden party at Buckingham Palace, on a visit to Essex and in Scotland on the momentous day she became the longest serving monarch in British history.   Peter has a unique role, funded by UK broadcasters but requiring him to work closely with Buckingham Palace. The programme features footage of the Queen from Peter’s 1,800 assignments, and shows how his pictures from events like these are then beamed into millions of homes around the world.",
      "ProgramTitle": "CAMERAMAN TO THE QUEEN",
