      "ProgramSummary": "Based on the acclaimed memoir One Train Later by rock guitarist Andy Summers, CAN'T STAND LOSING YOU: SURVIVING THE POLICE follows Summers' journey from his early days in the psychedelic '60s music scene, when he played with The Animals, to chance encounters with drummer Stewart Copeland and bassist Sting, which led to the formation of a punk trio, The Police. During The band's phenomenal rise and its dissolution at the height of their popularity in the mid-80s, Summers captured history with his candid photographs. Utilizing rare archival footage and insights from the guitarist's side of the stage, Can't Stand Losing You brings together past and present as the band members reunite, more than two decades later, for a global reunion tour in 2007. \r\n\r\nhttps://www.amctheatres.com/movies/can-t-stand-losing-you-surviving-the-police",
