      "ProgramSummary": "Captivated\r\n(4 x 60, Story Films for Channel 5)\r\nTX: Q1 2024\r\n \r\nRachel is scared, she’s running from something with her son, Liam. Flashing back to two months ago, Rachel is a cleaner working for an agency, and she often takes her son with her because she can’t afford childcare. Although the work is relentless and she’s struggling financially, Rachel often cleans beautiful places including opulent hotels. After cleaning a fancy suite at a hotel, she gets chatting with a man in a hoodie who’s looking after a stray cat. The cleaning company is then approached by a private client who has asked specifically for Rachel to help clean a large house in the countryside. Again, she brings Liam with her, whilst there they enjoy dreaming about living in such an amazing place. On one cleaning visit, the owner is at the house – he’s revealed to be the hoodie man and he strikes up a friendship with Rachel’s son Liam. Liam likes nature, and they discuss the ducks in the pond. But slowly, we become to be a bit suspicious, as in the house there is a boy’s bedroom that could be perfect for Liam, what does Elliot really want from his bespoke cleaner and her son? And how did things get so bad that Rachel has had to go on the run? Can Rachel get out of it all with herself and her son intact? \r\n \r\nCast: Kara Tointon (Mr. Selfridge, Eastenders), Allen Leech (Downtown Abbey, Bohemian Rhapsody), Sara Powell (Silent Witness, Unforgotten, Damned), Taj Atwal (Line of Duty, The Control Room, The Syndicate)\r\nWriters: Cameron McAllister (New Tricks, Primevil), Nessah Muthy (A Gentleman in Moscow, The Winter King) \r\nDirector: David Leon (Vera)",
