      "ProgramSummary": "Behind the wheel of a Morris Traveler, internationally acclaimed violinist Daniel Hope explores Ireland, music, and his roots. Through encounters with Irish musicians and his personal heritage, Hope discovers the close ties between the country's music and its history. \r\n\r\nThis music-fueled road trip through Ireland takes viewers to medieval Kilkenny, where Hope meets \"Queen of the Irish harp\" Siobhan Armstrong; to Galway, the capital of street music and home to fiddler Se%C3%A1n Smyth of the band Lunasa; and to Dublin, where Hopes premiere a piece by Irish composer Ina Boyle with the National Symphony Orchestra.\r\n\r\nDaniel Hope was born in South Africa, where his great-grandfather, Danny McKenna, settled after leaving Ireland at the beginning of the 20th century. \"Ireland is a homeland I've never lived in,\" says Hope, who received an Irish passport as a child when his father, writer Christopher Hope, left South Africa following his resistance to the apartheid regime, moving his family to London. Together, father and son embark on the most affecting leg of the road trip, visiting Waterford to search for McKenna's last-known residence.\r\n",
      "ProgramTitle": "CELTIC DREAMS: DANIEL HOPE'S HIDDEN IRISH HISTORY",
