      "ProgramSummary": "Changing Seas goes to sea with explorers and scientists as they uncover new information that could lead to scientific breakthroughs. This documentary series lets viewers experience first-hand how oceanographers and other experts study earth's last frontier, and it sheds light on how human activities are threatening ocean resources. \r\nEpisode descriptions: \r\n1401: Vanishing Whales \r\nThe Humpback whale population that migrates between Hawai%25252525CA%25252525BBi and Alaska is considered a conservation success story. When sightings of the animals suddenly dropped, people became concerned. Scientists in both locations are trying to understand what happened to the whales and why.\r\n\r\n1402: Humpback Health \r\nHow does the body size and overall health of Humpback whales change across their migratory cycle? A team of researchers studying the animals that spend part of the year feeding in Alaska and a few months fasting while in the Hawaiian breeding grounds, is making remarkable discoveries. \r\n\r\n1403: Kelp: Hidden Treasure of the Salish Sea \r\nThe kelp forests of the Puget Sound have long played an essential role in the local ecosystem as a habitat and food source. Today, this foundational species is in decline, but resource managers, scientists, tribal citizens, and advocates are working together to solve the mysteries of conserving and restoring kelp forests.\r\n\r\n1404: Saving Florida's Starving Manatees \r\nFlorida's iconic sea cows are dying in record numbers. Years of declining seagrass beds have eliminated one of the gentle giants' primary food sources. Now wildlife managers have taken the unprecedented step of feeding the animals, while scientists are in a race against time to restore the lost seagrass.\r\n",
