      "ProgramSummary": "Changing Seas goes to sea with explorers and scientists as they uncover new information that could lead to scientific breakthroughs. This documentary series lets viewers experience first-hand how oceanographers and other experts study earth's last frontier, and it sheds light on how human activities are threatening ocean resources. \r\n\r\nEpisode descriptions:\r\n\r\n1501:\r\nMany people delight in collecting seashells on the beach. Episode 1, MOLLUSKS: MORE THAN A SHELL, takes a closer look at the fascinating animals that build these elaborate skeletons. Discover never seen micro-mollusks and explore the mysterious world of blackwater diving where youâ€™ll encounter otherworldly creatures.\r\n\r\n1502:\r\nNext, travel with us to Belizeâ€™s stunning barrier reef, which is home to a variety of shark species. Episode 2, SHARKS IN BELIZE: JAGUARS OF THE SEA, looks at a unique collaboration featuring local fishers who leverage their generational knowledge to help marine scientists and fisheries managers keep shark populations healthy for all. \r\n\r\n1503:\r\nBermuda is not only the shipwreck capital of the world, but also home to one of the highest-latitude coral reefs. Episode 3, BERMUDA: LIFE AT OCEANâ€™S EDGE, examines the clues these uniquely resilient corals may offer scientists for protecting the islands from the accelerating impacts of a changing climate. \r\n\r\n1504:\r\nAnd finally, bundle up for a journey to the high Arctic. Episode 4, LIFE IN THE DARK: THE POLAR NIGHT, joins a team of scientists at the northernmost year-round research station in the world. They are trying to understand how some of the tiniest ocean animals can survive at a time of year when their main food source is not available.",
