      "ProgramSummary": "Shot during a quick tour of Ireland just weeks after (I Can t Get No) Satisfaction hit # 1 on the charts, The Rolling Stones Charlie is my Darling – Ireland 1965 is an intimate, behind-the-scenes diary of life on the road with the young Stones. It features the first professionally filmed concert performances of the band and documents the early frenzy of their fans and the riots the band s appearances inspired. The band is shown traveling through the Irish countryside by train; dashing from cabs to cramped, basement dressing rooms through screaming hordes of fans. Motel rooms host impromptu songwriting sessions and familiar classics are heard in their infancy as riff and lyric are united. Charlie is my Darling is the invaluable frame that captures the spark about to combust into The Greatest Rock and Roll Band in the World.\r\nIncorporates the new 2012 version of the film as well as the director s cut and producer s cut, plus significant unseen additional performance and other footage shot in Dublin and Belfast in September of 1965.\r\n\r\nABKCO website",
