      "ProgramSummary": "From 1907 until his death, John Peabody Harrington crisscrossed the U.S. chasing the voices of the last speakers of Native America's dying languages. Understanding languages was his gift, which became his obsession. From one tribal community to the next he went, working in collaboration with the last speakers documenting every finite detail of the language before it was lost forever. Writing note after note, page after page, day after day, year after year, until his death in 1961. Over time Harrington grew more and more paranoid fearing others would steal his work. This paranoia caused him to hide his work, only sharing small amounts to satisfy his employer the Bureau of American Ethnology. Shortly after his death, boxes of notes began arriving at the Smithsonian. Six tons of materials collected in a basement at the Smithsonian. Harrington had amassed well over one million pages of notes on over 100 different languages during his 50-year career. A feat matched by no other. Today descendants of those last speakers are now reviving their languages thanks to Harrington and the elders who trusted and spoke to him.\r\n\r\nI first was introduced to the story of John Peabody Harrington when I was doing master/apprentice language learning with my uncle.  During this time, I decided to not to go to graduate school and devote my time on learning my Quechan language.  This devotion involved doing research on archival materials related to my Quechan people.  I would spend hours and days searching through online articles and collections trying to locate and gather as much information about my people. In doing so, I came across a paper published on the creation story of the Quechan.  This paper was written by John P. Harrington in 1914.  I wasn't sure who he was, so I searched his name and surprised by the articles that came up.  I realized that this man had accomplished all this work on Native American languages, but no one has heard of him. It was as if he was purposefully left out of history.  \r\n\r\nI really felt that his story needed to come to light. The more I researched the more I began to realize just how massive his collection of notes impacted so many different Native American people. I became aware of just how large the problem of traditional language loss was in our Native communities.  I felt that his story could bring to light the issues and concern around language loss today.  Film is a powerful tool that can be used to tell stories about our people and to be used to help preserve our traditional ways.  \r\n\r\nWhen I first moved back to the reservation it was to work with our elders, documenting our language and sacred sites in order to preserve and pass this information down to the next generations.  In the process I've come to learn that there are so many stories about our people that will never be heard outside our own communities unless we tell them ourselves. Today, we have the means to do this. I hope my films will reach the larger general viewership in the hopes of bringing to light the history and current issues facing our people.  Most of the stories I produced I have a personal connection to, whether the story is about language, sacred sites, or history. I'm personal invested in these stories and the people who tell them, sharing with the world a small slice of my native experience. \r\n",
      "ProgramTitle": "CHASING VOICES",
