      "ProgramSummary": "THE CHAVIS CHRONICLES is a thought-provoking half-hour weekly series with an urban  American flair, featuring interviews with famous leaders and politicians, doctors and scientists, cultural leaders and influencers from around the globe. The series is hosted by Dr. Benjamin F. Chavis, Jr., an award-winning journalist, civil rights icon, and consummate intellectual influencer. Going beyond the headlines, THE CHAVIS CHRONICLES offers insights on matters that impact the public, and provides a unique perspective from a renowned living legend of the African American community.\r\n\r\nGuests from Season 1 have  included :\r\n\r\nRepresentative James E. Clyburn (D- SC), Majority Whip\r\nVeteran civil rights activist and Congresswoman Eleanor Holmes Norton \r\nNational NAACP President Derek \r\nDr. Lisa Fitzpatrick, an infectious diseases physician and CDC-trained medical epidemiologist.\r\nPublishers DeAnna Tisdale-Johnson and Jackie \r\nDr. Johnnetta Cole, Chair and President, of the National Council of Negro Women and Dr. Lezli Baskerville, President of the National Association for Equal Opportunity in Higher Education \r\nGrammy award winning artists Juan and Lisa Winans \r\nCivil rights attorney William H. Murphy \r\nGrammy and Emmy winning singer, songwriter, and producer Ziggy \r\nVeteran radio host and civil rights activist Reverend Mark A. Thompson\r\nAtlanta Mayor Keisha Lance \r\nDocumentary film producer Chris Jenkins (“Trapped: Cash Bail in America”)\r\nGrammy award winning Gospel artist Anthony Brown \r\nDr. Avis Jones-DeWeever, author, political commentator, and race and gender empowerment expert\r\nMildred D. Muhamad, one of the nation's top advocates against domestic violence.\r\nUAW President Rory Gamble\r\nWanda Durant, founder of Hope, Dream Believe and Achieve  and mother of NBA star Kevin Durant\r\nRep.G.K. Butterfield, Us House Chief Deputy Whip (D-NC) \r\nRobert Stanton, the first African American to serve as Director of the National Parks Service\r\nHarvard University law professor and attorney Dr. Sharon Anderson \r\nKenneth Kelly, CEO of First Independence Bank\r\nDeborah Owens, financial expert\r\nDr. Glenda Baskin Glover, President of Tennessee State University and International President of the Alpha Kappa Alpha (AKA) Sorority \r\n\r\n\r\n\r\n\r\n",
