      "ProgramSummary": "Dale Chihuly helped revolutionize the studio glass movement by expanding its original premise of the solitary artist to encompass the notion of collaborative teams and a division of labor within the creative process. For three decades, the artist has exhibited extensively in museums, and his site-specific, public sculptures can be seen in cities around the world.\r\n\r\nIn 2006, the world-renowned artist reunited glass-blowers from important periods of his career for a week-long residency at the Museum of Glass in his hometown of Tacoma, Wash. The event brought together the artists and craftsmen to produce pieces revisiting some of ChihulyÃ¢â‚¬â„¢s most important series, representing more than 30 years of work. Forty gaffers and artists participated in the residency, and were joined by more than 10,000 visitors wishing to see the creative process first-hand.\r\n\r\nThe fast-paced documentary, CHIHULY IN THE HOTSHOP (available in both 60- and 90-minute versions), captures highlights of the Museum of Glass residency, following Chihuly and his teams as they create magnificent pieces of glass art before an appreciative audience in the museum's state-of-the-art hotshop. Their work revisits 13 of Chihuly's best-known series: Cylinders, Baskets, Seaforms, Macchia, Soft Cylinders, Persians, Venetians, Piccolo Venetians, Putti, Ikebana, Niijima Floats, Pilchuck Stumps and Fiori.\r\n\r\nFilmed in high-definition video, CHIHULY IN THE HOTSHOP provides viewers with an intimate look at the challenging, often physically grueling, process involved in creating a work of art in glass. The documentary shows Chihuly drawing designs for the glass pieces as team members blow, roll, fire and shape the pieces to completion. From applying a thin layer of gold foil to a molten sphere of glass, to lining a mold with pieces of wood in order to impart a bark-like texture to the glass that will be blown inside it, the artists and gaffers use a variety of techniques to achieve the striking results for which Chihuly and his teams are known. The documentary reveals the wide range of artistic styles seen in ChihulyÃ¢â‚¬â„¢s work, from the Navajo Blanket Cylinders produced with skilled glass-blower and gaffer Benjamin Moore, to the Putti series Ã¢â‚¬â€ small, cherub-like characters crafted from blown glass Ã¢â‚¬â€ created with glass sculptor Pino Signoretto.\r\n\r\nIn the film Chihuly discusses the genesis of each collection of works. He says he derived inspiration for his early, breakthrough Baskets series from Indian baskets he saw in 1977 at Tacoma's Washington State Historical Society. Chihuly recalls his creation of the Venetian series with Italian master glass-blower Lino Tagliapietra after seeing Art Deco glass in Venice; ultimately, the series \"took on a life of its own,\" drawing upon forms and techniques from throughout history. Chihuly also recounts how a visit to a Japanese island in the mid-1990s evoked boyhood memories of collecting fishing floats along the Washington coast; those memories spurred the creation of the Niijima Float series, the largest and most complicated and challenging pieces Chihuly and his team ever produced. Interwoven with these recollections and insights into the artistÃ¢â‚¬â„¢s work are high-energy montages of the artists and gaffers bringing ChihulyÃ¢â‚¬â„¢s designs to fruition.",
      "ProgramTitle": "CHIHULY IN THE HOTSHOP",
