      "ProgramSummary": "Follow American artist Dale Chihuly as he tests his own resolve and challenges his team to push the glass medium to its physical limits in the pursuit of a new creative concept. Chihuly: Roll the Dice documents the master artistâ€™s exhaustive, five-year process to realize â€œRotoloâ€â€”a series of large-scale pedestal sculpturesâ€”and his working relationship with trusted long-time gaffer, James Mongrain. \r\n\r\nThe Italian word for coil, \"Rotolo\" is a series of large-scale sculptures twisting upward toward the sky. The â€œRotoloâ€ series started in 2013, when Dale Chihuly had the idea of working with clear glass coils.  James Mongrain, Chihulyâ€™s lead gaffer, remembers receiving a series of excited voice messages from Chihuly, where he outlined his new idea.  â€œIâ€™m thinking about these coils, maybe coming off a vessel, I donâ€™t know exactly what weâ€™ll do, I just know I want them to be big, as big as we can.â€  That began a four year exploration of technical and sculptural possibilities.\r\n\r\nChihuly is an artist known for the scale of his sculptures and his use of color. So it is notable that the â€œRotoloâ€ was initially made with clear glass.  The first experiments were as much about scale as anything else.  The first pieces were actually titled by their weight in pounds, as in â€œRotolo 121â€. Andreas BlÃ¼hm, director of the Groninger Museum, describes them as  â€œThe largest glass objects that you can physically makeâ€.  And for Chihuly it was about finding a form to best express this idea.  Andreas BlÃ¼hm continues: â€œThey are very heavy, but they look light.  The form is wild and baroque, but they are also quite reduced.  Awe inspiring, and subtle.â€\r\n\r\nChihuly ran into technical problems in working with glass of this scale.  The â€œRotoloâ€ changed radically over the four years, but maintained the spirit of the initial idea.  Chihuly made drawings as he went, exploring how many coils were necessary to convey the power of the glass, and Mongrain watched those drawings develop and worked to re-create them: â€œFor the last four years he did have this vision for how these pieces were going to look and were supposed to look, and he would do drawings.  Some were round and had a lot of coils, and some were just a fluid one or two.  I think weâ€™re at the point now where he wanted to be.â€",
