      "ProgramSummary": "\r\n So what is this peculiar love story between humans and chili peppers? A twisted tale of warmth until you burn! \r\nA journey as playful as it is evocative, CHILIHEADS takes us on the Hot Pepper road to five countries: Canada, the United States, Mexico, Trinidad and Tobago and India to meet ‘chiliheads’; lovers of hot peppers, to discover their culture and the sub-culture that surrounds the consumption of this unique spicy fruit. By engaging farmers, producers, chefs, scientists, historians and even psychoanalysts, the film deconstructs the incredible history of hot peppers and our crazy relationship to them. This formidable story then brings us back to our time, where small producers discretely wage a small war, to push the limits, in an attempt to win the title of “strongest pepper in the world”. ",
