      "ProgramSummary": "CHRISTINA COOKS: BACK TO THE CUTTING BOARD Season 3\r\n\r\nIn this new season of CHRISTINA COOKS: BACK TO THE CUTTING BOARD (13x30), host Christina Pirello introduces a totally new dietary concept, combining the two healthiest diets in the world: ‘The Macrobiotic Diet’ coming to us from Asia (Japan), and ‘The Mediterranan Diet’, coming to us from the western Mediterranan. Christina calls it ‘The Macroterranean Way’!\r\n\r\nChristina uses her unique way of making healthy cooking fun, connecting with the viewer in an informative and entertaining way.  Her natural humor, wit, and ability to make people laugh makes her authentic in an authoritative way, while doing it naturally. Christina was one of the first pioneers of vegan cuisine as a healthy eating option, a way of nourishing our bodies to their natural strength and wellness. Her passion for human wellness and helping people make the healthiest choices for their lifestyles drives her work and has for the last 35 years, since she began teaching cooking classes in her kitchen.\r\n\r\nChristina is an educator at heart, teaching nutrition and culinary courses at Walnut Hill College, the home of the acclaimed Restaurant School, in Philadelphia, PA.\r\n\r\nCHRISTINA COOKS: BACK TO THE CUTTING BOARD Season 3 shows viewers that healthy cooking can be fun, easy to prepare, and delicious! \r\n",
