      "ProgramStatus": "Contract",
      "ProgramSummary": "Season five of CHRISTOPHER KIMBALL'S MILK STREET TELEVISION searches the world over for techniques and ingredients that can transform the way America cooks and eats. \r\n\r\nEach episode gives viewers the chance to meet cooks from around the world and  see how their sources of inspiration result in a new style of home cooking. It may be a new way to use spices, a simpler way to cook chicken, a fresh combination of ingredients, or tricks that turn everyday food into something special. Host Chris Kimball and his team of cooks find techniques to help viewers produce bigger, bolder, simpler dishes with less time and effort.\r\n\r\nFilmed all over the world, season five includes recipes and travel Ukraine, Crete, Mexico, Bologna and Israel, as well as many other countries, and within the U.S. Dishes from around the globe include Orange and Broken Phyllo Pastry Pie, Homemade Udon Noodles with Spicy Meat and Mushroom Sauce, Portuguese Sponge Cake (Pão do Ló), Garlic and Cilantro Soup with Chickpeas, Ethiopian Chicken Stew (Doro Wat). And don’t forget the desserts!  Swedish “Sticky” Chocolate Cake, Yogurt Loaf Cake with Coriander and Orange, Italian flourless Chocolate Torta, and Cherry Pistachio and Coconut Cake. ",
