      "ProgramSummary": "Milk Street searches the world over for techniques and ingredients that can transform home cooking, producing bigger, bolder dishes with less time and effort. The series is filmed across the globe -- Season six features over a dozen countries, including Morocco, Italy, Mexico, Turkey, Brazil, Greece, Jordan and Colombia--and at the headquarters at 177 Milk Street in downtown Boston. Each episode gives viewers the chance to meet cooks from around the world and see how their inspiration results in faster, easier and bolder recipes. Travel to Fes, Morocco to make their famous flatbread, khobz; to Rome to unearth the original recipe for fettuccine alfredo; to Brazil to make white tablecloth pizzas; to Los Angeles to sample the rich diversity of regional taco offerings; to Yelapa, Mexico to taste corn, chocolate and coconut pies sold on the beach; to Jordan to learn how to make amazing falafel; and to Liberia to make a special banana bread. It may be a new way to use spices, a simpler way to cook chicken, a fresh combination of ingredients, or tricks and techniques that turn everyday food into something special. Where in the world will inspiration strike next? Join Milk Street Television on a culinary quest to transform the way America cooks--and eats.",
