      "ProgramService": "Syndication",
      "ProgramStatus": "Pulled back by supplier",
      "ProgramSummary": "Three-part biopic of the Liverpudlian songbird who would later find fame and fortune. It tells of her rocky road to fame and captures the essence of 1960s Liverpool. Championed by The Beatles, she began her career as a singer in 1963, and her singles \"Anyone Who Had a Heart\" (1964) and \"You're My World\" (1964) both reached number one.   Starring Sheridan Smith (Mrs. Briggs; Gavin & Stacey), Aneurin Barnard (Spring Awakening; The White Queen), Ed Stoppard (Upstairs, Downstairs) and Tom Dunlea (Jimi: All Is by My Side) \r\n\r\nEpisode 1\r\nIn 1960s Liverpool, young Priscilla \"Cilla\" White is working as a typist, but frequently performs at Liverpool's famed Cavern Club where she meets young singer-songwriter Bobby Willis. Mersey Beat, a local music publication, prints an article on Cilla in which she is mistakenly referred to as \"Cilla Black\". However, young Cilla likes the sound of it and decides to use if for her stage name. It is arranged for her to audition for the Beatles' manager, Brian Epstein. However, her voice wavers mid-performance, and she loses ground to her rival, Beryl Marsden.\r\n\r\nEpisode 2 \r\nAs Cilla's confidence returns following her disastrous audition, Bobby urges her to give singing another go, and Brian Epstein gives Cilla another chance to audition by inviting her into the studio to record what would become her debut single, \"Love of the Loved\". The song fails to break the Top 30, but Brian then insists that Cilla change direction and take a gamble on a cover of a Dionne Warwick ballad entitled \"Anyone Who Had a Heart\". The gamble pays off and \"Anyone Who Had a Heart\" shoots straight to the top of the charts.\r\n\r\nEpisode 3 \r\nCilla follows up Anyone Who Had a Heart with a second consecutive number one, \"You're My World\". However, she fails in her subsequent bid to conquer America and tempers flare in her blossoming relationship with Bobby. Meanwhile, Brian Epstein's life is unravelling as the Beatles start to drift apart and Epstein, a closeted homosexual, wrestles with his inner demons which include a dependency on sleeping pills. One evening, Cilla and Bobby are out enjoying a meal when Bobby takes a phone call and tells Cilla that Brian has been found dead. By his bed, the police found a contract from the BBC for Cilla to star in her own TV series, which she signs.",
