      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "In summer 2020 the music stopped, as the pandemic put an end to most live performances. At Incline Village, Nevada, the annual Classical Tahoe summer music festival was dealing with that while facing a more personal crisis.  The loss of Founding Artistic Director Joel Revzen to COVID-19 devastated the Classical Tahoe family, but it also inspired a determination to find a way to make live music happen again in Joel's honor.  A combination of innovative thinking and personal inspiration resulted in a unique musical experience.  \r\n\r\nClassical Tahoe found a way to not only hold a three week Chamber Music festival, but do it safely and share it with a worldwide audience.  The six-episode series CLASSICAL TAHOE features select performances from the festival and supplements it with stories from the world-class musicians who perform and the team that was able to make this festival happen under the most trying circumstances.  \r\n\r\n\r\n",
