      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "CLASSICAL TAHOE Season 2 features six new episodes of orchestral music from a world-class group of musicians who come to Lake Tahoe from various locations across the globe to perform at the highest level while also enjoying the sublime beauty of this region.  The 2021 season was a return to normal for the event after the extreme measures needed to hold the previous year's festival during the beginning of the pandemic.  More musicians were able to perform this year, with a brand-new stage built expressly for the purpose of featuring the orchestra's sound while displaying the surrounding natural landscape. PBS Reno live streamed and recorded concerts during the 10th Classical Tahoe Chamber Music Series in July and August 2021, from the breathtaking outdoor setting of Sierra Nevada University in Incline Village, Nevada. The PBS Reno production and technology teams utilized multiple cameras to capture a variety of angles of the musicians, the instruments, and the audience.  Performances feature familiar composers such as Strauss, Tchaikovsky and Beethoven, with more modern additions such as Aaron Copland, Jessie Montgomery and Dave Brubeck.  The final episode of this season highlights Brubeck at 100, with performance that blends the Classical Tahoe Orchestra with the Brubeck Brothers Quartet.  It's a musical fusion that is guaranteed to get toes tapping.  \r\n",
