      "ProgramSummary": "CLASSICAL TAHOE Season 3 features six new episodes of orchestral music from a world-class group of musicians who come to Lake Tahoe from various locations across the globe to perform at the highest level while also enjoying the sublime beauty of this region. The 2022 season once again returns to the campus at Incline Village, now known as the University of Nevada, Reno at Lake Tahoe. The beautiful setting and dynamic staging are back, but some of the faces are new. Conductors Ken-David Masur and Jonathan Darlington make their debuts at the festival, and soloists Aldo Lopez-Gavilan (piano) and Tessa Lark (violin) light up the stage, as does special guest Isabel Leonard. The PBS Reno production and technology teams utilized human operated and robotic cameras to capture new perspectives of the performers. Music features familiar composers such as Pucini, Bizet and Rachmaninoff, with more modern additions such as Lopez-Gavilan, Coleridge Taylor Perkinson and Emmanuel Sejourne.",
