      "ProgramSummary": "The Program features a long-form panel discussion designed to be the antidote to the quick hits and soundbite mentality that dominate the airwaves, often shedding more heat than light. By showcasing a multiplicity of voices and providing a platform to the voiceless, it seeks to perpetuate the democratic principle that out of many, we are one. Common Ground will deliver a monthly, one-hour program about the country's most critical issues. In an era paralyzed by bitter and bilious partisanship that mutes almost all communication across the political divide, we serve as a political bridge. The only national television program that chats with - rather than talks at - the audience, our shows are designed to promote an exchange of ideas and create a collective database that paves the way for the emergence of more equitable solutions to the country's most challenging problems.  \r\n\r\nWe tell the ongoing story of an evolving America in all its complexity and home in on questions that reverberate in people's everyday lives. Our long-form panel discussions are the antidote to the quick hits and soundbite mentality that dominate the airwaves, often shedding more heat than light. By showcasing a multiplicity of voices and providing a platform to the voiceless, we seek to perpetuate the democratic principle that out of many, we are one. \r\n\r\n",
