      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "The Democracy Festival: \r\n\r\nAmid the intense polarization leading up to Novemberâ€™s elections, we proudly present â€˜Common Ground October,â€™ a PBS celebration of America's democracy â€“ honoring its storied past, examining its complex present, and envisioning a hopeful future.\r\n\r\nThis month-long festival features four hour-long episodes showcasing our â€˜better angels,â€™ voices from across the political spectrum who offer reassuring perspectives on how America has weathered such storms before and can again prevail.\r\n\r\nEach episode, centered on panel discussions, explores different facets of American democracy, emphasizing how each of us can help rebuild and strengthen our democracyâ€™s battered guardrails. \r\n\r\nEpisode Descriptions:\r\n\r\n1 - Saving the Shining City on the Hill\r\n\r\nWhen the Soviet Union dissolved, the triumph of liberal democracy seemed so assured that some political scientists famously dubbed it â€œthe end of history.â€ Yet, three decades later, history marches on while many of our political institutions have remained moored in place, creating a disjuncture that threatens the future of democracy. In this episode of Common Ground with Jane Whitney, we feature a panel of preeminent thinkers who discuss the battle between autocracy and democracy, analyze the evolving landscape, and offer strategies for Americans to safeguard our Republic.\r\n\r\nConfirmed Guests: Deval Patrick, Amanda Carpenter \r\n\r\n2 - The American Dream: A Dying Myth\r\n\r\nThe American dream, rooted in the belief that hard work leads to success, is the very soul of the nation, and perhaps the most widely shared expression of what the country represents. In recent decades, however, progress for many has stagnated while income and wealth inequality have surged. The data is irrefutable: With a backsliding labor movement, a growing housing crisis, flatlining wages, uneven wealth distribution, and stalled social mobility, the once-bright promise of the American Dream is fading. This episode of Common Ground with Jane Whitney explores the far-reaching consequences of these recent trends, examines the values guiding economic policy, uncovers the intricate ties between our political and economic crises, and charts a course toward making the seemingly impossible American Dream attainable for all who aspire to achieve it.\r\n\r\n3 - Our Better Angels: The Thinkers Shaping the Future \r\n\r\nBesieged by an unprecedented convergence of crises, the atonal, discordant bickering that marks our every interaction as a country easily could be mistaken as our national anthem. Thatâ€™s eroding our trust in institutions, unraveling our democratic norms, and generating a collective anxiety as oppressive as putrid smoke. Despite the diminished stature of many political leaders, a few voices rise above the maddening cacophony, summoning our 'better angels.' In a series of one-on-one conversations, featuring influential thinkers who have studied how the country has weathered its toughest times, Common Ground with Jane Whitney offers the calming reassurance of historical perspective and a moral clarity that can inspire a broad cross-section of Americans.\r\n\r\n4 - Hope, Healing, and Humor: Chicken Soup for Americaâ€™s Soul\r\n\r\nIn an era marked by vicious partisan polarization, an unrelenting culture war, declining trust in institutions, and skyrocketing rates of loneliness and isolation, optimism and hope have become as rare and precious as multi-carat emeralds. The American spirit, once defined by its resilience and vigor, now seems overshadowed by despair. Yet, amidst this darkness, a few voices emerge, offering messages of hope, healing, and humor. This episode of Common Ground with Jane Whitney gathers insights from a diverse array of guestsâ€” bipartisan thought leaders from throughout the seasonâ€” who share their perspectives on how we can rekindle the optimism that Americans once celebrated as their birthright.",
      "ProgramTitle": "COMMON GROUND OCTOBER,’ A CELEBRATION OF AMERICA'S DEMOCRACY",
