      "ProgramSummary": "Fear and fury now define Americaâ€™s public square, normalizing conflict and provoking violence.\r\nâ€œDemocracies donâ€™t have to die at the end of a rifle,â€ President Biden said in summarizing the\r\nexistential threat. â€œThey can die when people are silent, when they fail to stand up.â€\r\nThe way we live, the rule of law, national and global security, the fate of the environment â€” all\r\ndepend on whether Americans reject the eraâ€™s defining animosity and alienation and learn to\r\nincorporate othersâ€™ experiences into their lives.\r\nâ€œCommon Ground with Jane Whitneyâ€ provides an unrivaled paradigm of how we can do that.\r\nOur storytelling delivers intellectually rigorous but accessible information about the headlines\r\nthat mark our lives, making the most fraught issues relatable to every family. And it inspires\r\nall of us to become part of the solution, creating a new collective to forge a better future for\r\nus all.\r\nAmerica has always been a nation that defines itself as more than the sum of its parts, nothing less than an idea that weaves competing priorities into a multi-ethnic tapestry\r\nstretching from coast to coast. In the wake of a polarizing election in which both sides rejected the otherâ€™s legitimacy, â€œCommon Ground with Jane Whitneyâ€ presents (Re)Uniting\r\nAmerica, an eight-part series on the forces pulling us apart and the pathways that might bring us together. The series is divided into two stand-alone but interlocking modules\r\nâ€“ the first four shows, grouped under the title â€œUnity,â€ focus on embracing our differences, the second four, â€œThe Future Is Now,â€ on the forces molding our tomorrows.",
