      "ProgramSummary": "Cookâ€™s Country is dedicated to celebrating food and cooking in America. The show features the best regional home cooking in the country and relies on the same practical, no-nonsense food approach that has made Cookâ€™s Country magazine so successful. Cookâ€™s Country is where family-friendly recipes from every corner of the U.S. are presented for home cooks everywhere. \r\n\r\nIn season 17, hosts Bridget Lancaster, Julia Collin Davison, and Toni Tipton-Martin join test cooks Morgan Bolling, Carmen Dongo, Lawman Johnson, Christie Morrison, Ashley Moore, and Bryan Roof. They cook regional specialties from across the U.S. (North Carolina Barbecue Pork, Philadelphia Tomato Pie, Alabama Orange Rolls, and more), and share their recipes for classic American fare and weeknight workhorses (Hot-Honey Chicken, Asparagus Salad with Radishes, Slow-Roasted Medium-Rare Short Ribs, and Sausage Lasagna). \r\n\r\nJack Bishop shares his expansive ingredient knowledge with viewers, including the differences between beef steaks, types of radishes, and a tasting of Worcestershire sauce. Adam Ried shares our recommended equipment, including Grill Gloves, Rolling Pins, and Can Openers. \r\nBryan Roof travels across the country, from Seattle to Philadelphia, to learn from local cooks that have mastered regional favorites. These dishes are the inspiration for recipes such as Seattle Chicken Teriyaki; Fried Cheese Curds; and Quesabirria Tacos, which he adapts for the home cook.\r\n\r\nCookâ€™s Country Editor-in-Chief Toni Tipton-Martin will also educate viewers on the origins and regional context of recipes like Cream Cheese Kringle and Fried Catfish with Comeback Sauce, accompanied by archival photography and art.",
