      "ProgramSummary": "A story about being 17 again...\r\nIn the summer of 1953, Garfield Weston put together a sponsorship to send 50 girls from rural communities across Canada to London. A cross-country train collected each girl beginning in the Yukon, and gradually made its way to the port of Montreal. There, they would board The Empress of France and dodge icebergs across a stormy Atlantic, finally reaching Liverpool. They would soon be standing in Oxford Street to witness the Coronation procession of Queen Elizabeth. The experience transformed them instantly and forever. They witnessed a princess becoming queenâ€”she would be their Queen. The elements of character they saw in herâ€”a young woman so close in age to themselves, taking on the weight of the Crown, becoming a monarchâ€”crystallised in them important elements of character, and shaped a way of being for them that has guided them in life. Now, they are helping each other learn how to die - but not before returning one last time where they have tea at Buckingham Palace and are astonished by a surprise visitor.\r\nWith appearances by Richard E. Grant and His Majesty King Charles III.",
