      "ProgramSummary": "Though Cream released only four albums, the band left an indelible mark on the worldwide music scene. From 1966 to 1968, Cream dominated the charts with hits like \"White Room,\" \"Sunshine of Your Love,\" and \"Badge,\" displaying a bluesy, masterful approach to the psychedelic rock of the day. On the same stage where they played their farewell concert together in 1968—London's Royal Albert Hall—Ginger Baker, Jack Bruce, and Eric Clapton reunited in 2005 for the first Cream concert in 37 years. \r\n\r\nReleasing just four albums as a group, Ginger Baker, Jack Bruce, and Eric Clapton left an indelible mark on the worldwide music scene. From 1966 to 1968 with hits like \"White Room,\" \"Sunshine of Your Love,\" and \"Badge,\" Cream dominated the charts with a bluesy, masterful approach to the psychedelic rock of the late-1960s, selling 35 million records and inspiring virtually every new rock group of the era. Yet much to the disappointment of their fans, the group disbanded after only three years, playing their final concert together in 1968 at London's Royal Albert Hall to despairing cries of \"God save the Cream!\" It took 37 years, but in early May 2005, Royal Albert Hall was once again the scene for the group's much anticipated reunion, described by The Washington Times as \" a unique moment in music history. It was a long time coming, but worth the wait.\"",
      "ProgramTitle": "CREAM REUNION CONCERT AT ROYAL ALBERT HALL",
