      "ProgramService": "Premium",
      "ProgramStatus": "",
      "ProgramSummary": "Directed by Sandy Oliveri and Tony Palmer\r\nIn CREAM: FAREWELL CONCERT, the influential rock supergroup says goodbye to their fans at the Royal Albert Hall in London, on November 26, 1968. When Eric Clapton, Ginger Baker and Jack Bruce joined forces to form Cream, the history of rock n roll was forever altered. With Clapton's monstrous blues riffs, Jack Bruce's soulful vocals and Baker's polyrhythmic jazz-influenced drumming, the band was an astonishing mix of styles that produced timeless classics like \"Sunshine of Your Love and \"White Room.\" Their live shows were legendary marathons of improvisation, with the group expanding and contracting their famous tunes depending on their mood. On this night they were celebratory, a combustible trio cementing their legacy.\r\n\r\nFeaturing candid interviews with all three members and sprinkled with charmingly inept narration that attempts to \"explain\" rock music to a middlebrow audience, CREAM: FAREWELL CONCERT immortalizes one unforgettable evening with true rock gods.",
