      "ProgramSummary": "The Creole pig, indigenous to Haiti, had been of signiï¬cant value for years up until its disappearance. A hardy, boisterous breed, it served as a commodity to peasant farmers who slaughtered it for food or sold it to pay for their childrenâ€™s schooling, for weddings, seeds for their crops, and even traditional vodou ceremonies. It also held symbolic value for Haitians, as the Haitian uprising of slaves that led to the revolution and the abolition of slavery hinges on a Vodou ceremony incorporating a sacriï¬ced Creole pig.\r\n\r\nThen, in the 1980s, a swine ï¬‚u crossed the Haitian-Dominican border and started to affect the breed. The ï¬‚u also threatened livestock in the United States. As a pre-emptive measure, the USAID in conjunction with the Haitian government proceeded to exterminate all Creole pigs from the island, leading to a crushing economic blow for an already impoverished country.\r\n\r\nâ€œThe Creole Pig: Haitiâ€™s Great Lossâ€ provides a lens through which to better understand Haitiâ€™s rapid and devastating economic decline in part because of this operation, along with the failed attempt to repopulate Haiti with a similar breed of pig with the hopes to reestablish economic security in the countryâ€™s farming community. Interviews include farmers, anthropologists, educators, and political officials, who help analyze Haitiâ€™s politics and history to make better sense of the Creole pig extermination operation. The story explores the lives of country and city people in Haiti and examines the political and economic impact of this mass extinction such as the decline in school enrollment and attendance, and the rise of mass migration as Haitians began to ï¬‚ee to the United States, landing on the Florida shores.\r\n\r\n",
      "ProgramTitle": "CREOLE PIG, THE: HAITI'S GREAT LOSS",
