      "ProgramSummary": "Crooked Stick:Songs in a Strange Land\r\n\r\n- An Intimate Concert Performance - \r\nModern Arrangements of 19th Century, African-American Spirituals That Continue to Inspire Hope and Build Community \r\n\r\nThe power and poignancy of 19th century slave spirituals evoke feelings of raw power, deep empathy, pathos and poetry. When modern musical virtuosos blend modern Latin, Jazz and African rhythms with these ancient hymns, the spirituals soar even higher, truly elevating emotions and inspiring audiences. Now in a new concert presentation, internationally acclaimed mezzo-soprano Marietta Simpson teams up with two-time Emmy Award winning composer/arranger Tyron Cooper to offer an intimate concert performance.\r\n\r\nCrooked Stick: Songs in a Strange Land is a one-hour concert event, recorded before a live audience, featuring celebrated vocalist Marietta Simpson.  Simpson recently completed tours with the New York Philharmonic, the Washington National Opera, Opera Philadelphia, Theatre du Capitole de Toulouse and Opera de Bordeau.  She currently serves as the Rudy Professor of Music (Voice) at the Indiana University Jacobs School of Music. \r\n\r\nCollaborating with Simpson to craft modern arrangements is Dr. Tyron Cooper, an Emmy Award winning composer/arranger and ethnomusicologist. Cooper is also the Director of the Archives of African American Music and Culture, headquartered at Indiana University.  \r\n\r\nThe project title references an old African-American maxim that celebrates those who could \"hit a straight lick with a crooked stick\" - or overcome remarkable difficulties to do remarkable things - in this case referencing those enslaved peoples in the United States during the 19th century who created a shared language of music, using ancient melodies to find hope and strength in difficult times. \r\n\r\nToday those same songs are still sparking \"remarkable things\" by motivating today's top musicians to blend modern rhythms with these old narratives in ways that uplift audiences and ignite the spirit.\r\n\r\n",
      "ProgramTitle": "CROOKED STICK: SONGS IN A STRANGE LAND",
