      "ProgramSummary": "\"Crossing Overtown\" examines the integral role Miami would play in the national civil rights movement and the long narrative of racial conflict that still resonates in the national conversation. Overtown is the oldest Black community in Miami and it would bear witness to the full arc of the civil rights movement. \r\n\r\nDelrish Moss, a former Miami Police officer and a son of Overtown, would eventually carry the lessons of that history to Ferguson, Missouri becoming the first African American Chief of a Police Department in need of reform.",
