      "ProgramSummary": "In the Jewish tradition, tshuvah means â€œreturnâ€ and describes the return to God and our fellow human beings that is made possible through repentance for our wrongs.\r\n\r\nTony McAleer is a former Skinhead and holocaust denier who went on to become a founding member of the anti-hate activist group Life After Hate. Profoundly aware and deeply ashamed of the lineage of hate heâ€™d once promoted, Tony had long- contemplated traveling to Auschwitz in the spirit of tshuvah - to bear witness to the inconceivable ravages of the Holocaust, and deepen his personal work against the rise of extremist politics.\r\n\r\nThis project documents his profoundly personal journey of atonement to Auschwitz/Birkenau - exploring the conditions that allowed for the rise of fascism in 1930s Europe; shedding a unique light upon how men get into, and out of, violent extremist groups; and serving as a cautionary tale for our time that underscores the dangers in allowing hate to be left unchecked.",
