      "ProgramSummary": "A \"field trip for grown-ups,\" CURIOUS TRAVELER is all about traveling like you're trying to solve a mystery. Award-winning travel writer and host Christine van Blokland takes viewers to some of the most intriguing cities in the world, asking the who, what, when, where, why and how of each location. \r\n\r\nIn Season 5, we explore Spain, Greece, Italy, Austria, Portugal and Norway. Viewers will experience the beauty of Barcelona and the curiosities of Gaudi's Sagrada Familia ... the greatness of Greece, from the Acropolis' temples to Athena to curious Crete, with its Minoan and Venetian ruins...and travel to Bergen for Norway's National Day, where children dress up in \"bunads\"... In Portugal, viewers learn about Lisbon, explore its castles, villages, language and culture. In Innsbruck and the Tyrol, we are immersed in all things strudel, the Habsburgs' palaces and quirky history,  and learn why there is a giant golden rooftop in the heart of a medieval city. Up in the Alps, we even learn how to make an igloo. In Sicily, we find out the origins of the alphabet, and why the color purple became linked to royalty at some Phoenician ruins. In Sardinia, we wander through some medieval streets of Cagliari, and find out why it was very, very important to be outside the gate and walls by sundown.",
