      "ProgramSummary": "This powerful documentary explores the tumultuous lives of Diana’s parents and the complicated upbringing that shaped a Princess. Focusing on the Spencer family story we discover how Diana’s childhood impacted her – from her Mother’s tragic loss of a first son and the devastating custody trial that followed her parents’ bitter divorce, to the arrival of the flamboyant Step-Mother who Diana hated and the death of her beloved Father which gave her a new perspective.  \r\n \r\nCombining powerful insights from those that knew the Princess and her family personally, with drama reconstruction of some of the defining moments of her parents’ relationship, we trace the striking parallels between their love story and Diana’s own. And reveal how the events of Diana’s past may have influenced the decisions of her Royal future.  This is a story of broken first love, infidelity and heart-breaking family betrayal played out in the glare of the media spotlight. which gives a fascinating glimpse into the woman before the Royal legend and a dynasty whose story has all the twists and turns of a Hollywood blockbuster. ",
