      "ProgramSummary": "Everyone knows d’Artagnan, the blazing hero out of Alexandre Dumas’ iconic romantic historical drama “The Three Musketeers” and his world renowned moto “All for one and one for all”. But behind this adventurous hero from late 19th century popular literature, hides a real life character: Charles de Batz de Castelmore. As a tribute to Dumas - who died 150 years ago - the film confronts fiction and history by revealing the prolific life of this impetuous Gascon whose adventures inspired the legend of cloak and sword! A life’s journey crossing the path of famous Cardinal Mazarin before becoming Louis XIV’s right-hand man immersed in the geopolitical plots of seventeenth century Europe. \r\n\r\nD’Artagnan, the blazing hero of the 19th century French novel “The Three Musketeers”, is one of the most famous characters of World literature. But who knows the real character behind the myth? As we commemorate 150 years since Alexandre Dumas’s death, the film confronts fiction and reality.\r\n\r\n( The film aired on Prime Time on Arte on a Saturday and rated very well: 1,14 million, which is great for the channel!) ",
