      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "Narrated by actor Kevin Bacon.\r\n\r\nThis film is focused on two Top Secret WWII organizations - American and British organizations responsible for silent, unseen, highly classified missions of critical importance to defeating the Nazis. Soon after War II, the OSS became the CIA, founded in July 1947, becoming the foundation of our current Intelligence network. The British SOE during WWII (Special Operations Executive) is now MI6, continuing its long history of intelligence services.\r\n\r\nClassified Top Secret by the American OSS and Most, Most Secret by Britainâ€™s SOE, the few remaining records were partially declassified in 1998.  \r\n\r\nThe actions of these two organizations - their operations and missions and the women and men who volunteered to be secret agents, each likely not to survive, and their collective courage, risks, failures, and successes continue to be learned and always astound.\r\n\r\nWho were these women and men, our secret agents of World War II? What were their sacrifices and impacts on World War II?   Much of the current public perception of OSS/SOE, even now, is based upon utterly fictional events, enhanced or blended films of fantasy, produced after WWII with at best a loose association to facts including classics like The Guns of Navarone, the Bridge On the River Kawai, Where Eagles Dare, Inglorious Bastards â€“ and many others, and obviously all the James Bond series.\r\n\r\nMy Father's Secret War: France 1944 is a riveting and true story of an American who joined the British S.O.E. and was parachuted into France with a small team just after D-Day to organize the French Resistance into a cohesive army. \r\n\r\nThe mission was to stop Germany's most feared troops from reaching Normandy and affecting the D-Day landings of June 6, 1944.\r\n",
