      "ProgramSummary": "How did an obscure Irish melody become one of the greatest songs of all time, recorded by music's biggest names? One hundred years after 'Danny Boy' was first published, the true story of its astonishing past is uncovered, while contributors including Gabriel Byrne, Rosanne Cash, Brian Kennedy and Barry McGuigan explain its enduring appeal and what it has come to symbolize. This documentary tells the story behind the ballad ‘Danny Boy’ as the world famous song celebrates its 100th anniversary. It unravels the enigma behind the song’s astonishing success and shows how the tune played a part in some of the key historical moments of the last century. ",
