      "ProgramService": "Exchange",
      "ProgramStatus": "Offer",
      "ProgramSummary": "The Worldâ€™s Toughest Row. An extreme race where unassisted rowing boats cross the Atlantic Ocean from the Canary Islands to Antigua. For our team of four veterans, it was the ultimate test of body and mind, and an opportunity to raise funds and awareness for other vets suffering with mental illness. \r\nThe journey was incredible. The team trained hard and felt prepared for the grueling physical and mental beating the race would offer. But nothing could have prepared them for the sudden, unrelenting, and raging storm that sent a 30-foot swell with a 50  knot wind gust that violently capsized their boat. \r\nThe boat was designed to right itself, but it did not. Now upside down, two men were trapped in the small sleeping cabins below the deck, and two were in the ocean. Struggling against time and the raging sea, everyone worked ferociously to get into the life raft. \r\nThe life raft was deployed but suffered a gash, and patch kits made of unusable materials did not help. The waves and the wind continued to pound the small life raft. There were 18 hours to rescueâ€”the maximum time the life raft could exist in the ocean. \r\nCommunication devices were lost, wet and on slowly fading batteries. Mayday, Mayday, Mayday got no response. Then some static. An atmospheric miracle got their signal to a giant freighter. Commanded by a first -time captain, the 590 ft long freighter skillfully maneuvered alongside the 5-foot life raft as their time was running out. \r\nInjured and exhausted, the team now had to climb a rope ladder three stories into a heaving ship. The waves and wind were fighting their efforts and as the last man took hold of the ladder, the life raft disappeared into an angry ocean. \r\nThis is their story. Four veterans who never gave up, who despite incredible odds, continued to hope, continued to support each other, and were rescued. They began this journey to encourage other veterans to share their stories in the hope of healing. Now they have the ultimate story to share.\r\n",
      "ProgramTitle": "DEFYING DEATH IN THE ATLANTIC",
      "SeriesIDNumber": "",
      "SeriesTitle": "",
      "Title": "DEFYING DEATH IN THE ATLANTIC",
      "WorkingTitle": "",
