      "ProgramSummary": "Over 6 million people are living with a type of dementia in the United States without a cure. Research for a cure is important, but what about those living with the disease now? Dementia and Living Well features diverse people across the country who are living well with a form of dementia. Experience how they navigate both their everyday lives and how they are change-makers in their communities. We explore a nationwide network of new paradigm organizations that partner with and support them. It's not easy but understanding that it is possible to live well living with a form of dementia is important for the millions of families and loved ones that are living with it every day.",
