      "ProgramSummary": "How do you go about shaping your own identity in this day and age when your surname is Goering, Goebbels or Himmler? What is daily life like when you have a historically tainted name? Where does the guilt come from that drives you to live among your parents' victims?\r\nA certain number of descendants of Nazi dignitaries now lives in Israel. Some have converted to Judaism and have espoused its precepts. They wear the kippa, have married Orthodox Jews and their children attend \"yeshivas\" - religious schools.\r\nThey were not born at the time of the Shoah and yet they bear the weight of their ancestry as though they felt guilty through hereditary. In Israel, this is referred to as \"Tikkun\", which means fixing/rectification.",
