      "ProgramSummary": "Design in Mind is a series of documentaries produced by the Institute of Classical Architecture %26 Art (ICAA) that provide a behind-the-scenes look into the work of acclaimed architects, designers, and artists.\r\n \r\nThe latest entry in the Design in Mind series is Bunny Williams - Not a House but a Home, which explores the life and work of renowned interior designer Bunny Williams. With her trademark warmth and geniality, Bunny leads viewers on a tour through many of her iconic spaces, from a classically inspired country estate that she designed for a client, to her Upper East Side apartment and her office in New York City, and finally to her lovingly renovated home and gardens in pastoral Connecticut. Featuring unprecedented access to one of America's most acclaimed designers, Bunny Williams - Not a House but a Home draws a vivid portrait of a wildly influential entrepreneur, offers her practical insights into creating beautiful interiors and gardens, and highlights the art and architecture that inspired her celebrated designs.\r\n",
