      "ProgramSummary": "Design in Mind: Unlocking the Mysteries of Place with Gil Schafer\r\n\r\nDesign in Mind is a series of documentaries produced by the Institute of Classical Architecture & Art (ICAA) that provide a behind-the-scenes look into the work of acclaimed architects, designers, and artists.\r\n \r\nThe latest entry in the Design in Mind series, Unlocking the Mysteries of Place with Gil Schafer, explores the life and work of the acclaimed architect Gil Schafer III. As one of the country's leading practitioners of contemporary classical design, his work has received multiple awards, and has been featured in Architectural Digest, Town & Country, Veranda, and The New York Times. \r\n\r\nIn this portrayal of a master at the height of his craft, Gil examines how he draws upon the power of memory to create extraordinary homes, and reflects on the spaces that have shaped his sensibilities as an architect. He leads viewers through three spaces that exemplify his work: his firmâ€™s renovated design studio in Manhattan, a Hudson Valley home inspired by English estates, and a summer house on the shores of Lake Champlain. Influenced by the elegance and charm of classical American architecture, and also adept at accommodating a modern lifestyle in his designs, he reveals his design process and the particular qualities that define an unforgettable place.\r\n",
      "ProgramTitle": "DESIGN IN MIND: UNLOCKING THE MYSTERIES OF PLACE WITH GIL SCHAFER",
