      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "The Devil's Instrument explores the history, lore, craft and haunting music of the Hardanger fiddle and the dances that accompany it as they are practiced in present day Norway.\r\n\r\nThe Devil's Instrument was the name given to the fiddle by religious leaders in the 19th century who thought there was no place in the church for such an instrument since it was used for weddings, dances and gatherings where alcohol and merriment ensued. The documentary interviews woodworkers who make the fiddle, the musicians who play it and the dancers who spin to it against the backdrop of the gorgeous Norwegian landscape.\r\n\r\nThe Hardanger fiddle is a traditional stringed instrument from Norway. It is similar to the violin, though it has eight strings (rather than four as on a standard violin) and thinner wood. Four of the strings are strung and played like a violin, while the rest, known as sympathetic strings, resonate as drone strings.  The instrument is often highly decorated with extensive mother of pearl inlay on the fingerboard and black ink decorations on the body of the instrument. \r\n\r\nThe Devil's Instrument is a new documentary by Pioneer PBS of Granite Falls, Minnesota. It is produced by Dana Conroy with videography by Ben Dempcy and Kristofor Gieske and edited by Kevin Russell.",
      "ProgramTitle": "DEVIL'S INSTRUMENT, THE",
