      "ProgramSummary": "Dining with the Chef introduces Americans to delicious Japanese dishes that can be made at home. Various techniques, as well as traditional ingredients used in Japanese cooking, are presented to illustrate the harmony of Japanese cuisine. The weekly series is hosted by Master Chef Tatsuo Saito who cooks alongside Yu Hayami, and Chef Rika Yukimasa. who cooks with Patrick Harlan. The series also features occasional guest chefs. \r\n\r\nChef Tatsuo Saito is a prominent chef, who was previously head chef at the Japanese embassies in Paris and Washington. He currently operates a cooking school in Tokyo and works in television. His co-host Yu Hayami is both a successful singer and actress. She is also a lover of good food and a wine enthusiast. \r\n\r\nChef Rika Yukimasa is the series cooking researcher and offers accessible alternatives for classic Japanese recipes. She has written books on various salty and savory recipes. Chef Rikas co-host, Patrick Harlan, was born in the US and is an actor, radio DJ and TV personality.  \r\n\r\nBoth Chef Tatsuo Saito and Chef Rika Yukimasa explain in-depth culinary techniques, fundamental ingredients and pairings, as well as arrangements to bring out sharp flavors. Not only does the series present authentic Japanese recipes, but it also offers alternatives for ingredients and tools that arent easily found in the U.S. Recent episodes have focused on regional cooking around Japan, authentic classic dishes, and the new Tokyo cuisine, among other topics. Recipes include mushroom tempura, ginger pork salad, Japanese porridge, pan-fried yakitori, meatball sukiyaki, and many more.\r\n",
