      "ProgramSummary": "\"The Dinner Salon\" is a weekly conversational television series presented on PBS that unites experts and thought leaders over dinner to discuss the topic of the episode. Together, they will share food and drink, while conversing about a pre-selected theme, filmed and edited for presentation format (but not context). Large topics and small talk alike will hold equal importance on the series, as the emphasis is on the ongoing conversations that showcase the human experience.\r\n\r\nA fusion of past and present, \"The Dinner Salon\" is a vibrant informational series that imbues the values of open, rigorous, intellectual discourse within the intimacy of the dinner setting. The salon setting provides an environment that distills the natural human impulse to share knowledge, information and experience. These multidisciplinary gatherings offer audiences exposure to new ideas within powerful conversations that consciously encourage and inspire a new Second Age of Enlightenment.",
