      "ProgramSummary": "Composed in 1723, Antonio Vivaldi's The Four Seasons is among the most recognized and beloved masterpieces of classical music.  \r\n\r\nWhile many recognize its familiar musical themes, few may know about the word imagery Vivaldi purposely fashioned into these four violin concertos. The entertaining and educational DISCOVER VIVALDI'S FOUR SEASONS helps the viewer fully experience these delightful details.  \r\n\r\nBefore a live audience at Drew University in Madison, New Jersey, conductor-host George Marriner Maull, violin soloist Peter Winograd and the members of The Discovery Orchestra reveal the descriptive sonnets Vivaldi wrote into the score. \r\n\r\nEach episode focuses on two of the seasons. \r\n\r\nPart One, \"Spring %2525252525252526 Summer,\" highlights musical depictions of birds singing, gently flowing streams, a barking dog, oppressive summer heat and powerful thunderstorms.\r\n\r\nPart Two, \"Autumn %2525252525252526 Winter,\" highlights musical depictions of a harvest celebration, a hunt, teeth chattering in the bitter cold and a fall on the ice.\r\n\r\nAfter an interactive exploration of each season's concerto, the orchestra performs the piece in its entirety, providing an opportunity for the audience to enjoy a very focused listening experience.\r\n\r\nIn addition, neuroscientist Dr. Jamshed Bharucha explains the connections between music and the brain. Musician and author Dr. David Rothenber also describes the influence of birdsong on our musical roo\r\n",
