      "ProgramSummary": "Episode 1 America, Land of The Free?\r\nEpisode 1 asks the question What is democracy?  The introduction includes a short history lesson of the birth of democracy and America's own unique democracy. The episode takes a look at some uniquely American challenges that limit American democracy such as hyper- partisanship, negative partisanship, institutional constraints such as gerrymandering, the Electoral College, voter registration, public apathy and cynicism, influence of money in politics, and the public's media consumption habits.\r\nThe interviews provide answers to many questions. Does it really matter if American democracy is getting weaker? What does it look like when democracy fails? How close are we to the end of democracy in this country? How can American democracy fail? What are some possible outcomes for the end of democracy in America? Is The Handmaid's Tale so far fetched?\r\n\r\nEpisode 2 Democracy Around the World:\r\n\r\nEpisode 2 takes the viewer around the world to explore other democracies. Each of our problems established in episode 1 is projected onto other country examples adding an interesting perspective to our own democratic successes and weaknesses.  The series continues to make the viewer think about America without explicitly calling that out. The host introduces Freedom House that measures the freedom of countries around the world. They estimate that democracy as an institution has been in recession for the past 20 years.The episode ends with where America ranks relative to the rest of the world. And how even in the US freedom has declined.\r\n\r\nEpisode 3 The Way Forward:\r\nEpisode 3 begins by dissecting a theory by Neil Howe that history shows periods of great civic catastrophe and reconstruction every 80 to 90 years since the Middle Ages. The host leads the viewer through  the basics needed for a democratic society to thrive such as  Freedom of speech, free and fair elections and a focus on human rights. How has media and social media in the U.S. affected  our democracy?  Does a 2 party system still work today?  Does the electoral college still work? How does a pandemic become a partisan issue?  What is the answer to strengthening our democracy?  Start early by teaching our children civics and promote more civic participation. The future of our democracy is in your hands.   Democracy is only as strong as our collective participation so let's do this!",
      "ProgramTitle": "",
      "SeriesIDNumber": "APTEXCH10571",
      "SeriesTitle": "DISMANTLING DEMOCRACY",
      "Title": "DISMANTLING DEMOCRACY",
