      "ProgramSummary": "American Public Television Exchange released our previous film, Divided We Fall: Unity Without Tragedy in May 2020, after 140 stations voted to select it for use.  In May of 2023 we extended APTâ€™s license to contract DWF for an additional two years.\r\n\r\nBuilding on the success of DWF we have created a new complimentary companion film that stations may want to broadcast in 2024.\r\n\r\nThe first film told the story of how two groups of a dozen strangers divided over then President Trump came to listen to each other with curiosity, see each otherâ€™s humanity and form bonds across our political divides.\r\n\r\nListening With Curiosity shows how those bonds have remained.  It centers the story on eight of the original cast members - equally divided red/blue - who came to Colorado for a live screening with an audience talk back on April 1, 2022.\r\n\r\nOur new film is perfectly timed to address the likely divisive mood in the country in 2024.   It shows it is possible for ordinary Americans to bridge divides in a manner that strengthens our democracy.    It explains we created an experiment  in 2018/19  to see if it was possible and succeeded.   Our new film shows the results - i.e. the bonds created and divides crossed - have remained.\r\n\r\nViewers will see for themselves and learn how our participants genuinely found trust in each other that allowed them to bridge their political divides.   To reinforce with the viewer the authenticity of this experience we include three experts in the field of conflict resolution discussing the hope they see in our experiment - Dr. Peter Coleman founder of the Global Conflict Center at Columbia University,  Dr. Samantha Moore Berg past Director of the Peace and Conflict NeuroCenter at U of Penn and Stephen Hawkins North American Director of More in Common.\r\n\r\nWe have two additional partners in creating this film.  Living Room Conversation which provided some of the funding and will, once released, work with PBS Member Stations and public libraries to use both films to create bridging conversations in their communities.\r\n\r\nThe second is the new Institute for Public Service at MSU Denver.   MSU Denver has the largest and most diverse student body in Colorado.  SIxty-five percent of their students are first generation college students.   Two Institute students - Josie Lavender and Greg Gonzales - who have been part of creating and broadcasting the Solution Studio at MSU Denver have worked with Tom Cosgrove to produce and edit this film.   The Institute is planning on organizing a Strengthening Democracy Week in Denver when RMPBS is able to premier it in late February.\r\n\r\nFinally, Rocky Mountain Public Media / RMPBS as part of our mission of â€œto create a Colorado where everyone is seen and heardâ€ is dedicating ourselves to the theme of strengthening our democracy 2024-- making Listening With Curiosity a perfect fit.\r\n\r\nThank you.\r\n\r\nDiane Cerafici and Brad Haug \r\nRocky Mountain Public Media\r\n\r\nTom Cosgrove\r\nNew Voice Strategies",
