      "ProgramSummary": "     In its continuing exploration of New Orleans' culinary traditions, WYES is producing a new 26-part cooking series showcasing Dooky Chase, the Treme restaurant and local landmark where Chef Leah Chase became known as the Queen of Creole Cuisine \r\n    The series is shot on location in the Dooky Chase kitchen with dishes prepared by younger generations of the Chase family who have led the restaurant since Leah's death in 2019. In themed episodes that trace the history of the restaurant and its founders, viewers will meet Leah's grandson, Edgar \"Dook\" Chase IV, who now oversees the restaurant's kitchen; her niece Cleo Robinson, who joined Leah in the kitchen in 1980; and the restaurant's newest chef, Leah's great-granddaughter Zoe Chase. Paired with some of the menus are specialty cocktails crafted by Leah's granddaughter Eve Marie Haydel, who has updated drink recipes from the restaurant's earlier days.\r\n     Some recipes will reflect Leah's early years in the small town of Madisonville, Louisiana, on the north shore of Lake Pontchartrain. Others will return to the humble beginnings of the Orleans Avenue restaurant her in-laws started as a po-boy sandwich shop in 1941, before Leah and her husband Edgar \"Dooky\" Chase Jr. developed it into one of the country's first fine-dining establishments for African Americans during segregation. \r\n     Each program in the series will explore a different chapter of the restaurant's history. On an episode about distinguished guests, the Chase chefs will share a recipe for Grits and Quail that Leah served at the restaurant in 2008 to President George W. Bush during a North America Leaders Summit. On another episode the restaurant's significant place in the history of the Civil Rights Movement will be celebrated with preparation of Creole Gumbo, a dish Leah served to Martin Luther King Jr. and other social activists when they held strategy sessions in an upstairs dining room. Today Dooky Chase remains a crossroads of culture and community, where gumbo is still a favorite of customers from all walks of life. To commemorate the important role Dooky Chase played in the national Civil Rights Movement in the 1950's and 1960's, an interpretive marker has been placed outside the restaurant honoring it as a stop on the Louisiana Civil Rights Trail. \r\n     The series will also demonstrate a new take on Creole classics being introduced at the restaurant. Dishes like Lamb Chops with Mint Glaze and Fish Cakes with Citrus Beurre Blanc reflect the professional training of Chef Dook, who has a diploma from the Cordon Bleu in Paris, and Chef Zoe, who is a graduate of the New Orleans Culinary and Hospitality Institute (NOCHI). \r\n     The new WYES series will share Leah's legend through interviews with her son Edgar Chase III, daughter Stella Chase Reese and other family members. Archival video and new footage shot during Mardi Gras, Holy Thursday, and other special occasions at the restaurant will link past and present. \r\n     Leah continues to inspire people through food that is now prepared by those who carry on her unwavering commitment to the people of New Orleans. Dook Chase speaks for the family when he says, \"My grandmother's motto that she lived by was pray, work and do for others.That was a seed planted into us and what we continue to live by.\"\r\n",
      "ProgramTitle": "DOOKY CHASE KITCHEN, THE: LEAH'S LEGACY",
