      "ProgramSummary": "Producers Doug Prose and Diane LaMacchia of Earth Images Foundation have created the first five half-hour episodes of a new geology series for a public television audience.  Hosted on camera by independent filmmaker-geologist Doug Prose, Doug's Geology Journal focuses on a science topic that is rare on PBS but has gotten high marks for audience appeal.  Host Doug Prose is a geologist by training; his solid footing internationally in the world of geology ensures that the program's content is up-to-date and scientifically accurate.  Doug is also an accessible personality with long experience in making films for broadcast on PBS.  His on-camera presence is informal, engaging, lighthearted and humorous.  In the series he appears on camera exploring the geologic terrain on foot or in a vehicle, hiking, climbing, running, squeezing between rocks, and even sitting in the pool of a hot spring, while sharing insights that make sense of complicated geologic stories.  His observations emphasize big-picture geologic processes that shape the landscape, fascinating but not well-known.  To illustrate important points he makes an occasional rough pencil sketch in his journal.",
