      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "The hit travel series DREAM OF ITALY returns for a highly anticipated third season as host Kathy McCabe explores Italy with her trademark mix of authentic experiences with a dash of celebrity star power including this season's special guests tenor Andrea Bocelli, Academy Award-winning actress Marisa Tomei and 3-Michelin star chef Massimo Bottura. Italy and the Italian lifestyle have captivated Americans and they simply can't get enough of both!\r\n\r\nSeason 3 starts with pure magic during an intimate visit to the seaside home of famed Italian tenor Andrea Bocelli in Tuscany. We learn how this mythical region has influenced not only Bocelli's life but his music, explore his deep faith and love of dogs and visit the places and people (family is everything to him) that made him who he is. Of course Bocelli performs for us...Welcome to Andrea Bocelli's Tuscany - a travel episode unlike any other!\r\n\r\nThe Black Madonna or Madonna Nera is especially revered in southern Italy where she has a divine and mysterious history. Black Madonna expert Alessandra Belloni and Academy Award-winning actress Marisa Tomei join us for this unique episode in the region that both Marisa's family and Kathy's family hail from. We even surprise Marisa with a visit to her ancestral hometown nearby. We attend two incredible celebrations for the Madonna complete with chanting, candles, fireworks, dancing and incredible acts of veneration. \r\n\r\nWhen we visited with 3-Michelin star chef Massimo Bottura in Modena, a town in the \"slow food, fast cars\" region of Emilia Romagna, we had no idea that we would have such adventures, it would become two very special episodes about the chef, who shot to fame on Netflix's \"Chef's Table\" and the unusual culinary empire he has built from the land of balsamic and Parmigiano Reggiano. He's also taken his cues from another Modena maestro, Luciano Pavarotti, in the way he fashions a menu after an opera. These two episodes are can't miss for foodies! \r\n\r\n\r\nDREAM OF ITALY loves to bring viewers to incredible places that pack the power of surprise. Did you know that there's a 1,000-room palace in southern Italy that rivals Versailles? As we travel to Caserta to visit this very special Reggia (it even made an appearance in Star Wars) we also discover the province of Caserta just might be home to the world's best pizza made by one of the world's up and coming chefs Franco Pepe. \r\n\r\nAs Americans expand their horizons for more adventurous lives and retirements abroad, we return to one of our favorite regions - Abruzzo - filled with both mountains and coastlines and meet four Americans who have taken advantage of very affordable real estate and health care and moved here. We also visit a town selling those famous 1-euro homes to see what the hype is about. \r\n\r\nThis third season of DREAM OF ITALY has something for everyone who loves Italy!",
      "ProgramTitle": "DREAM OF ITALY SEASON 3",
