      "ProgramSummary": "Description: Ella Fitzgerald is regarded by many as the greatest jazz singer of all time and was one of the dominant figures in the genre throughout the second half of the twentieth century. 1969 saw her debut appearance at the Montreux Jazz Festival, a stage she was to grace many more times. Backed by the Tommy Flanagan Trio she delivers a set that combines contemporary tracks such as Sunshine Of Your Love and Hey Jude with classics like I Won’t Dance and That Old Black Magic. Whatever the material, this concert proves that Ella could always swing.\r\nTracklisting:\r\n1. Give Me The Simple Life\r\n2. This Girl's In Love With You\r\n3. I Won't Dance\r\n4. A Place For Lovers\r\n5. That Old Black Magic\r\n6. Useless Landscape\r\n7. I Love You Madly\r\n8. Trouble Is A Man\r\n9. A Man And A Woman\r\n10. Sunshine Of Your Love\r\n11. Well Alright Okay You Win\r\n12. Hey Jude\r\n13. Scat Medley\r\n14. A House Is Not A Home\r\n",
      "ProgramTitle": "ELLA FITZGERALD LIVE IN MONTREUX 1969",
