      "ProgramSummary": "Elmore Leonard has influenced more writers in America than any author since Ernest Hemingway (Leonard's mentor). Leonard's America is as real as Twain's Hannibal, Faulkner's Mississippi, Steinbeck's Monterey. From his westerns and early novels of crime based in Detroit and South Florida, right through his complex and virtually plotless later work, Elmore Leonard dissected an America whose founding sins have continued to haunt it all the days.\r\n\r\nAuthor of more than 40 novels, Leonard was especially known for his crackling dialogue and dark humor. Many of his writings were adapted for film and tv, including Get Shorty, Out of Sight, Jackie Brown, and 3:10 to Yuma. The Hollywood Reporter ranked him No. 2 on their list of \"Hollywood's 25 Most Powerful Authors\" in 2012, behind Stephen King (who once called Leonard \"the great American writer\"). He was a top-selling writer from the 1980s through his death in 2013.  \r\nfrom the 1980s through his death in 2013\r\nNot simply one of the finest crime novelists of the past half-century, Elmore Leonard is one of the finest novelists of the era.  ELMORE LEONARD: BUT DON'T TRY TO WRITE explores why -- tracing Leonard's career, writing process and his influence. The documentary features exclusive images with previously unseen home movie footage, family photographs and in-depth interviews with literary experts and those who knew him well, including colleagues, family, and childhood friends.\r\n",
      "ProgramTitle": "ELMORE LEONARD: \"But don't try to write\"",
