      "ProgramSummary": "Narrated by CBS' Jim Nantz and with actor Kyle Chandler (Friday Night Lights, Bloodline, Zero Dark Thirty, Argo). In the late-1950's the USS Arizona Memorial Commission was struggling to raise money for a memorial that should have been fully funded by now. After all, 1,1777 crewmen died on December 7, 1941, on the battleship, over 900 of them still entombed aboard her today. It was the 1950's and perhaps most Americans just wanted to put World War II behind them, but still, the USS Arizona needed more than just a plaque attached to her rusting hull to memorialize all those who saw their lives abruptly ended on that Sunday morning at Pearl Harbor. A day of infamy that launched the United States into World War II.",
