      "ProgramSummary": "This beautiful film showcases Scottish singer-songwriter Emeli Sandé’s incredible voice in front of a captivated crowd at London’s iconic Royal Albert Hall. The multi-camera live concert spectacular, directed by Paul Dugdale - whose previous work include Coldplay Live 2012 and The Prodigy’s World on Fire - includes guest performances from Labrinth and Professor Green as well as the stunning tracks Next To Me, My Kind of Love and Heaven.   (DVD product description).  The set features the headline concert filmed at London's Royal Albert Hall on 11 November 2012. \r\nThe set includes Sandé's hits and songs from her number-one selling debut album \"Our Version of Events.\" The set also includes a cover from one of Emeli Sandé's idols Nina Simone,. Professor Green made a brief entrance during \"Read All About It (Pt. iii)\" and Labrinth and Sandé performed \"Beneath Your Beautiful\" during the encore.[1]",
