      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "He is known as \"America's storyteller.\" Famed WWII correspondent, and Hoosier, Ernie Pyle remains one of the most accomplished and beloved journalists in American history.\r\n\r\nErnie Pyle: Life in the Trenches is a 90-minute WTIU documentary that tells the story of the Pulitzer Prize-winning columnist who reached millions each week with stories about ordinary Americans doing extraordinary things.\r\n\r\nPyle is best remembered for his firsthand reports from the foxholes alongside American troops during World War II. He is also celebrated for his writings as he traveled across the US during the lean years of the Great Depression, revealing the trials and triumphs of hundreds of common Americans. This documentary chronicles not only the bloody battles in Europe and Japan, but also the internal battles Pyle constantly faced with heavy drinking, depression, and a troubled marriage.\r\n\r\nErnie Pyle: Life in the Trenches reveals that through two of the darkest chapters in America's history, the voice of Ernie Pyle became the voice of the American people--a voice of promise, grit, and determination.\r\n\r\nThe program is narrated by Emmy award-winning journalist and former CBS News anchor Dan Rather. \r\nActor Jonathan Banks--from TV series Breaking Bad and Better Call Saul--gives voice to Ernie Pyle and his most acclaimed writings and personal correspondence to his closest friends and family. \r\nThe film also includes notable interviews with the late Walter Cronkite and Andy Rooney, as well as a number of World War II veterans, contemporary journalists, and historians.\r\n",
      "ProgramTitle": "ERNIE PYLE: LIFE IN THE TRENCHES",
