      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "Have you ever wondered why some people connect so easily with classical music, while statistically as much as 95 percent of the U.S. population has trouble \"getting into it\"? The music series FALL IN LOVE WITH MUSIC is a fun exploration of the listening process.\r\n\r\nDeveloped over years of classroom and lecture interaction, this series offers streamlined, effective pathways to musical understanding based on the education strategies of Dr. Saul Feinberg, a pioneer and recognized authority in the teaching of music listening skills. Conceived and presented by George Marriner Maull, artistic director of The Discovery Orchestra, the eight-part series explores the following topics: hearing versus listening; the open mind; why aren't we listening?; the elements of music; thinking and feeling like a composer; grasping musical \"paragraphs\"; and learning to listen flexibly.\r\n\r\nThe series invites viewers to solve very specific musical \"problems\" such as: How many times does this theme occur? Can you tell when the pitches descend? How many melodies are occurring simultaneously? Composers featured in the episodes include: J.S. Bach, Bartok, Beethoven, Handel, Mendelssohn, Monk, Mozart, Rachmaninoff and Schuman in both pre-recorded excerpts and \"live\" musical examples. Sharing the stage with Maestro Maull in the \"live\" musical segments are the Amphion String Quartet and the Dan Crisci Jazz Quartet.\r\n\r\nThe listening skills acquired through FALL IN LOVE WITH MUSIC will help viewers understand, enjoy and better connect with all of the music in their lives\r\n",
