      "ProgramSummary": "Travel Expert and Host Colleen Kelly returns for the eighth season of her successful travel series, highlighting unique destinations, and showcasing each location’s entertaining and educational activities for parents, grandparents and children of all ages. \r\nIn Season 8, Colleen discovers what there is to experience beyond the sunny and sandy destinations of Galveston Island, Texas and Greater Fort Lauderdale, Florida. In Galveston Island, Colleen gets adventurous by riding rollercoasters at the Historic Pleasure Pier and taking a helicopter ride for a bird’s eye view of the city. She also learns about the history of Juneteenth on a downtown tour of historical landmarks, and visits educational spots like the Historic Seaport Museum. In the Greater Fort Lauderdale area, Colleen explores downtown Fort Lauderdale by segway, heads out to Pompano Beach for fishing and water fun, and visits Dania Beach for family-friendly art museums and recreation. Of course, when in South Florida, you’ve also got to experience the Everglades! Finally, a Best of the Beach episode takes viewers on a journey through some of the most memorable waterside moments in past seasons of Family Travel.",
