      "ProgramSummary": "\"Fat Boy: The Billy Stewart Story\", a documentary which tells of the life and career of one of the most popular Rhythm and Blues singers of the 1960s. The documentary is produced and directed by Emmy Award winning documentary filmmaker Beverly Lindsay-Johnson through her company Kendall Productions LLC, under the fiscal sponsorship of the African American Music Association (AAMA) of Washington, DC. \r\n\"Fat Boy: The Billy Stewart Story\" examines the journey of this incredible singer from his days as a young piano player to a famous Rhythm and Blues balladeer of the 1960s. He battled being overweight reaching at times 300 pounds. His passion for singing in his early years made him a Washington DC legend as he sang in many DC area nightclubs from U Street to the local favorite Shelter Room in Northeast Washington, DC. Stewart was known to break out singing on the sidewalks of DC. He was a favorite at the Howard Theater in DC, The Apollo Theater in New York and other concert theaters along the \"Chittlin' Circuit\". Many of his songs spoke of sadness and the desire of meeting a \"girl to love\", but he aimed to please his fans and his fans loved him. He also wrote a song entitled \"Fat Boy\" where he spoke of living the good life despite his weight and health issues. It is also said that he could be cantankerous at times. A story has it that he and Rhythm and Blues legend, Wilson Pickett, were having an argument and they both pulled guns on each other. \r\nBilly Stewart tragically died when on January 17, 1970 his car plunged into the Neuse River in Smithfield, North Carolina. He and his band were in route to a performance in Columbia, South Carolina. Stewart and 3 of his band members riding in his car were killed as the car sank into the river. The remaining band members were driving in a separate car which was not included in the accident. The coroner's report and recollections by residents give details at the tragic scene. \r\nBilly Stewart's musical legacy lives on through renditions of his music performed by contemporary artists. \r\nNarrated by former radio and television announcer Charlie Neal, the story of Billy Stewart, his career and personal life will be told with interviews by family, friends and musicians in Washington, DC who knew him best such as pianist and former Chess recording artist Curtis Prince, Herb Fame of the legendary singing duo Peaches and Herb, and Ronald \"Poozie\" Miles of the Rainbows who puts to rest the stories as to whether Billy Stewart sat in regularly with The Rainbows, and his cousin Grace Ruffin of The Jewels. Also, interviews with author and musical historian Robert Pruter \"Chicago Soul\", who provides historical background of Stewart's time as a recording artist for the historic Chess record label. A special interview with former Chess recording artist Sugar Pie DeSanto who co-wrote one of Billy Stewart's popular tunes \"Love Me\". Interviews with former legendary Chess recording label musicians and songwriters Willie Henderson and Raynard Miner, and Chess label mate Mitty Collier (\"I Had A Talk With My Man Last Night\"). The Collier, Henderson and Miner interview took place in the former Chess Records building in Chicago, now the Willie Dixon Blues Heaven Foundation. Emanuel Raheim LeBlanc, lead singer and founder of the 1970s Rhythm and Blues band, GQ, covered Billy Stewart's \"I Do Love You\" and \"Sitting In The Park\" and had major hits with these songs tells of the influence of Billy Stewart's music on GQ. \r\nA special interview with \"Little Anthony\" of Doo-Wop legends Little Anthony and The Imperials tells of the 30-day cross-country concert tour he and Billy Stewart performed on the Dick Clark Caravan of Stars in the 1960s. \r\n\r\nArchival photographs and films provide the visuals that tell the story of this unusual singer. Special \"never before seen\" clips of 8mm films of Billy Stewart with his family, performing in various night clubs and the funeral service for Billy Stewart will be included in \"Fat Boy: The Billy Stewart Story\". \r\nA special closing segment titled \"Keeping the Legacy of Billy Stewart\" describes the influence Billy Stewart and his music of the 1960s has on contemporary artists of Rhythm and Blues, Hip Hop and Go-Go music. Interviews include Dane Riley (cousin of Billy Stewart), Jas Funk (Go-Go music performer and Entertainer), Paul Benavidez (Latin singer and musician), Trish Toledo (named the \"Latina Soul Diva\"), and Alex Stassi of England. \r\nMajor funding is provided by HumanitiesDC with additional funding provided by private donations.  \r\n\r\n",
      "ProgramTitle": "FAT BOY: THE BILLY STEWART STORY",
