      "ProgramSummary": "FILMS BY KIDS, a collaboration between THIRTEEN/WNET and the non-profit organization, BYkids, \r\npairs accomplished filmmakers with teenagers from around the world to create short personal documentaries that educate and encourage understanding about universal issues. Season three includes four films: \"Faith's World\" explores the challenges of living with a disability in the US; \"L'Chaim\" shines a light on resurgent Jewish life amid rising anti-Semitism in Berlin, German; \"Against the Current\" illuminates mental health issues on a Native American reservation; and \"Awake in the Dream\" explores preserving cultural tradition in the face of globalization.\r\n",
