      "ProgramStatus": "Contract",
      "ProgramSummary": "Youth from diverse cultures document their experience dealing with war and displacement, mental health issues, climate change, and sustainable farming in the new season of Films BYkids.  A collaboration between THIRTEEN and the non-profit organization, BYkids, Films BYkids pairs accomplished filmmakers with teens and young adults from around the world to create compact and compelling personal documentaries. These film shorts educate and encourage understanding about universal issues through the lens of intimate, firsthand storytelling. Each documentary addresses global issues that significantly affect the life experiences of countless people, as well as explores actionable solutions to those obstacles. \r\nIn season four: \r\n-Tymur Tsapliienko, 16, a Ukrainian refugee who longs to return to his country, shines light on the effects of war and displacement\r\n-Helena Marschall, 20, a climate activist, shares how she and her friends lead Germany's environmental youth movement.\r\n-Keith Griffith, 16, addresses how beekeeping helps him cope with mental health issues and build community connections in Kentucky.\r\n-Diya Payal,14, shines light on sustainable farming practices in India, preservation of seed biodiversity, and the ways in which climate change and industrial agriculture threaten plant species.  \r\n\r\n",
