      "ProgramSummary": "Finding Fellowship %0D\r\nA  film about belonging and building community in a divided world.%0D\r\n\"We haven't been this divided since 1968.\"  This paralyzing refrain has been uttered over and over, louder and louder, in response to the current political and social tumult, almost to suggest that we are only spectators with no role to play or stake in the outcome.  We were compelled to tell a story from 1968 - a time when the country was indisputably divided - to demonstrate our capacity, even in dark times, to come together.%0D\r\nBased in the historic community of Quince Orchard, Maryland, Finding Fellowship captures how the seeds for potential reconciliation were planted in the same fields where slave masters once terrorized.  Three racially-segregated churches, born out of the Civil War, each had fallen on hard financial times.  The Black church gathered one evening to discuss its uncertain future.  As members debated the consequences of merging with the two local white congregations, the minister interrupted to announce that Martin Luther King, Jr. had just been murdered in Memphis, TN.  April 4, 1968.%0D\r\nDespite King's assassination, though others argue because of it, those three churches voted to merge their congregations into one.  In September 1968 each had its last racially segregated service.  %0D\r\nThe reality is not every member stayed.  Each church lost members.  And the hardest decision wasn't to come together but to stay together.  Yet, because of their efforts, in September of 2018, Fairhaven United Methodist Church celebrated its 50th year of purposeful integration.%0D\r\n\"Buildings didn't merge.  People did.  The descendants of former slaves and former slave owners.\"%0D\r\nFinding Fellowship is a story of the possible that reminds us that a diverse people purposefully coming together - hand in hand and heart to heart - is one of the most powerful forces this world has ever known and that the capacity to come together has always been, and will always be, ours.%0D\r\n %0D\r\nDOERS DO.%0D\r\nIn 2013, brother and sister team Jason Green and Kisha (Green) Davis decided to spend time with their ailing 95-year-old grandmother. From her hospital room, she shared stories of her hometown - Quince Orchard, Maryland - and the people who built and sustained the community through the years. %0D\r\nLike many communities across the country, Quince Orchard endured significant change - a transition from rural to suburban, significant demographic and population shifts, and even a name change to reflect its new affluence. Finding Fellowship explores the uniquely American story of how the members of this once rural, once racially segregated community intentionally put their differences aside to come together amidst one America's most turbulent moments. %0D\r\nIn the wake of George Floyd, as the country, again, explores our depths of division, this film shares how one community came together in the wake of Martin Luther King Jr.'s assassination, and offers an example of how communities can lean on their shared heritage to progress.  Finding Fellowship reminds us that we each have the ability and responsibility to shape our communities. %0D\r\nMore than a place on a map, Quince Orchard is a spirit and the film dives into what makes a community thrive through its people, heritage, and history. And how that history must be actively preserved.%0D\r\nIt started with a schoolhouse.  Filmmaker Jason Green was surprised to learn that his great, great grandfather, just three years after the end of slavery, helped build a school on the main road for the education of \"colored children.\"  He asked his grandmother whether there was a safer way to educate in 1868. She replied that the colored children of the community needed a school, and those community members looked around and saw that need and acted because they were doers and doers do. %0D\r\nIn 1968, on the heels of MLK's assassination, three poor, rural, segregated Methodist churches - two white and one black church - again adopted this spirit of doers do to merge together in fellowship. %0D\r\nFinding Fellowship, with a few surprises along the way, explores the unlikely church merger, how the community has maintained over the last 50 years, and dips into the past to offer a glimpse of the future. %0D\r\nTHE FILMMAKERS.%0D\r\nJASON GREEN, DIRECTOR %25252526 CO-PRODUCER%0D\r\nJason Green, Director and Co-Producer, is an attorney, entrepreneur, and public speaker who empowers individuals and communities. Green currently serves as the SVP %25252526 GC of SkillSmart, a company that empowers employers and job seekers to maximize their potential . Previously, Green served as Associate White House Counsel to President Barack Obama and National Voter Registration Director on the 2008 Obama for America campaign. %0D\r\n%0D\r\nKISHA DAVIS, CO-PRODUCER%0D\r\nDr. Davis is a passionate primary care provider with special interests in chronic disease management including diabetes, HIV/AIDS, as well as women's health and geriatrics. She currently serves as medical director of Casey Health Institute, an integrative primary care center in Gaithersburg, MD.  Previously, Davis was a White House Fellow serving the Obama Administration at the United States Department of Agriculture.%0D\r\n%0D\r\nIMANI CHEERS, CREATIVE DIRECTOR%0D\r\nDr. Cheers is an award-winning multimedia producer and Assistant Professor in the School of Media and Public Affairs at The George Washington University in Washington, D.C. Before joining the faculty at GWU, Cheers was director of educational resources for PBS NewsHour, a producer/writer at Howard University Television and a multimedia producer at Newsweek.%0D\r\n",
