      "ProgramSummary": "Many think they know the story of First Avenue from Prince's movie, \"Purple Rain,\" but the club has\r\na long and colorful past with many having toiled backstage to keep this landmark standing. \"First\r\nAvenue: Closer to the Stars\" dives deep into the true story of the legendary Minneapolis nightclub.\r\nFrom the days of Woodstock, through disco, punk and hip-hop this \"pirate ship that goes nowhere\"\r\nhas weathered the storm - just barely.\r\n\"When I was too young to go see my favorite bands at a bar, I would sneak into First Avenue and I\r\nwould see Steve McClellan, the czar of Minneapolis music,\" said David Roth, co-producer of the\r\ndocumentary. \"I have always felt indebted to this place for exposing us to culture, and while it took\r\nthousands of people to keep the club open, it has always felt like it's Steve's story.\"\r\nNarrated by Minneapolis' hip-hop artist and part of Doomtree, Stefon Alexander (also known as\r\nP.O.S), the documentary will premiere on Monday, March 30 at 9:00 P.M. (CT) on TPT2. The\r\ndocumentary features testimony from:\r\nDave Pirner - Soul Asylum\r\nTommy Stinson - The Replacements\r\nLori Barbero - Babes in Toyland\r\nCraig Finn - The Hold Steady\r\nSean \"Slug\" Daley - Atmosphere \r\nSteve McClellan - Former Manager of First Avenue\r\nAllan Fingerhut - Founder of First Avenue\r\nKevin Cole - First Avenue DJ",
