      "ProgramSummary": "Your World of Fabrics%E2%80%A6.from Draperies to Space Suits\r\n\r\n -- Series 10 of Fit 2 Stitch has two objectives. The initial objective is to bring awareness of the multitude of fabrics that are manufactured around the world, and secondly to teach us how to \"weave\" these fabrics into our personal lives and tastes. The selection of fabrics is a very personal vision based on our lifestyle and environment and therefore it is crucial to have an educated understanding to match our persona. Series 10 will include a wide range of fabrics from Mardi Gras attire to actual space suits worn by our astronauts. We will help you learn how to utilize a wide array of fabrics into your daily routines, and will include the proper procedure of cleaning those fabrics. \r\n",
