      "ProgramStatus": "Contract",
      "ProgramSummary": "The Five Demands is a riveting story about the student strike that changed the face of higher education. In April 1969, a small group of Black and Puerto Rican students shut down the City College of New York, an elite public university located in the heart of Harlem. \r\n\r\nAlthough the late 1960s are known as an era of student activism, this momentous event has been overlooked and forgotten. Far more attention has been paid to white middle-class students in opposition to the Vietnam War, yet this protest had the greater impact: the CCNY strikers were the vanguard of a national Black student movement that transformed the culture, the mission, and the curriculum of American higher education. CCNYs strike was homegrown in Harlem, the most famous Black neighborhood in America.  The Harlem community rallied around the students and for many it was the first time they ever stepped foot on the stunning neo-Gothic campus on a hill overlooking their neighborhood. National television news covered the strike, but within a few years this heroic struggle for educational equity was swept under the proverbial rug. \r\n\r\nFueled by the revolutionary fervor sweeping the nation, the strike turned into an uprising, leading to the extended occupation of the campus, classes being canceled, students being arrested, and the resignation of the college president. Told through the point of view of the participants, the film follows the students struggle against the institutional racism that, for over a century, had shut out people of color from this and other public universities. The Five Demands proves that a handful of ordinary citizens can band together to take action and effect meaningful change.\r\n\r\nThe Five Demands is co-produced and co-directed by internationally-acclaimed documentary filmmaker Greta Schiller and Emmy Award-winning documentary filmmaker and author Andrea Weiss, both co-founders of Jezebel Pictures, and executive produced by Stanley Nelson of Firelight Films.   Greta Schillers past work includes the international favorites Before Stonewall (1984 Emmy Award, 2019 National Film Registry);  International Sweethearts of Rhythm (PBS, 1986 Best Doc, Philadelphia Film Festival);  Paris Was a Woman (1995 Audience Award Winner, Berlinale); and The Man Who Drove with Mandela (PBS, 1998 Best Documentary at Berlinale).  Andrea Weiss credits include Bones of Contention, a feature documentary delving into the historical memory movement in Spain and the unknown story of LGBT repression under the Franco dictatorship; Escape to Life: The Erika and Klaus Mann Story; Seed of Sarah; Paris Was a Woman; Before Stonewall; A Bit of Scarlet;  and International Sweethearts of Rhythm, among others.  Stanley Nelson is among the premier documentary filmmakers working today. His body of work has garnered every major award in the industry. He is a MacArthur Genius Fellow, was awarded an individual Peabody Award, the 2016 Lifetime Achievement Award from the National Academy of Television Arts Sciences, and received the National Medal in the Humanities from President Barack Obama.  His credits include the PBS films Harriet Tubman: Voices of Freedom; Becoming Frederick Douglass; Miles Davis: Birth of the Cool; Tell Them We Are Rising: The Story of Black Colleges and Universities; and The Black Panthers: Vanguard of the Revolution.\r\n",
      "ProgramTitle": "FIVE DEMANDS, THE",
