      "ProgramSummary": "For centuries, thousands of people converge on Seville every Easter week.    They celebrate faith, family and friends with those they love.  Processions of the Virgin Mary crisscross the streets at all hours,   orange blossoms perfume the air, delicious  tapas and wine are savored in street side cafes and Flamenco dancers dazzle the thousands of visitors that swell this ancient  city.  \r\n\r\nFlamenco: Spirit of Seville is a one-hour public television pledge special that  takes public television viewers into the heart of Seville by bring some of the world’s best Flamenco dancers to their screens while getting to know one of the world’s most fascinating and historical locations.   Teatro Flamenco Sevilla and Teatro Triana, the two most established flamenco theatre companies in Seville, put on their best shows featuring the most celebrated flamenco dancers and performers in Spain while our public television hosts take us behind the scenes and into the streets of this unique festival.  \r\n\r\nOur public television hosts will also introduce our viewers to behind the scenes look at the lives and celebrations of Seville, taking us shopping for flamenco dresses, visiting amazing palaces and gardens half a millennium old and connecting with the lives of modern day Sevillians.  \r\n\r\nFlamenco:  Spirit of Seville is an exciting celebration of music, faith, tradition and family.  \r\n\r\nThis public television special is a co-production of International Media and Peacetime Entertainment and a national presentation of WLRN Public Media.  \r\n\r\nInternational Media is the producer of many PBS specials including programs featuring Andre Reiu, David Foster, The Tenors, Celtic Woman, The Osmonds, Yanni and The Gipsy Kings.\r\nPeacetime Entertainment has received multiple Emmy Awards for its excellence in documentary production and cinematography.  \r\n\r\nTeatro Flamenco Sevilla will tour the United States in 2024.   Tickets, a home video version of the whole performance and other pledge premiums will be available for stations.  \r\n",
