      "ProgramService": "Exchange",
      "ProgramStatus": "Offer",
      "ProgramSummary": "SYNOPSIS: \r\n\r\nWhy is Robert A. “Bob” Hoover’s airplane, Sweetie Face, in the Smithsonian Air and Space Museum, but the general public has never heard of him?  Why is he number three on the list of the Smithsonian’s 100 greatest aviators of all time? \r\n\r\nBob dreamed of being a WWII fighter pilot but was too tall, with poor eyesight and an acute case of air sickness. With determination and outside the box thinking, he overcame these barriers to accomplish his goal of becoming a fighter pilot in WWII.  Shot down by the Germans and captured, Bob was sent to Stalag Luft I where he eventually escaped, stole an enemy aircraft, and flew himself to freedom in Holland. Upon returning to the states, he was assigned to the most secret development programs the United States was engaged in at the time — in the “The Right Stuff” days where programs lost an inordinate number of pilots in mishaps and accidents.\r\n\r\nBob went on to become an accomplished experimental test pilot, participant in breaking the speed of sound and launching the world into the Jet Age. \r\n\r\nBob’s influence over generations of aviators includes Harrison Ford, Dick and Burt Rutan, Carroll Shelby, Neil Armstrong, General Bud Day, and world premiere air show pilot Sean D. Tucker, who gather to discuss and celebrate this humble legend.\r\n\r\nIn his later career as an air show performer Bob became known for shutting his engines off and “feathering” his propellers then performing a graceful pattern of loops and rolls, a routine never before or since replicated.  Hoover performed in front of more people, in more countries, in more different aircraft, than any individual before or since.  \r\n\r\nFlying the Feathered Edge preserves the stories, the friendships, and the legacy that surrounds a beloved pilot who quietly touched the trajectory of aviation’s many developments. \r\n",
      "ProgramTitle": "FLYING THE FEATHERED EDGE: THE BOB HOOVER PROJECT",
