      "ProgramSummary": "Join us for a journey into the heart and soul of American folk music with the inaugural TV special of the Folk Americana Roots Hall of Fame. Recorded amidst the historic streets of Boston at the Boch Center, this documentary captures the essence of a genre deeply rooted in tradition yet constantly evolving.\r\n\r\nStep into the intimate setting of this first annual celebration, where icons and legends of folk music gather to share their stories and melodies. At the forefront are luminaries such as Joan Baez, Emmylou Harris, Noel Stookey and Peter Yarrow from Peter, Paul and Mary, Tom Rush, Livingston Taylor, and many more. \r\n\r\nThrough exclusive interviews and captivating performances, viewers are treated to a behind-the-scenes glimpse into this first-ever event honoring these folk legends. They reflect on the significance of folk music as a vehicle for social change and a keeper of traditions.\r\n\r\nJoin us as we welcome the first class of inductees into the Folk Americana Roots Hall of Fame recorded in the majestic Boch Center in downtown Boston.",
