      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "Filmed Stage Hit GROUCHO Stars NYC Theatre World Award Winner %2526 London Laurence Olivier Nominee Frank Ferrante  \r\n\r\n\"In the divisive times we live in today, there is one commonality we all share: the need to laugh. And there is plenty and more in Ferrante's 'Groucho,' the one-man show about one of the funniest comedians of the 20th century.\" - The New York Times, March, 2017 \r\n\r\nDubbed \"nothing short of masterful\" by the Chicago Tribune, Frank Ferrante's GROUCHO is a laughter filled, theatrical portrait of \"America's most gifted funnyman\" (The New York Times). Written and performed by Ferrante, the filmed play with music celebrates the style and spirit of comedian Groucho Marx (1890-1977) whose irreverent humor continues to influence artists. Born the middle son of Jewish immigrants, Groucho never made it past sixth grade yet for 70 years he exhilarated audiences in every entertainment form.  GROUCHO invites viewers to revel in the legend's prime seen here on full display - complete with greasepaint, keen wit and unbridled comic physicality. The program is equal parts improvisation, story telling, song and stand-up comedy with Ferrante's 'Groucho' liberally ad-libbing throughout. \r\n\r\nPerformed for 35 years over 3,000 times in more than 500 cities, Ferrante's 'Groucho' played New York Off-Broadway, London's West End, Los Angeles and two Australian tours. For the role, Ferrante earned the New York Theatre World Award and a London Laurence Olivier Award nomination for 'Comedy Performance of the Year.' \r\n\r\nDirected for the stage and screen by Dreya Weber. Filmed at two-time Tony Award-winning Cincinnati Playhouse. Running time: 1:26:46\r\n",
