      "ProgramService": "Premium",
      "ProgramStatus": "Contract",
      "ProgramSummary": "On April 20th 1992, Roger Taylor, Brian May and John Deacon - the surviving members of Queen - took the stage of London's legendary Wembley Stadium to announce the start of one of the biggest events in rock history: a tribute to the incomparable Freddie\r\nMercury with a glittering array of guest vocalists and players, featuring Elton John, Robert Plant, Axl Rose, David Bowie, George Michael and many more.\r\nThe atmosphere of emotion, mixed joy and sadness, shared by the stadium audience, worldwide television viewers, and performers alike, was an experience that will never be forgotten. The aim of the concert was to celebrate Freddie's life and work, but also to increase public\r\nawareness of the awful disease which prematurely ended his life. All the guest artists offered their participation for free. The concert was broadcast live on television and radio in 76 countries, from the USA to Russia. The 72,000 people who were fortunate enough to see the\r\nconcert live did so in glorious Spring weather in front of a stage 370ft wide and 90 ft deep.",
      "ProgramTitle": "FREDDIE MERCURY: THE TRIBUTE CONCERT",
      "SeriesIDNumber": "",
