      "ProgramSummary": "From Wall Street to Bay Street is a one-hour documentary that examines and compares the financial and banking systems of the United States and Canada. The basis for both financial systems was laid by the revolutionary founding father - Alexander Hamilton. In a sense he was the %E2%80%98father' of banking in both countries.  Canada built its banking system on the Hamiltonian model and never departed from its Hamiltonian roots. The United States, however, turned its back on Hamilton's financial system in the 1830s when President Andrew Jackson destroyed the Second Bank of the US. The documentary traces the history of both systems from inception to the current day and through the many crises that occurred.  From Wall Street to Bay Street interviews an impressive list of experts that includes a former Prime Minister, Bank CEO's, Academics and other business leaders.  The documentary provides excellent perspectives on the volatility we have experienced in recent years which may help us avoid the next financial panic. \r\n",
      "ProgramTitle": "FROM WALL STREET TO BAY STREET",
      "SeriesIDNumber": "",
      "SeriesTitle": "",
      "Title": "FROM WALL STREET TO BAY STREET",
