      "ProgramSummary": "GardenFit is returning for another season of bringing gardening and fitness together with the goal of helping everyday gardeners learn how to take care of their body while taking care of their garden. In Season One we featured a diverse group of guest gardeners for whom gardening was their principal passion...or even their profession; for Season Two, we're going to visit artists who are well known in other fields but also passionate gardeners: painters, sculptors, musicians, and culinary pioneers, along with floral, interior, and jewelry designers, whose art has been inspired by nature and whose gardens reflect their artistic visions.\r\n\r\nGardenFit teaches a way to garden with awareness of how your body works that debunks the accepted notion that aches and pains are inevitable. The series enables gardeners to address any physical challenges and continue to pursue their passion for the rest of their lives.\r\n\r\nMadeline Hooper, GardenFit Creator, Executive Producer and Host is joined by fitness trainer Adam Schersten. GardenFit spotlights a different guest gardener in every episode, sharing distinctive gardening insights and tips during tours of their gardens. Schersten works with the guests to help identify their specific physical problems and the causes and shows simple body tune-ups they can apply while gardening to alleviate their aches and pains, allowing them to enjoy gardening every day. Each episode ends with the guests having a special celebration with Madeline and Adam and sharing their artistic work. Filmed in a captivating cinematic style, complemented by dramatic aerial footage, the series shows off each gardener's personal environment in a variety of regional locations across America. ",
