      "ProgramSummary": "The Sex of Science will be shot in approximately 30 cities on six continents and will address three principal topics:\r\nIs Science Androcentric?\r\nexplores how and why science is predisposed toward males and why it is crucial to change that trend.\r\nWhere Are All the Girls and Women in Science?\r\nfollows the life of an hypothetical young girl, from birth to late-career in STEM, using real surrogates from around the world to represent her trajectory through pre-school, elementary school, high school, university, early career and onwards.\r\nWomen in Science: A Global Perspective\r\nexamines some issues very specific to certain countries and cultures from Japan, where pursuing a scientific career, with its attendant stereotypes, is widely feared by young women as a threat to their love lives, to Algeria, which has one of the highest percentages of women STEM graduates in the world",
