      "ProgramStatus": "Expired",
      "ProgramSummary": "SYNOPSIS\r\n\"getting dot OLDER\" is a strongly hosted Lifestyle Doc TV/Online Interactive series focusing on intimate personal revelations about aging, primarily featuring diverse Baby Boomers, all across America.\r\n\r\nEPISODE FORMAT\r\nHost/Producer Roberto Mighty leads with strong studio wraparounds, and also conducts the interviews on locations across the USA. \r\n\r\nEach half-hour episode begins with the series open; preview clips/soundbites; and an invitation for viewers to respond online after the show. Then, three diverse Americans from across the country (ex: Alaska, Florida, Michigan, Texas, Massachusetts, Missouri) are individually featured in 7-minute segments.   \r\n\r\nEach segment begins with brief biographical clips from a day in the life of that person. These action-oriented clips are designed to give audiences important clues about this subject's age, family situation, gender orientation, income, living arrangements, etc. The  bio clips are then interspersed with intimate revelations gleaned from our unique \"getting dot OLDER\" interview process. \r\n\r\nUNIQUE INTERVIEW PROCESS\r\nEvery show participant is asked the same 21 questions, in the same order. However, a 7-minute segment will only include responses to 3 or 4 questions. Interviews take place in locations that are meaningful to the lifestyle of the participant. In some cases, that could mean the person's living room. In other cases, it could be in a forest, on a houseboat, in a kitchen, or, for a homeless person, under a bridge. \r\n\r\n\r\nThe episode ends with a summation by the host, an invitation for viewers to respond online, a next episode tease and the series close.\r\n\r\nAUDIENCE\r\n\"getting dot OLDER\" on-camera participants range in age from 50 - 100. However, this series focuses on Baby Boomers. \r\n\r\ngetting dot OLDER_Ep_001: Mike - Cattle Rancher; Dianne - African Dancer and Archer; Karen - Taiko Drummer and Senior Activist; Ken - Rower and Musician; Kim - Cancer survivor and tennis player; Danny - Tailor and Chef; Karmen - Singer and Artistic Director.\r\n \r\ngetting dot OLDER_Ep_002: Jessica - Transgender woman and software developer. Pat - Restaurateur; Regge - College Professor; Catherine - Author; Sheila - Administrator; Christie - Ice Skater and Painter\r\n \r\ngetting dot OLDER_Ep_003: Special: “All About Intimacy” - with revelations from key Season 1 participants, including Sheila, Bert, Kim and Danny. Expert Interview: Dating after Divorce. Expert Interview: Sex after Sixty.  \r\n \r\ngetting dot OLDER_Ep_004: Bob - Entrepreneur; Steve - Schoolteacher; Sandy - Rock ’n’ Roll Audio Engineer; Expert Interview: How women are perceived differently after menopause. Expert Interview: Why men don’t live as long as women.\r\n \r\ngetting dot OLDER_Ep_005: Charles - Bicycle Activist; Yulan - Ballroom Dancer and Teacher; Walter - Retired Postal Worker; Online Audience Member 1; Online Audience Member 2. Expert Interview: Role of exercise and recreation in aging.\r\n \r\ngetting dot OLDER_Ep_006:  “I felt Old for the first time when…” funny stories from key Season 1 participants, including Bob, Steve, Sheila and Catherine. Online Audience Member 3; Online Audience Member 4. Expert Interview: The science of brain aging. Expert Interview: Is anti-aging a myth, a reality, or a load of hooey?\r\n \r\ngetting dot OLDER_Ep_007:  Bert - Author and Professor;  Paul - Advocate for Vietnam Veterans; Online Audience Member 5; Online Audience Member 6. Expert Interview: Changing careers after retirement. \r\n \r\ngetting dot OLDER_Ep_008: Special: “The Sandwich Generation”. Stories from key participants and online audience members whose parents and adult kids live with them. Is it a blessing, a curse, or both? Coping strategies. Finding joy. Expert Interview: Family Counselor.  Expert Interview: De-clutter Specialist.\r\n",
      "ProgramTitle": "",
