      "ProgramSummary": "The Revolution Will Not Be Televised, taken from Scott-Heron’s 1976 album Pieces of a Man, defined an era with its originality, melding blues and jazz influences with soul, R&B and spoken word. It also marked the first collaboration between Gil Scott-Heron and long-time collaborator Brian Jackson. This documentary takes a look at the seismic cultural impact this album had, its socio-political context and the continuing influence it holds. ",
