      "ProgramSummary": "A documentary on World Champion, Two-Time Olympian and Five-Time National Champion pairs figure skater Randy Gardner. \r\n\"You just don't know in sports. It's that night. It's that moment.\" -- Randy Gardner \r\nOnce upon a time in Long Beach California, a World Champion was born.\r\nGO FIGURE: THE RANDY GARDNER STORY, documents the life of the two-time Olympian, Randy Gardner, who paired with Tai Babilonia, and became the iconic figure skating pairs team, affectionately known as, Tai and Randy.\r\nDubbed \"America's Sweethearts\" by the press, Tai and Randy were the \"It\" couple poised to win the 1980 Lake Placid Olympics after coming off of their World Championship Gold Medal in Austria in 1979. The \"miracle on ice\" stage was set for the Americans to beat the long dominant Soviet Dynasty for a first time ever Olympic Gold in U.S. Pairs Skating. The entire country watched with anticipation and hope. But then, on that night, at that moment -- heartbreak on the world's stage.\r\nForty years later, Randy takes the courageous leap to share his very private and very personal story.\r\nA story that delves far beyond the glory of competition and unfulfilled Olympic dreams.  A story filled with family secrets, closeted sexuality and the price paid to keep it quiet. A story that is at once heartbreaking and uplifting in its ability to inspire greatness.\r\nGO FIGURE: THE RANDY GARDNER STORY is one man's quest to finally come to terms with his true identity.",
