      "ProgramService": "Syndication",
      "ProgramStatus": "Pulled back by supplier",
      "ProgramSummary": "\"This is a film about a fearless woman, Golda Meir, Israel's first female Prime Minister, who served during the Yom Kippur War when Egyptian troops stormed across the Suez Canal, overwhelmed the surprised Israeli troops, and Golda's superhuman efforts to avoid disaster. Adapted from the hit play by the same name, Valerie Harper plays Golda and multiple roles. It's her part of a lifetime and a great departure from the roles we are used to seeing her in. She brilliantly depicts Golda's struggles and frustrations with the Israeli generals including Moshe Dayan. Impressive and moving are the moments of Golda's efforts to persuade Kissinger to have Nixon send help to Israel. If she did not succeed it would be, as Dayan stated, the third destruction of the Temple. It would have meant the end of Israel. And there are also very touching, at times humorous, scenes of Golda's life, including coming to Israel from the U.S. and becoming one of the first pioneers. She succeeded in doing so, but at the same time, it ended her marriage.\" (Playbill.com quoting Quad Cinema)",
