      "ProgramSummary": "Life is full of joys and challenges for us all‚ but the experiences of individuals living with Intellectual/Developmental Disabilities (I/DD) is something that not everyone understands or appreciates. A Good Life, a WXXI production, takes an intimate look into the lives of six adults living with I/DD and their families. The film shares the challenges and opportunities they face, while leading national experts and historians in the field offer insight. \r\nThe film's producers were able to imbed themselves with these adults and their families, filming moments from their everyday lives. A Good Life provides the unique opportunity to share their stories from a first-person perspective. Viewers will see each family dealing with aging in a unique way that is specific to the time period and constructs they were born into.\r\nThe film also offers professional perspective and historical context from experts including Dan Meyers, Al Sigl Community President Emeritus; Jeiri Flores, an advocacy specialist with the Strong Center for Developmental Disabilities; Professor Tamar Heller of the Institute on Disability and Human Development; Dr. Allison Carey, Disability Activism Sociologist, Professor, and Author; Nicole VanGorder of Upstate Special Needs Planning; Professor Jorge Matos of City University of New York Center for the Humanities; and Dr. Stephen Sulkes of Strong Center for Developmental Disabilities.\r\n",
