      "ProgramSummary": "THE GOOD ROAD – Synopsis\r\n\r\n\r\nTHE GOOD ROAD explores the complicated cocktail that is created when charity is introduced into a mixture of culture, politics, religion and history. In season two, each half-hour episode reveals a unique and astonishing location, and an engaging cast of characters that are real, gritty, insightful, funny, humbling and awe inspiring. It makes you look at global philanthropy in a whole new light! \r\n\r\nHosts Earl Bridges and Craig Martin—longtime  philanthropy veterans, globetrotters and best friends—trek around the world to meet people who are making a difference. As they explore familiar places like South Carolina, Virginia and Puerto Rico, and foreign destinations like Myanmar, Thailand and India, the duo discover the limitless power of good, and inspiring change-makers.\r\n\r\n\r\n101:  Richmond, Virginia: “Racial Reconciliation” (WT)\r\nAfter the killing of George Floyd, Richmond became a focus of international attention considering the city was the former Capital of the Confederacy.  Against that backdrop, Earl and Craig speak with influential members of the community hoping to bridge the gap of racial inequality and negativity. Dontrese Brown, a young, networked black entrepreneur shared his Hidden in Plain Site project (HiPS) which marries 360 video with historic images to shed light on famous and infamous sights in Richmond. Curator Valerie Oliver at the Virginia Museum of Fine Arts talks about the impact and importance of Kehinde Wiley’s iconic statue, “Rumors of War” a hip-hop inspired replica of the J.E.B. Stuart statue, and the renaming of The Boulevard to Arthur Ashe Boulevard.  The purpose of these alterations is to set aside old and painful reminders of Richmond’s slave past, embracing a positive era of racial reconciliation and hope.     \r\n\r\nEpisode 102: San Juan, Puerto Rico: “State of Affairs” (WT)\r\nSan Juan is at the heart of a whole range of important contributions Puerto Rico has made in US history including things like art, sports, music and cuisine.  Craig and Earl explore the Old City, talking to artists, chefs and historians about that complex history. Sculptors Charles Juhász-Alvarado and Ana Rosa Rivera talk about their work in Viejo San Juan’s poorest community, La Perla, and how they have used art to enhance the lives of those living there.   Latino filmmaker Alberto Ferreras talks about how Puerto Rican identity fits into American culture and politics.  An interview with the ex-Mayor of San Juan, Carmen Yulín Cruz, reveals how San Juan managed to survive the devastating aftermath from Hurricane Maria.  And, a Dominican Republic immigrant community share the secrets behind their incredibly delicious street foods. \r\n\r\nEpisode 103: India: “An Education of India” (WT)\r\nEarl and Craig travel to Hyderabad, India to meet up with Earl’s old buddy, Harish Mamtani.  Harish runs a private school designed to help underprivileged students who are eager to learn with a better education than can be received elsewhere in the community.  Coming from an entrepreneurial background, Harish knows that innovation is the key to making the overwhelming task of providing effective education to students in poor communities possible.  On the itinerary is visiting Hyderabad’s historic Golconda Fort and Charminar Mosque as The Good Road team steps back in time to India’s ancient history.  A quick trip to Bangalore rounds out an exploration of South Central India’s two most important tech cities and takes viewers off the beaten path to understand not just the India of the past but the modern India of the present.  \r\nEpisode 104: “Shalom Y’all!” Charleston, South Carolina:  \r\nCharleston has been named the “best city in America” by Travel + Leisure magazine for 3 years running.  However, beneath the facade of plantation style mansions with oak trees covered in Spanish Moss one can stumble on the oldest Jewish community in America.  It also is home to the first Opera House, and the “Ellis Island” for slaves arriving from Africa.  Against this complex and messy history are stories of strength, vision and perseverance.  Earl and Craig get to share a cup of she-crab soup, with a side of shrimp and grits, with some of the most influential citizens of “the Holy City” and discover a charm from unexpected characters.\r\n\r\nEpisode 105: Bagan and Yangon, Myanmar:  \r\nA trip to the ancient city of Bagan provides a look into the mystery and mystical stories of ancient Myanmar.  Thousands upon thousands of pagodas - all with different shapes, colors and designs - dot the landscape.  Bagan was the ancient capital of the Pagan Kingdom which existed from the 9th to 13th centuries and was the first kingdom to bring the various regions into one state that would later constitute Myanmar.  Earl and Craig explore this ancient kingdom and it’s Buddhist heritage and ancient architecture. Then it’s back to Yangon, the former capital of modern Myanmar,  and friends discuss what it’s like to be part of a LGBTQ community in one of the most militaristic and strict countries in the world.  \r\n\r\nEpisode 106: Puerto Rico: “Island of Enchantment” (WT)\r\nEpisode 107 - Richmond, Rassawek and Yogaville, Virginia: \r\nEpisode 108 - Chiang Mai, Thailand: “Free Burma Rangers”",
