      "ProgramSummary": "Emmy-nominated television series THE GOOD ROAD looks at the messy business of global charity. Hosts Earl Bridges and Craig Martin--longtime philanthropy veterans, globetrotters and best friends--trek around the world to meet people who are making a difference in their communities. In Season Three, they meet people who are dealing with PTSD, racism, climate change, overfishing, plastic pollution and civilian space travel.  Their travels take them to places close to home such as Nashville, Florida's Space Coast, Utah, the James River in Virginia, as well as foreign destinations such as Mexico and the Netherlands. Wherever they go, they discover inspiring change-makers, and the limitless power of good.  Stories of people in need are mingled with stories of people helping out on the frontlines of The Good Road. \r\n\r\nEPISODES;\r\n\r\nNashville, Tennessee\r\nMusic City is not just a place to hang out, drink good craft beer and hear original music, there are a lot of changemakers in the city.  Craig and Earl explore all of it and have great conversations with residents like Janet Ivey of the children's PBS show Janet's Planet.  Janet was featured on CNN during the Mars landing in 2021.\r\n\r\nSpace Coast\r\nSpace Perspective founders Jane Poynter and Taber MacCallum are designing and building an environmentally friendly stratospheric balloon to take civilians up to the outer atmosphere.  Ultimately, the Good Road plans to be the first travel show in space.  In the meantime we talk with Jane and Tabor and a musician and space advocate, Mary Liz Bender, of the band Twin Limb. \r\n\r\nUttrecht, Netherlands, Greenland\r\nThe global issue of climate change has some of the best minds working on solutions, many of those are in Europe. We travel to Utrecht, Netherlands to talk with\r\nLeading Senior Traffic Engineer Bas Govers of the organization Excellent Cities. And then we travel to Greenland where the impact of climate change is most obvious.\r\n\r\nJames River, Virginia\r\nRiver advocates Laney Jameson Price lead The Good Road team to special spots along the James River that they sing about and highlight in their environmental activism.  And, James River Association CEO Bill Street takes the team on a trip on the James to follow the work of Research Scientist Matthew Balazik as they work together to try and repopulate the once nearly extinct Atlantic Sturgeon.\r\n\r\nCareyes and Puerto Vallarta, Mexico\r\nFinal Cycles Executive Director Norman Vaux II discusses plastic waste and the damage caused to the environment.  Final Cycles is working to solve the global plastic pollution problem through education, community Involvement and technology. Along the way, Norman, Craig and Earl eat the great food and drink which is famous in this region of Mexico.\r\n\r\nCharleston, South Carolina\r\nThe Kahal Kadosh Beth Elohim synagogue was founded in 1749 is one of the oldest Jewish congregations in the United States.  A walk through the synagogue with worshiper Anita Rosenberg reveals the impact that the congregation has had over the years in support of the city. The Good Road also ventures out to the country to watch Chef Marcus Middleton prepare traditional Gullah cuisine alongside his famed knife maker brother Quintin Middleton, founder and creator of Middleton Knives. Quintin's knives are preferred by some of the world's top chefs.\r\n\r\nPuerto Rico\r\nPerspectives from Puerto Rican activists Tito Kayak and performer La Bruja gives a deeper understanding of what it means to be Puerto Rican.  The Good Road also travels to Loiza to meet up with artist Samuel Lind.  Loiza is internationally known for its former slave community and spawning musical genres like Bomba, Plena and the Vejigante (carnival) performers.  Samuel expresses each through his art.\r\n\r\nUtah\r\nStacy Bare is a combat veteran having served in battle in places like Iraq.  After returning from the war he struggled and at one point his PTSD led him to a moment where he was at the brink of taking his own life.  Fortunately, he called a friend who said to put it off and go rock climbing with him in Utah. That led to an epiphany that the outdoors are conducive for healing and he wound up starting an organization called Adventure Not War where he led other combat veterans to places like Afghanistan to ski and interact, in peace, with the local residents.  He now has Happy Grizzly Adventures and will be leading expeditions where capture his latest adventures and tell his story.\r\n",
