      "ProgramSummary": "An innovative, inspiring documentary series about two best friends who travel the world meeting philanthropists and change-makers, who have dedicated their lives to addressing global humanitarian issues. In season 4, hosts Earl Bridges and Craig Martin explore important issues and meet people making a difference in Iraq, the US Virgin Islands, New York City, Charleston and Nashville.\r\n\r\nEpisode 401 - New York City, NY: \r\n2023 is an exciting year for New York City and Earl Bridges and Craig Martin capture some of the highlights like the 50th Anniversary of Hip-Hop.  Music and the arts have always been a major part of progressing society forward and New York City has often set the pace for that progress.  Topics like LGBTQ rights, racial and ethnic equity and in settings like the Theater for the New City and the Nuyorican Poets Cafe (some of which are also celebrating 50 years of community influence).\r\n\r\nEpisode 402 - US Virgin Islands: \r\nThe US Virgin Islands were formerly a colony of Denmark and were sold to the United States in 1917 for military reasons.  Each of the 3 islands; St. John, St. Thomas and St. Croix has its own identity and historic development by the US.  The Good Road team explores some of the nuisances between the islands with a focus on identity, sustainability and education.  As the only HBCU in the Caribbean, the University of the Virgin Islands (UVI) is providing educational opportunities for marginalized communities on both the islands of St. Thomas and St. Croix.\r\n\r\nEpisode 403 - Mosul, Iraq: \r\n\"Conflict never begins with things we agree on.\" This statement from Hardwired Global is profound and is part of what compels Craig Martin and Earl Bridges to venture into a country with a history of war and conflict, Iraq.  Most Americans think they know most things about Iraq largely from reporting during eight years of conflict ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã¢â‚¬Å“in-country.ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€šÃ‚Â  But, there is so much more to Iraq than conflict and the team from Hardwired Global takes The Good Road team into Mosul to discover what itÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â‚¬Å¾Ã‚Â¢s like to bring unity through education.  Sometimes this is done by helping the children of Kurdish Christians and the children of extremist Islamic groups understand each other by participating in games and activities ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€šÃ‚Â¦ together.\r\n\r\nEpisode 404 - Charleston, SC: \r\nIf you think you know everything about the city of Charleston, South Carolina you might have missed some of the communities that have made the city what it is today.  Earl Bridges shares his city with Craig Martin as they explore the Jewish community as represented by the people of the Kahal Kadosh Beth Elohim (KKBE) synagogue in downtown Charleston.  Founded in 1749 the KKBE is known to be the oldest Reform Jewish Synagogue in the United States.  In this episode The Good Road team also gets introduced to members of the LGBTQ  community which has had a huge influence in CharlestonÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â‚¬Å¾Ã‚Â¢s arts and culture scene.  And, activists within the gay community have pushed for recognition of that influence.\r\n\r\nEpisode 405 - Shelbyville and Nashville, TN: \r\nThe Good Road team drives outside of Nashville, Tennessee to meet up with Fawn Weaver who is the founder and CEO of the Uncle Nearest Whisky Distillery in Shelbyville, TN.  Not only is Fawn the only female black owner of a major whiskey distillery, she is joined by her friend and awarded whiskey blender, Victoria Eady Butler.  Victoria is a descendant of the distilleryÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬ÃƒÂ¢Ã¢â‚¬Å¾Ã‚Â¢s namesake Nearest Green aka. Uncle Nearest. As black women, Fawn and Victoria are breaking stereotypes in the very male dominated business of spirits and the production and distribution of high quality whiskey.  As a business, they also involve themselves heavily in the community and in causes that help promote black and female owned businesses across the US. \r\n\r\nEpisode 406 - New York City, NY: \r\nThe image of who visits and uses food provided by food banks across the US is often skewed by TV and Film and can be completely inaccurate.  Many of the people who are sustained and survive in our communities on food provided philanthropically are hard working people who have jobs and work each and every day to support their families.  The realities of these communities are highlighted in New York City by journalists from the massively impactful Food Bank NYC.  Meet working class people (many immigrants) who have struggled to survive in one of the wealthiest cities in the world in this episode of The Good Road.\r\n\r\nEpisode 407 - Nashville, TN: \r\nAcross the United States there is an underground and yet very visible criminal industry we know as human sexual trafficking.  Like many issues in America, this problem is ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã¢â‚¬Å“hidden in plain sight.ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€šÃ‚Â  The victims of this horrible criminal industry have found new hope in survivor houses like Thistle Farms in Nashville, Tennessee.  Founder & President Becca Stevens is passionate about helping these women and men in part because early in life she was also a victim.  Thistle Farms treats everyone who visits as part of a community that finds value in everyone.  And, they provide in-house work for the survivors of human trafficking.  Craig and Earl sit down with Becca and learn what makes her the iconic figure she is in Nashville and across the country.\r\n\r\nEpisode 408 - St. Croix: \r\nSt. Thomas in the US Virgin Islands is tightly connected to the US mainland politically and socially.  But, for many reasons (including geographical), the island of St. Croix is truly an ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã¢â‚¬Å“islandÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€šÃ‚Â among the islands of the USVI.  Some of the major problems on St. Croix ties back to inequities in influence with the broader USVI.  The center of commerce on St. Croix is in Christiansted while the west coast city of Frederiksted is the heart of black Cruzan culture.  Negative impacts on the environment from a major refinery near Frederiksted combined with a serious lack of adequate education and access to healthy food has made St. Croix vulnerable.  The RT Park in St. Croix located across from the UVI St. Croix campus is working to turn vulnerabilities into strengths.  ",
