      "ProgramSummary": "Episode 501 - Mosul, Iraq\r\nSummary:\r\nThe Good Road travels with Haana Husain around Mosul, Iraq and discovers the beauty of the city ravaged by war. As a BaHa'i, Haana is in a religious category that isnt even recognized by the Iraqi government and has, herself, been personally persecuted for her faith. But, in an amazing act of love and forgiveness has never held bitterness in her heart for her oppressors. As a staff member for the Hardwired Global organization, Haana helps to communicate the ideas of pluralism and the concept of understanding others on religious and political grounds. Craig and Earl tour around Mosul and Northern Iraq and see what daily life is like in the region. \r\n\r\nEpisode 502 - Miami, Florida and NYC, New York\r\nSummary:\r\nThe Haitian diaspora is spread across the United States and two cities, New York and Miami, have been enriched by the Haitians who have blended into American culture. DJ Michael Brun provides perspective on the island of Haiti and future generations who have families living between Haiti and the United States. Michaels father, Patrick Brun has been instrumental in promoting education and business on the island of Haiti. His 1980s band, Skandal, received many awards for their music and Patrick passed on that success to 31-year old Michael who has worked with major performers like Wyclef Jean and in 2018, he released the single \"Positivo\" with J Balvin, which became the theme song for the 2018 FIFA World Cup. Both father and son have been instrumental in helping with The Haitian Project which is an organization building schools for the poor of Haiti across the island. Education is seen as the highest need in Haiti, an island some experts consider a failed state.\r\n\r\nEpisode 503 - St. Croix, USVI, Asheville North Carolina & Charleston, SC\r\nAs scientists focus on varied environmental and health challenges facing humanity, one tiny insect is doing its part to maintain positive energy in both fields. The bee is known across the globe for the delicious and enormously important healthy source of sugar found in honey. Helping bees thrive in our communities helps us to thrive in those same communities. The Good Road host, Earl Bridges, knows a little something about beekeeping having started his own production years ago in downtown Charleston. Earl takes co-host Craig Martin on trips to visit Rastafarian farmer Honeyman on the island of St. Croix and to mountains of neighboring North Carolina to talk with experts at the Center for Honeybee Research in Asheville, NC.\r\n\r\nEpisode 504 - Little Ukraine & Brooklyn, New York\r\nSummary: \r\nThe Good Road hosts Earl Bridges and Craig Martin tour the East Village neighborhood of Little Ukraine with fellow PBS producer Mickela Malozzi, host of the national TV series Barefeet with Mickela Malozzi as she talks about her hometown neighborhood and the impact of the war on that community. Their journey then takes them over to the Brooklyn Academy of Music Plaza for a Gay Pride month Vogue-ing demonstration to talking about how dance provides a platform for unity and understanding in LGBTQ  communities.\r\n\r\nEpisode 505 - St. Croix\r\nSummary:\r\nSenator Marise C. James in the USVI legislature fights for the rights and needs of poor Cruzans on her home island and as a black female gives voice to that often overlooked constituency. She also provides a vision for the future of younger generations of Cruzans in St. Croix within the larger U.S. context. Along with Senator James, Tarik McMillan as one of those next gen Cruzans, is interviewed by Earl and Craig of The Good Road about the mental health needs on the island. TarikÃƒÂ¢s start-up Greater Changes is focused on providing on-line therapy for young Cruzans both on the island of St. Croix and across the Cruzan diaspora in the United States. These Cruzans face unique mental health challenges as they navigate the competitive and stressful economies in the American experience.\r\n\r\nEpisode 506 - New York City, New York\r\nSummary:\r\nThe fight for womens rights in America continues as young women continue to work towards equity and influence in business and government. The Good Road team goes deep inside this world in the East Village of Manhattan with two authors; Sophie Saint Thomas and Tawny Lara. Both speak with Earl Bridges and Craig Martin about New York, their work and their journeys on the road of sobriety. This is a deep dive into what it is like to be a professional woman in the Big Apple An interview with legendary New York dancer Kimberly Bartosik also reveals the power of women through dance. Kimberly was a dance member in the iconic Merse Cunningham Dance Company and talks about this influential time in her life.\r\n\r\nEpisode 507 - New Orleans, Louisiana\r\nSummary:\r\nMusic and food are at the heart of the great American city of New Orleans, Louisiana. And, the biggest annual event in New Orleans is the historic Jazz & Heritage Festival  The Good Road will explore the city through the lens of the Jazz Festival slated for April 25th through May 5th, 2024. Founded in 1970 the festival and foundation continues today with a mission described as one that promotes, preserves, perpetuates, and encourages the music, culture, and heritage of communities in Louisiana through festivals, programs, and other cultural, educational, civic, and economic activities. Historically, New Orleans had the largest slave market in America but now it is a thriving city known for its diversity, food and culture.\r\n\r\nEpisode 508 - Nashville, Tennessee\r\nSummary:\r\nHuman Trafficking as depicted in Hollywood movies is almost always set in international locations like Bangkok where The Good Road hosts Craig and Earl grew up. The reality is that much of the business of sexual human trafficking happens from the consumer end right here in the United States in communities and cities all across the country. Nashville, Tennessee is one of those places. Craig and Earl pay a visit to Thistle Farms in Nashville to learn how Founder/President Becca Stevens is tackling this issue head on. Thistle Farms has created a dynamic community diner and production facility where survivors of sex slavery can learn new skills and make money from learning a healthy trade. The money made at Thistle Farms gets poured back into the lives of these survivors and The Good Road team documents that story so that the world can see an example of how individual communities are tackling this global problem.  ",
