      "ProgramSummary": "\r\nGrace Kelly’s Missing Millions 1x60 (2021)\r\nYeti for C5 (2021)\r\nThe Grace Kelly story, the beautiful actress who rose to stardom and shocked the world when she left Hollywood to marry Prince Rainier of Monaco, is well known. But less well-known is the story of her missing millions. When Grace tragically died, she appeared to have assets of just $10,000 and a ramshackle cottage in Ireland. \r\n\r\nThis film reveals Grace’s privileged financial upbringing & the difficult relationship with her father; her struggle for self-sufficiency in New York where modelling funded her true love: acting. This is a story about a woman with a head for business but who was exposed to sexual double standards and the gender pay gap. As a Princess Grace had to pay her own dowry only to find herself trapped in a gilded cage - worth millions to Monaco yet earning little for herself. And since her death, the Grace Kelly name and image continues to generate millions… but who benefits? A revealing look at the missing millions of a global icon.",
