      "ProgramSummary": "Social Media is proving to be an essential tool in the telling of the real-life stories of World War II's Greatest Generation.\r\n\r\nFor Alaskan teenager Henry De Hoop, social platforms such as Facebook have proven to be an incredible resource in sharing the story of his grandfather, James Schmidt, with a global audience.\r\n\r\nJim Schmidt, like 16 million others of his generation, served in World War II.\r\n\r\nBut the war journey of Henry's granddad is anything but routine. It's unlike anything most of us have ever heard or even thought possible. And to use a 21st Century expression:\r\n\r\nGrandpa's War Story is About to Go %23Viral. \r\n\r\nIt's a journey that begins in a movie theater in 1942 with the film Parachute Battalion playing on the big screen and ends in the jungles of Vietnam more than two decades later.\r\n\r\nProduced, Directed and Written by Tim Gray\r\nEdited by Jim Karpeichik\r\nMusic by Roger Cichy\r\nNarrated by Liv Schreiber\r\n",
      "ProgramTitle": "GRANDPA'S WAR STORY GOES VIRAL",
