      "ProgramSummary": "60 Minute Pledge Program %26 90 Minute Pledge Event\r\n\r\nWhat if %E2%80%A6 we could reprogram old cells to be young again? What if %E2%80%A6 we could have a disease-free future? What if %E2%80%A6. 90 were the new 40? \r\n\r\nToday's breakthroughs in longevity research are unprecedented, with crucial implications for our personal, %26 financial lives. This energizing new program offers both hope  and strategies for an amazing future, featuring experts like four-time %231 New York Times best-selling author Michael Roizen, M.D., author and financial expert Jean Chatzky, acclaimed economist Peter Linneman, community developer Albert Ratner, and more to help us navigate this brave new world. \r\n\r\nWith practical, relatable advice on how to make the best decisions for your brain, your body, and your bank account, this provocative program will reshape how you think about old age--and help you plan for an audacious future.\r\n\r\nPart 1: How the history of medical breakthroughs reveals something about our future.\r\n\r\nThe Great Age Reboot is coming--and it's coming fast. Now is the time to prepare for the crucial decisions that will come, so you'll be here and healthy to enjoy the extended youth and joy that will come as a result of breakthroughs on the horizon!\r\n\r\n-Your Future Body, Our Future World: a look at the major medical advances that are coming soon - and coming fast.\r\n-The longevity promise of re-engineering your aging cells\r\n-Could advances in immunotherapy be the key to curing cancer and pandemics?\r\n-New tech may be able to save or replace bad body parts\r\n\r\nPart 2: Banking on the Great Age Reboot\r\n-How will we pay for longer and younger lives?\r\n-Self-Engineering your wealth\r\n-How might society shift to address this major disrupter of living longer, including issues of inequality\r\n\r\nPart 3: Steps to take today to prepare for the changes of tomorrow\r\n-Self-engineering your body; make changes that can have exponential effects on your health and longevity \r\n-Self-engineering your life, from retirement to relationships\r\n-Self-engineering your Great Age Reboot \"GAR\" Plan\r\n",
