      "ProgramSummary": "On October 10, 1871, Chicagoans awoke to an unrecognizable landscape: where 48 hours earlier there had been a vibrant city of ornate civic buildings, grand hotels, and cultural institutions, now there was nothing but a smoking pile of rubble stretched for miles on end. Many wondered: could the city recover? And how did tensions between the cityâ€™s elites and the immigrant poor lead to the wrong person being wrongfully accused of starting the blaze? \r\n\r\nTHE GREAT CHICAGO FIRE tells the dramatic story of a defining and prescient moment in Chicago history â€“ the Great Fire of 1871 â€“ when the city faced destruction, rebuilt, and laid the groundwork for a thriving future.\r\n\r\nAMERICAN STORIES is an original documentary series uncovering Chicagoâ€™s fascinating history. Each story presents an entertaining and intriguing tale about a person or event that shaped Chicago. The series reflects the rich diversity and breadth of human experience that shaped this great American city.",
