      "ProgramSummary": "The Greening of the Bronx: An Urban Garden Tale is a film about South Bronx black and brown environmentalists fighting the racist public policies that have plagued their community.  The South Bronx, like many urban communities, has a widely disproportionate number of waste facilities including waste transfer stations, sewage sludge treatment plants, as well as a number of power plants and prisons. Four prisons have been built in the Bronx with a fifth being planned. Public policy has saddled these residents with poor health outcomes - the area has become a food desert, with air and water toxicity, and a school system that serves more as a school-to-prison pipeline than to successful lives.\r\n\r\nThe Greening of the Bronx: An Urban Garden Tale is an ensemble piece, a community portrait that follows three trainees and their team leaders/trainers at Sustainable South Bronx (SSBx). But they are not an island, they are part of the larger grassroots activism in the Bronx fighting on many fronts ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“ from removal of the Sheridan Expressway, to closing prisons, to creating affordable housing, to expanding parks by ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œCappingÃƒÂ¢Ã¢â€šÂ¬Ã‚Â the Cross Bronx Expressway with parks to reduce the ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œasthma alleyÃƒÂ¢Ã¢â€šÂ¬Ã‚Â corridors in the Bronx - Bronx activists are fighting and winning. Each teacher at Sustainable South Bronx is an activist, and each sees the power of change in the microcosm that is the Bronx ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“ one person at a time, to the macrocosm of the Bronx ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“ social inequality and environmental injustice. Too often urban communities are painted in the media as having no agency for their own change and are left out of the processes and public policy decisions that determine the future of their community. Sustainable South Bronx rebuffs that stereotype and offers solutions. It shows a community fighting for itself at every level - through the love they have for one another, the love for the people who enter their doors, the love of their community - and succeeding. We are at a critical juncture in deciding what our climate solutions will be. Urban communities will be central to these solutions. The environmental activists of the Bronx are carving a path towards those solutions that look at not only how one ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œgreensÃƒÂ¢Ã¢â€šÂ¬Ã‚Â urban communities, but the people within that community also.\r\n\r\n\r\n",
