      "ProgramSummary": "Gregorian: Pure Chants In Concert includes a stunning blend of traditional chants and contemporary music compiled from the exquisitely produced Gregorian concert DVDs from the last years. Music selections represent Pure Chants, the new Gregorian CD set of uplifting, meaningful songs.  This music is also featured in the upcoming Pure Chants Tour and generous station ticket offer, preliminary details below. \r\n\r\nThis high-quality production features spectacular lighting and sound, samples in set list below.  The songs were all recorded in front of a live audience. At the top of each segment, Ms. Brightman will offer insight into song choices and production. \r\n\r\nGregorian producer Frank Peterson, keenly aware of the world traumas we have all experienced during the last few years, is using the benefits of traditional Gregorian music to bring audiences back to life.   There are scientific studies that show Gregorian music creates calm and serenity.  Gregorian chants have been sung for 1200 years.  Peterson and Gregorian created a more contemporary version of the music that is attractive to all audiences because of the power and emotion of the music and the atmospheric quality it creates.  Gregorian pours new meaning into lyrics that touch the soul. This genre of music - as history proves – that does not go out of style.  Gregorian modernizes it with their song selections and production. \r\n\r\nThe special and tour include singers Amelia Brightman, whom is clearly the sister of Sarah as evidenced by her pure soprano voice and beauty, and Narcis, a rare and true contra-tenor.  ",
