      "ProgramSummary": "\"Groundworks\" profiles four of the California Native co-creators of the Groundworks projecta collaborative performance on Alcatraz Island on San Franciscos first official Indigenous Peoples Day in October 2018. While weaving together these artists stories and their contemporary ways of sharing traditional knowledge, the \"Groundworks\" documentary considers issues of land management, water rights, and food securityconcerns for all Americans, especially in an age of climate change. These issues are particularly acute in Indigenous communities that have called these lands home for millennia, and who remain resilient despite centuries of colonization and marginalization. We travel from traditional acorn gathering spots to the studios where the Groundworks performance was rehearsed before being shared after dawn, 50 years after Indians of All Tribes occupied Alcatraz.",
