      "ProgramSummary": "GROWING A GREENER WORLD (SEASON 12) SERIES OFFER DESCRIPTION\r\n\r\nGROWING A GREENER WORLD (13x30) spotlights amazing people and places dedicated to leaving a lighter footprint on our planet. But it’s more. It’s about sharing good old-fashioned backyard gardening know-how, and about cutting-edge global trends in the environmental and eco-friendly movements. \r\n\r\nDrawing from a long personal history of organic horticulture as well as his endless fascination with finding new techniques for better results in the garden, host Joe Lamp’l engages and connects with first-time gardening rookies and veteran green thumbs alike, and he invites them all to come along on an exploration of the people and places who are truly growing a greener world.\r\n\r\nIn Season 12, the GGW team presents a wide variety of emotional stories and fascinating places. This award-winning series travels to every corner of the country in search of compelling, inspirational, and entertaining stories about people making a positive impact through organic gardening, sustainable living, farm-to-table cooking, natural conservation, large-scale farming, and small-scale urban homesteading.\r\n",
