      "ProgramSummary": "\r\nWith intimate access, this insightful film follows four diverse young Jewish people all celebrating their bar and bat mitzvahs in the same week.\r\nThis uniquely Jewish rite of passage, marking a child’s transition to adulthood within the faith, will be one of the most important nights of these 12 and 13-year-olds’ lives.\r\nEach will be marking it with a special religious ceremony and a unique celebration - but these four celebrations – reflecting a range of Orthodox, Reform, Ashkenazi and Sephardi voices and traditions - couldn’t look more different.\r\nWith intimate access to the private celebrations of four young Jewish people, as the clock ticks down to this big week, Growing Up Jewish reveals the cultural and religious significance this milestone holds to each of them and what it means to a generation about to come of age.",
