      "ProgramService": "Exchange",
      "ProgramStatus": "Offer",
      "ProgramSummary": "Grown Up Dad explores the generational changes of fatherhood by asking what it means to be a good dad today. Historically, being a Dad meant providing financially, putting food on the table and a roof overhead. Yet, this norm feels incomplete. Between important discussions about toxic masculinity and evolving gender roles, defining good fatherhood has never been more complex.  Host Joseph Gidjunis is a Dad who only saw fathers as drive-by parents, missing the real family time. Wanting to be more for his own son, he interviews experts all across the country to find out what it means to be a good parent.   And hopefully, gain some \"tools\" along the way.\r\n\r\nEpisode Summary\r\nEpisode 1: Pilot Ã¢â‚¬â€ Originally distributed by APT in June 2024, will be repackaged along with these additional episodes for a complete first season. Host Joe Gidjunis is a dad who grew up seeing fathers as drive-by parents who often missed out on real family time. Wanting to be there more for his son, and with inspiration from the hit Australian animated series *Bluey,* Joseph sets out on a journey across the United States and Australia to discover what that looks like for him and his family. Along the way, Joseph meets up with experts and other dads for conversations about fatherhood, parenting, work and life balance, and being a role model.\r\n\r\nEpisode 2: Screen Time Dilemma Ã¢â‚¬â€ APT Screener. With concerns mounting over the mental health crisis among teens, host Joe Gidjunis heads to Washington, D.C., to sit down with U.S. Surgeon General Vivek Murthy, who reveals alarming data linking the rise of social media to soaring rates of anxiety and depression. Determined to explore the complexities of this issue, Joe continues his journey to Los Angeles, New York, and Virginia, where he engages with creators, educators, and parents to uncover who holds the power and responsibility to make the changes needed to ensure our children thrive.\r\n\r\nEpisode 3: Fatherhood is an Island Ã¢â‚¬â€ Host Joe Gidjunis explores the often-overlooked mental health struggles and feelings of loneliness many fathers face today. Joe travels across the United States to hear from dads who have felt isolated in their parenting roles. Through candid conversations with psychologists, support group leaders, and fathers who have navigated their own mental health challenges, Joe uncovers the pressures and expectations that can make fatherhood feel like a solitary experienceÃ¢â‚¬â€and what we can do to foster connection and support for dads everywhere.\r\n\r\nEpisode 4: Balancing Parenthood Ã¢â‚¬â€ Host Joe Gidjunis dives into the daily grind of decision-making that comes with managing a household, raising children, and striving for equity between partners. Joe meets with parents to discuss the mental load often shouldered by mothers and the importance of sharing this responsibility. Through conversations with family therapists, sociologists, and couples navigating these challenges, Joe explores how fathers can play an active role in creating balanced partnerships, reducing stress, and fostering a more equitable home life.\r\n\r\nEpisode 5: Phones in Schools Ã¢â‚¬â€ Special Report. As the 2024-25 school year unfolds, host Joe Gidjunis takes a closer look at the growing debate over phone usage in schools. Traveling to classrooms and communities across the country, Joe explores how parents, teachers, and students are responding to new policies aimed at managing phone distractions and fostering a better learning environment. Through interviews with educators, policymakers, and families, this special report examines the challenges and benefits of digital devices in education and what it means for our children's development and well-being.\r\n",
