      "ProgramSummary": "The Herriot Way walk is a 52-mile, circular walk that runs through some of the best scenery in the Yorkshire Dales, featuring many of the places associated with \"All Creatures Great and Small\" author James Herriot. It is typically walked over four days in clockwise fashion, starting and finishing in Aysgarth with overnight stops in Hawes, Keld and Reeth. The walk is named after James Herriot, the fictional name of real-life veterinary surgeon Alf Wright, who lived and worked in the Dales for many years and took walking holidays with his son. Along its length the Herriot Way roams across beautiful valleys, high, open fells and rolling, heather-clad moorland. The route explores one of the highest points in Yorkshire Dales, visits historic monuments and passes through a barren industrial wilderness laid bare through lead mining.\r\n\r\nThe program features interviews with Alf Wight’s son, explores the filming locations for the \"All Creatures Great and Small\" series, and shares stories of the land which so inspired the works of James Herriot.",
