      "ProgramSummary": "In the great north of Chile, around the year 1907, two little brothers, Pedro (Gastón Salgado) and Antonio (Jorge Arecheta), are forcibly separated when their parents were gunned down in a worker massacre. Gaspar was adopted by an officer in charge of the repression, while Pedro flees from a home for minors, growing up on the streets of the city of Valparaiso. Antonio, now called Gaspar, without knowing that he was adopted, grew up in the Sanfuentes family surrounded by privileges that money allows. While Pedro has become one of the most respected criminals on the streets, and has promised himself to find his younger brother and avenge the death of his parents. Twenty five years later, they meet again without knowing that they are brothers. Gaspar, converted into a policeman, was sent to the port to fight a gang of smugglers and criminals, led by Pedro. Both will become great enemies, especially when they fall in love with the same woman. All this, in a context of political upheaval and international intrigue.",
