      "ProgramSummary": "In 1962  Alfred Hitchcock and François Truffaut locked themselves away in Hollywood for a week to excavate the secrets behind the visual theme and \"telling a story\" in cinema. Based on the original recordings of this meeting—used to produce the mythical book Hitchcock/Truffaut—this film illustrates the greatest cinema lesson of all time and plummets us into the world of the creator of Psycho, The Birds, and Vertigo. Hitchcock’s incredibly modern art is elucidated and explained by today’s leading filmmakers: Martin Scorsese, David Fincher, Arnaud Desplechin, Kiyoshi Kurosawa, Wes Anderson, James Gray, Olivier Assayas, Richard Linklater, Peter Bogdanovich and Paul Schrader. \r\n\r\nhttp://cohenmedia.net/films/hitchcock-truffaut",
