      "ProgramSummary": "  Hitler's Space Rocket  juggles the narratives of three protagonists,     Germany, England and the United States,  at a crucial time in WW2. \r\nFrom Germany, we follow Wernher von Braun, a rocket scientist who dreams of getting a man into space,  but this same ambition leads him to developing the deadly V2. Though von Braun may not have intended to create a weapon initially, his research is now in the hands of the Nazi Party and the SS,   and his rockets are being used to terrorize London and other parts of Europe. These devastating attacks could change the outcome of the war .\r\nMeanwhile in London, Reginald Victor Jones a scientific analyst at top-secret MI6 must work against the clock to find a way to battle the menacing rockets that are battering his city. Jones, with his reputation as Churchill’s ‘wizard boy’, will need more than magic to beat the V2. He crafts a clever plan, but for this plan to work he’ll need to trust a double-agent, one who could switch back to the Nazi side at any moment. With the number of V2 casualties in London increasing by the day, there’s no time for Jones to hesitate…\r\nFinally, the Americans, who with the end of the war almost within their. grasp,  have  set their sights  on what will happen to this revolutionary technology when the Nazis have finally been defeated. The V2 is the first ballistic missile that the world has ever seen.   James Hamill is a US soldier who has been sent to hunt for the V2 and bring the technology back to his country. To accomplish this,  Hamill needs to capture the German scientists headed by von Braun and bring them to America as a part of Operation Paperclip. The race for the rocket designs is on – but will Hamill get what he needs before the Russians get it first?",
