      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "I received a phone call one day from a friend who works for the FBI. She had clicked on a link to a film project I was working on about what happens when girls in rural villages in India are educated. One of the outcomes is less susceptibility to human trafficking. My friend said, You dont have to go to India to document how children are caught in the sex trades. It happens right here. We need you to come home and educate people here in the United States because they just dont know how huge this problem is. %250D\r\nAt first I said a firm no. This was way beyond what I believed we could handle, but they kept telling me stories about how serious the problem was, and finally I called my co-producer and he said YES, lets do it. So we began with the help of our FBI friends to find survivors of child sex trafficking. In this film youll meet Misty, Catalleya, David (Yes, boys are trafficked too.), and Greg, whose powerful stories of survival are almost unbearable to hear. Through them we hope to raise awareness about child sex trafficking for everyone we can reach. We also wanted to focus on solutions by portraying the tremendous efforts being made by dedicated individuals to resolve the problem. And most importantly, youll find out how everyone, not only the experts, can help in so many ways.%250D\r\nBut you can also help. We are a non-profit media company that believes in serving others. This film was produced as a public service to address an important social issue, and you can be part of the solution if you air it! We also offer our film to you as a gift for fund raising. The bottom line is: we need people to see this film so they might demand changes in our legislation. When the people get angry, they act.",
