      "ProgramSummary": "The Daisy Jopling Band performs an eclectic fusion of classical, rock and world music, blending traditional orchestral music aesthetics with a wide array of contemporary musical styles. Our Illuminance film is a Musical Salute to the Magic of Bannerman Castle. \r\n\r\nFrom September 30 to October 4, 2020, the Daisy Jopling Music Mentorship Foundation collaborated with the Bannerman Castle Trust to create a series of five concerts on Bannerman Island, a little island in the middle of the Hudson river in NY with no electricity or running water, and the only access being by boat. A miracle was created. The whole crew built a stage on the island, brought all the sound gear needed for a full band performance with seven musicians, and three other student performances on stages around the island, and all the lighting equipment needed for a stunning illumination on the ruined and fantastical Bannerman Castle. The weather was beautiful every single night, and we were grateful to be the only outdoor music ticketed event allowed in the whole of New York State. \r\n\r\nFilmed by Timeline Video, Directed by Diane Cricchio, Edited by Natt McFee\r\nLighting Design by Deke Hazirjian\r\nRecorded and mixed by Leslie Bloome, Bob Biles and Tom Provenzano\r\nCreated and produced by Daisy Jopling\r\nAssociate Producer Laura Giarratano \r\n\r\nThe Daisy Jopling Band\r\nDaisy Jopling – Violin and Vocals\r\nJeff Miller – Piano\r\nMatthew Watanabe – Keyboard\r\nLavondo Thomas – Electric Bass\r\nSimon Fishburn – Drums\r\nMichael Feigenbaum – Percussion\r\nGuest Musicians\r\nSal Lagonia – Trumpet\r\nJoe Brady – Bagpipes\r\nStudent Musicians\r\nAnton Klettner – Violin\r\nJoseph Klettner – Accordion, Acoustic Guitar\r\nRachel Evans, Mentor – Violin and Viola\r\nHolly Paterno – Viola\r\nJosie Rose – Viola, Bagpipes\r\nNico Catalano – Saxophone\r\nDancers\r\nBelle Torres – Mentor and Choreographer\r\nCaitlin Quinn – Dancer\r\nJustin Smithson – Dancer\r\nMaya Lee Cruz – Dancer\r\nVictoria Dominguez – Dancer\r\nLive Sound\r\nTodd Giudice\r\n",
