      "ProgramSummary": "IIN THE AMERICAS WITH DAVID YETMAN takes a fresh look at the lands that make up the Western Hemisphere. The 10-part series showcases the landscapes, peoples, and natural history of the Americas - from a village of once-impoverished Japanese immigrants in the Amazon to descendants of poor Italians in Chile, from Mayan temples in Guatemala to ancient fortresses in Mexico and the enigmatic apartment buildings of Chaco Canyon, from the frigid, glacier-carved barrens of Alaska, to the timeless villages of the altiplano in Peru and the volcanoes of New Mexico, from venomous snakes in Brazil to Scarlet ibises in Trinidad and friendly whale calves in Baja California, and from a merchant ship in Canada to reed boats of Bolivia. On foot and by raft, boat, ferry, bicycle, horse, and motorcycle, host David Yetman journeys to parts of Cuba mostly unknown to the outside world, the wild mountains of western Argentina, festivals in Columbia, the Great Lakes of the United States, and the labyrinthine canyons of Southeast Utah. Along the way, he meets people from all walks of life - natives and immigrants, islanders and mainlanders, pastoralists and city-dwellers, scientists, and river runners - and hears their stories. David Yetman, longtime host of The Desert Speaks (also distributed through APT Exchange) is a research social scientist at the Southwest Center of the University of Arizona. Yetman is also a nationally known author of numerous books and articles and an accomplished photographer.\r\n\r\n",
