      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "Season Nine of In the Americas with David Yetman features the Grand Canyon viewed from a raft on the Colorado River that carved it, first from the viewpoint of researchers and advocates for the River, and then from the scientists who study how the river and the canyon formed each other.  From the Canyon we follow the river to its end as its water is diverted on all sides and users scramble for their share of the vital liquid.  After we fly over glaciers in our largest national park in Alaska, we visit the now famous Mexican village of Mata Ortiz, where potters show us their wares and describe how they became famous.  Farther south, two Mexican towns show us their Carnival celebrations, strange, noisy, and wonderful.  To the west we join marine biologists striving to protect the Gulf of California and its bountiful marine resources from poaching and overharvesting.  Brazil's varied population of snakes are the subject of a visit to the Amazon, and how indigenous cultures represent these venomous critters.  To the south, Brazilian researchers house thousands of venomous species and extract their venom to protect human lives and advance cures for disease.  Back in Arizona we learn of Arizona's explosive volcanic past and how new violence could erupt at any time.  \r\n \r\n",
      "ProgramTitle": "In The Americas with David Yetman",
