      "ProgramSummary": "Inspired Lives Black History Month 2024 season premiere features FUBU founder, Godfather of Urban Fashion and Shark Tank investor Daymond John, and five-time Grammy Award-winner Dionne Warwick, the legendary recording artist who's sold more than 100-million records worldwide.\r\n\r\nTony Fama meets one on one with John and Warwick, discussing the steps each took to gain international success, and shows what both are doing to support communities in need. \r\n\r\nInspired Lives season premiere is an advancer to the half hour weekly series beginning April 2024,  telling the inspirational stories of national and international celebrities from the worlds of business, sports, politics, journalism and entertainment.\r\n\r\nInspired Lives looks below the headline of what made these people admired household names, often showing what they're doing now to benefit marginalized and underrepresented communities. \r\n\r\nInspired Lives is hosted by award-winning reporter Tony Fama.",
