      "ProgramSummary": "We don't know how. We don't know when. But death comes to us all. To be human is to wrestle with this truth. \"Into The Night: Darkness and Light\" explores the ways we think about death and about our own deaths in particular. Like its 2018 predecessor, \"Into The Night: Portraits of Life and Death,\" this new film addresses similar themes around the great unanswered question:  How do we live with death inevitably in our sight? To borrow from Dylan Thomas, do we go gently or raging against the night, with equanimity or with anger, with clenched fists or, more commonly, with denial? Or do we see death as something to be fought, or even conquered - a challenge increasingly pursued by some of the brightest scientific minds of our day?  Finally, what are the stories we tell ourselves as we go into the night -- or into the light? Do our narratives about religion, science, art, the natural world, or the power of love sustain us or do they fall away at the end?  \r\n\r\nInto The Night: Darkness and Light, however, stands on its own, presenting the stories of nine fascinating men and women from various walks of life who are grappling with these questions: young and old, believers and unbelievers, dying and healthy. Each has been shocked into mortality -- and has been forever changed, their dramatic, life-changing experiences revealing as much about life as about death. Among them: a longevity scientist pushing back against death; a transhumanist who believes humans can be designed to live indefinitely; a Native American physician with stage four cancer who finds strength in the rituals of her Comanche grandmother; an Orthodox Jewish Director of Ancient texts at Harvard who is forced by his cancer diagnosis to reconsider his own relationship to God; a well-known photographer who comes to  realize that love, not art, will be his legacy; and two American Buddhist monks whose mission is to be fully present to the dying.  However varied their backgrounds, these men and women are united by their uncommon eloquence and intelligence.  \r\n\r\nViewers will leave \"Into The Night: Darkness and Light\" enlivened, even exhilarated, seeing death, in the words of one participant, \"as the gateway to a fuller, more conscious life.\"  \r\n\r\n\"Into The Night: Darkness and Light\" is produced by Oscar-nominated and Emmy and Peabody award-winning film producer, director and writer Helen Whitney and narrated by Sharon Stone.",
