      "ProgramSummary": "This documentary project will shed light on the little-known history of plantations and the enslaved in North Florida. In creating a visually compelling story that explores the history of a people who contributed so much to what Leon county is today, it can advance a sense of place and identity for hundreds of thousands of African-Americans. It is our goal to both show the invisible history of slavery in Leon County and the environs and to trace its economic, social and political effect on our community today. In addition, this documentary will be a useful tool in educating our communities and engaging important conversations.\r\n\r\nLeon County was considered the heart of the cotton plantation belt in Florida. It contained the most-dense collection of medium to large plantations. In 1860, there were 75 large plantations with each one having at least 30 slaves. In addition there were 146 plantations that had 500 or more acres. Some of these had 100 or more slaves on the plantations as well. In fact, in 1830 Leon was the most populated county in Florida with an approximately equal number of white and blacks. By 1860 the number of enslaved would have risen to 70%25. Indeed the domestic slave trade in Florida was centered in Leon. At least two prominent slave traders operated in Tallahassee and or Leon County, Paterson and Hughes and T. R. McClintock. Often these traders would advertise these auctions in local papers. Beneath the feet of Leon County and Tallahassee residents and visitors are the remains of this same plantation environment. . It is clearly important to create awareness of the damaging social economic and political legacies that are rooted in slavery.",
