      "ProgramSummary": "Ivan Doig (1939-2015) mined his hardscrabble Montana childhood to create an iconic body of literary work. His captivating and at times heart-breaking narratives embody the harshness and beauty of the western landscape, draw upon his experience as journalist and historian, and celebrate the grit required for his beloved characters to survive in challenging social and physical climates. His dedication to language, people and place has made him one of the most influential and celebrated authors of the American West.\r\nDoig rejected caricatures and stereotypes of the West that dominated film, television, and works of fiction. Instead, he honored the ordinary heroes who raised families and built communities despite inhospitable circumstances. His tender and poetic portrayals of hard-working characters and the landscapes they inhabited resulted in an award-winning memoir, critically acclaimed novels, and national best-sellers.\r\nDoigâ€™s literary philosophy is perhaps best summed up in his own words, \"If I have any creed that I wish you as readers, necessary accomplices in this flirtatious ceremony of writing and reading, will take with you from my pages, it'd be this belief of mine that writers of caliber can ground their work in specific land and lingo and yet be writing of that larger country: life.\"\r\n",
      "ProgramTitle": "IVAN DOIG: LANDSCAPES OF A WESTERN MIND",
