      "ProgramSummary": "J SCHWANKE’S LIFE IN BLOOM SEASON 3\r\n\r\nSame great flower series but with new flowers, new adventures and MORE flower power!  \r\nIn Season 3 of J SCHWANKE’S LIFE IN BLOOM, host J Schwanke continues his emphasis on the health and wellness benefits of flowers, and the calming nature of the Life in Bloom series.\r\n\r\nDid you know it’s been scientifically proven that the act of arranging flowers lowers blood pressure and releases endorphins in the body? J SCHWANKE’S LIFE IN BLOOM is all about flowers, and how living a life surrounded by colorful blossoms can reduce stress, instill wellness, and enhance happiness. Each episode features a wealth of ideas on how to bring the beauty of flowers into your surroundings, and how to harness the health and wellness benefits that they have to offer. \r\n\t\r\nJ Schwanke is a fourth generation florist and award-winning author whose passion for flowers is infectious. In season 3, J tours beautiful flower fields, visits a bee apiary, explores the color purple, creates showstopping floral arrangements, explains Decoration Day, and discusses how flowers intersect with celebrations and history.  J also shares his easy arranging tips and techniques, plus makes delicious floral food and cocktail recipes. \r\n\r\n\r\nEpisode Listings \r\n\r\nEpisode #301 – Fields of Flowers\r\nHost J Schwanke visits the world-famous Flower Fields in California, and learns its history. Also included: “fields” to grow in your own garden, flowers to hang on a wall, and a flatbread flower field.\r\n\r\nEpisode #302 – Hearts and Flowers\r\nHost J Schwanke explores the sentiment of hearts and flowers and how they combine to express emotion. Heart-shaped arrangements are featured, messages with flower petals, and hand-crafted soaps made with flowers, “from the heart.”\r\n\r\nEpisode #303 – Pollinators in Bloom \r\nHost J Schwanke spotlights pollinators, essential for flowers. Included: a visit to a Bee Apiary, ways to support pollinators, pollination 101 and a cocktail that features honey.\r\n\r\nEpisode #304 – Plants and Flowers for a Healthy Home \r\nHost J Schwanke focuses on plants, blooming and otherwise. Plants that can improve the health of your home are reviewed,  palm-weaving is demonstrated, and an artichoke spritzer cocktail.\r\n\r\nEpisode #305 – Lilies in Bloom\r\nHost J Schwanke highlights the Lily, including planting bulbs, and essential care techniques. Also: advice from an expert lily grower, fun and easy arrangements, and a festive hors d'oeuvre.\r\n\r\nEpisode #306 – Purple Passion \r\nHost J Schwanke cultivates a passion for purple. Precious violets, easy centerpieces, and a regal showstopper with lilacs are included. Also, a visit to a Florida clematis farm.  \r\n\r\nEpisode #307 – Flowers for Celebrating Life \r\nWays of celebrating life through flowers are explored. Host J Schwanke shares memories, and creates personalized flower arrangements. Viewers learn the history around Decoration Day.\r\n\r\nEpisode #308 – Coffee, Tea, or Flowers? \r\nHost J Schwanke explores connections between coffee, tea and flowers – including recycled grounds, blooming teas, and themed arrangements. Plus: learn about the creator of a popular, vintage dinnerware pattern.\r\n\r\nEpisode #309 – Mum’s the Word \r\nMum’s the word, as the chrysanthemum takes center stage. Host J Schwanke shows the many shapes and sizes of this beautiful flower. Included: a flower farm visit, and chrysanthemum cocktail.\r\n\r\nEpisode #310 – Water: Nature’s Life Force \r\nHost J Schwanke visits a flower farm with extensive water reclamation practices. Learn to create submerged flower arrangements, ideas for flower on-the-go, and flowers on ice.\r\n\r\nEpisode #311 – Nature Centered \r\nHost J Schwanke takes a deeper dive into nature including a visit to a nature center with animal ambassadors. J’s young friends teach him how to raise and release monarch butterflies. \r\n\r\nEpisode #312 – Sunshine Flowers \r\nThe timeless sunflower is featured. Host J Schwanke arranges sunflower, creates three-dimensional wall art, and welcomes a clever baker - all inspired by the iconic bloom. \r\n \r\nEpisode #313 – Bloom Happy \r\nHost J Schwanke reminds viewers to take time to enjoy what makes them happy - including flowers. Included: fragrant flowers, novelty arrangements, and a visit to the historic San Francisco Flower Mart.\r\n",
