      "ProgramSummary": "\r\nSeason 4 of J SCHWANKE'S LIFE IN BLOOM brings viewers new flowers, new adventures and MORE flower power!  In 13 all-new episodes, host and floral expert J Schwanke reveals the health and wellness benefits of flowers, and the calming nature of the Life in Bloom series.\r\n\r\nDid you know it's been scientifically proven that the act of arranging flowers lowers blood pressure and releases endorphins in the body? J SCHWANKE'S LIFE IN BLOOM is all about flowers, and how living a life surrounded by colorful blossoms can reduce stress, instill wellness, and enhance happiness. Each episode features a wealth of ideas on how to bring the beauty of flowers into your surroundings, and how to harness the health and wellness benefits that they have to offer. \r\n\r\nJ Schwanke is a fourth generation florist and award-winning author whose passion for flowers is infectious. Season 4 includes episodes dedicated to Gladiolus, Hydrangea, Stock and Tropical Flowers, as well as flower-filled subjects like Recycling, Music, Birds, the Color Green, and an Italian Inspired Episode.  J also explains about Flower Care, Simple Flowers, Cocker Spaniels, and Earth wise practices. This seasons, J's guests include children's book author Laurie Keller, music composer Ben Scott Brandt, and more friends sharing their flowerful experiences. J also shares his easy arranging tips and techniques, plus makes delicious floral food and cocktail recipes. ",
