      "ProgramSummary": "JFK: BREAKING THE NEWS offers a close-up look at how reporters responded to a national tragedy. Through the lens of journalists working in Dallas in 1963, audiences will learn about the moment-by-moment experiences of those who covered one of the most significant events in U.S. history. Their reflections also allow us to witness the remarkable rise of television as a primary source for breaking news coverage. Narrated by Jane Pauley, the documentary also reveals the tremendous technical obstacles that had to be overcome and the immediate journalistic decisions that accompanied the initial live remote broadcasts generated by television four decades ago. ",
