      "ProgramService": "Syndication",
      "ProgramStatus": "To be screened",
      "ProgramSummary": "\r\nDumb and Dumber, The Mask, Me, Myself & Irene, Ace Ventura., Who killed Roger rabbit... Jim Carrey ruled over the 90s with an incurable and subversive style. Contortionist face and actor of the digital revolution he surfed on the last golden age of the cartoon before the takeover by Disney-Marvel franchises in Hollywood. He was the pulling face of the Clinton years, the link between Charlie Chaplin and Roger Rabbit, the last explosion of dumb laugh before the 9/11 depression. Now that Donald Trump, his intimate enemy, stole his role as a toon, what place can Jim Carrey still find on screens where comedy is in decline? \r\nMuch more than a doc for film buffs, this is a vibrant reminder of a lighthearted  era where grotesque and foolish was never too much for Jim Carrey’ Comedies and were the fools were only actors…not Presidents!   Welcome  into the untamable and outrageous world of the artist who played the Dumb and the Kingfools!\r\n",
