      "ProgramSummary": "Jimi Hendrix: Electric Church presents the legendary guitarist in full flight at the 1970 Atlanta Pop Festival before the largest US audience of his career. This critically acclaimed film combined color, 16mm multi-camera footage of Hendrix’s unforgettable July 4, 1970 concert in its original performance sequence together with a new documentary that traces his journey to the festival amidst the dark shadow of civil rights unrest, the unrelenting toll of the Vietnam War and a burgeoning festival culture that drew together young people across the country who were inspired by the Woodstock festival. \r\nThe film contains breathtaking, color 16mm footage of Jimi Hendrix’s Independence Day appearance, a mere ten weeks before his untimely passing. Standout performances include such Hendrix classics as “Hey Joe,” “Voodoo Child (Slight Return),” “Purple Haze,” as well as confident, compelling versions of songs such as “Room Full Of Mirrors,” “Freedom,” and “Straight Ahead” that had not yet been issued by Jimi on an Experience album, but were intended to be part of the album he was working on that summer. “Star Spangled Banner,” played against a backdrop of exploding fireworks, is another highlight.”",
      "ProgramTitle": "JIMI HENDRIX: ELECTRIC CHURCH",
