      "ProgramSummary": "This one-hour documentary by award-winning director Isaac Artenstein is about Harry Crosby, renowned photographer and historian, whose journeys have resulted in five classic books documenting the culture of Mexico's Baja California peninsula. Inspired by Harry's richly illustrated books and on-camera testimonials, Artenstein and his crew traveled throughout Baja California to retrace his journeys from land and air.  This film is an engaging documentary that embraces a life of creativity, adventure and shared bi-national stories that speak to a long-time spirit of mutual understanding and conservation between the U.S. and Mexico.",
