      "ProgramSummary": "Produced in DUTCH.  Fould need to be reformatted.  From Joe:\r\n\r\nJussen Brothers.  Arthur and Lucas.  They are young Dutch pianists who are quite popular in Europe.  You can check them out at arthurandlucasjussen.com.  They do both 4 hands (one piano they play together) as well as works composed for two pianos.  You will see they are quite handsome, quite talented and they speak English!\r\n\r\nThere is an existing program that we think we can acquire and package (it's less than an hour, and has a boring Dutch host) for around $75K.  They would be willing to appear in the breaks.  I'm not sure a concert tour is realistic given the size of venue they would appear in.\r\n\r\nWe haven't done the due diligence on rights, etc pending finding any interest in the US.",
