      "ProgramService": "Syndication",
      "ProgramStatus": "Contract",
      "ProgramSummary": "\r\nThis heart-warming documentary is a celebration of a figure who embodies the timeless grace of royalty while forging a path of her own.\r\nKate, Princess of Wales and future Queen of England… a nation’s hopes resting on her shoulders. Beginning her life as a commoner and marrying into royalty is a journey straight from a fairytale. But what will it mean when she finally becomes Queen Consort? And how will it affect the way she carries out her royal duties?\r\nThis moving and insightful documentary delves deep into Kate’s role, exploring the myriad challenges that she now faces. As someone who not only married into the nobility, but also married the future King, Kate has had to learn quickly how to adapt to royal protocol and how to support her husband in his royal duties.\r\nMixing stunning archive with fascinating insights and interviews from some of the world’s top royal experts, this fascinating film will cover all things Kate.",
