      "ProgramSummary": "In the 1980s, a 3-story ark was built in Newark's devastated Central Ward. Kea Tawana, a self-taught artist and builder, designed and built the massive boat by herself, using salvaged materials from 19th century buildings being torn down, in an area fast becoming an urban wasteland. She worked on it for years before Newark city officials took note and demanded it gone. It no longer exists, but Kea's Ark remains a powerful symbol of hope in Newark and beyond.",
