      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "\"Keeper of the Flame\" is a feature-length documentary film about the life and work of human rights activist Jack Healey. Working for a decade at the forefront of human rights as the director of Amnesty International USA, Healey played a major role in bringing human rights to a televised national and international public, through the fusing of popular music and activism, collaborating with the likes of Peter Gabriel, Sting, and Wynton Marsalis. Tracking Healey's activism back to the Civil Rights Movement, the film lays the groundwork for his lifelong commitment to human rights work. Learning from and working with the likes of Dick Gregory, Fannie Lou Hamer, Father James Groppi and John Lewis, Healey's activist spirit is visible in the midst of Apartheid in South Africa, in his fight to bring global human rights violations to the news media, and in his continuing demands for the release of Native American activist Leonard Peltier. Healey demonstrates the importance of knowing history, the importance of staying aware and educated, of speaking up, and the importance of looking ahead. \"Keeper of the Flame\" shows what a life of activism entails, questions what it means and how it's done, and presents Healey's ten lessons in activism. ",
      "ProgramTitle": "KEEPER OF THE FLAME",
