      "ProgramSummary": "The Kennedy family has been an American cultural icon for decades, representing glamour, power, and tragedy. A troubled family with still little-known facets: nine siblings, including five sisters, whose lives set highlights of the American century, and revealed its abysses. This time, the focus is not just on the lives and deaths of the famous brothers. Rather, this documentary explores the intricate web of relationships between all family members, revealing the complexities of their dynamics and the everlasting influence of their Irish heritage. Featuring interviews with family members, historians and experts, this film provides a unique perspective on one of America’s most famous families. ",
