      "ProgramService": "Exchange",
      "ProgramStatus": "Contract",
      "ProgramSummary": "     Chef Kevin Belton is ready to hit the trail, the culinary trail that is, in a new cooking series from WYES-TV. In his fourth public television venture, Chef Belton will explore the rich and multi-faceted foodways of Louisiana on Kevin Belton's Cookin' Louisiana, a tasty 26-part tour of the Pelican State's best flavors and dishes.    \r\n     The award-winning chef will visit locations across the state for a look at the authentic food traditions of Louisiana cuisine. The road trip will start in Lafourche Parish, an area southwest from New Orleans where the chef's French speaking grandmother grew up and where the catch of the day is sourced from the 106 miles of bayou that weave through the parish. \r\n    Chef Belton's Louisiana road trip will take him from the River Parishes, where the region's German heritage influences its food culture, to Acadia Parish where he'll \"have a rice day\" in a locale known as the Rice Capital of America. In Sabine Parish the chef will sample tamales in a pocket of Spanish culture dating back to the 18th century. And in Arnaudville, a city that rests on the border of St. Landry and St. Martin Parishes, he'll go in search of the Cajun Kevin Po Boy, an upright seafood and sausage stuffed sandwich inspired by the cypress knees of the bayou. \r\n     Back in the studio, Chef Belton will prepare his take on the outstanding dishes of the state. He'll salute the Crawfish Capital of Louisiana with a flavored packed Crawfish Burger and sample the bounty of the Sportsman's Paradise with Savory Sweet Quail with Grilled Peaches. \r\n     In his travels, the chef will seek out dishes that reflect Louisiana's complex blending of cultures, preparing Filipino-style Beef Tapa with Sinangag (Garlic Fried Rice), Hungarian Stuffed Cabbage Rolls and traditional Czech Kolaches. He'll also dip into the bounty of Louisiana's food culture with dishes that reflect its prolific fisheries, its citrus harvest and its thriving family friendly \"you pick\" farm experiences. Chef Kevin will even give a shout out to Louisiana's state beverage, milk, with a BLT Cheesecake featuring Creole cream cheese. \r\n     From Chicken and Dumplings, one of the Delta Delights from Northeast Louisiana, to Cracklins Cornbread from Evangeline Parish in the Cajun Heartland, Kevin Belton's Cookin' Louisiana will take viewers on a fun-filled food odyssey with the 6'9\"gregarious chef.  \r\n\r\n",
      "ProgramTitle": "Kevin Belton's Cookin' Louisiana",
